INSERT INTO `photo_mst` VALUES (1,'泊港のシーサー','IMGP1350.jpg','怒ってるようですがどこか間が抜けてます。',810,543,100,67,39,26,127.68372774124,26.223445991668,'2007-04-09 12:24:46','2007-04-09 12:24:48','2007-05-13 15:31:38',NULL,'2007-05-29 09:59:56'),(2,'前島一丁目','IMGP1351.jpg','ありひゃぁ！とびっくりしたとき言うらしい。',810,543,100,67,39,26,NULL,NULL,'2007-04-09 12:36:01','2007-04-09 12:36:04','2007-05-13 15:35:55',NULL,'2007-05-29 09:59:57'),(3,'石敢當とリプトン','IMGP1354.jpg','表札型（中）。沖縄（都市部）のゴミに対する意識は残念ながら本土並みの低さです。',810,543,100,67,39,26,127.68896341324,26.218325592426,'2007-04-09 12:45:29','2007-04-09 12:45:30','2007-05-27 09:46:21',NULL,'2007-05-29 09:59:58'),(4,'ブロックの石敢當','IMGP1355.jpg','表札型（中）。ブロックにくっつけてでも置きたいらしい魔除けのようです。',810,543,100,67,39,26,127.68916726112,26.218022403825,'2007-04-09 12:45:49','2007-04-09 12:45:50','2007-05-21 11:34:45',NULL,'2007-06-02 15:24:28'),(5,'石碑型の石敢當','IMGP1356.jpg','石碑型。つい座りたくなっちゃいそうだけど、ダメだよね？',810,543,100,67,39,26,127.68866300583,26.218344842469,'2007-04-09 12:45:55','2007-04-09 12:45:56','2007-05-21 11:36:01',NULL,'2007-05-29 10:00:01'),(6,'交差点の石敢當','IMGP1357.jpg','埋め込み石碑型。',810,509,100,62,39,24,127.68896341324,26.217940590892,'2007-04-09 12:46:04','2007-04-18 18:41:49','2007-05-21 11:36:34',NULL,'2007-05-29 10:00:04'),(7,'牧志二丁目の石敢當','IMGP1359.jpg','表札型（小）。',810,543,100,67,39,26,127.68977880478,26.217536337911,'2007-04-09 12:46:53','2007-04-09 12:46:56','2007-05-21 11:37:08',NULL,'2007-05-29 10:00:07'),(8,'やけに立派な石敢當','IMGP1360.jpg','石碑型。これって沖縄で採れた石なのかなぁ？',810,543,100,67,39,26,127.68956422806,26.21747858737,'2007-04-09 12:47:08','2007-04-09 12:47:10','2007-05-21 11:37:30',NULL,'2007-05-29 10:00:10'),(9,'五角形の石敢當','IMGP1361.jpg','石碑型。ペンキも当然石敢當を避けて通ります。',810,543,100,67,39,26,NULL,NULL,'2007-04-09 12:47:38','2007-04-09 12:47:40','2007-05-21 11:37:43',NULL,'2007-05-29 10:00:13'),(10,'壷屋一丁目','IMGP1362.jpg','色あせてさびたシャッターとペンキとの対比が沖縄っぽくておもしろい。',810,543,100,67,39,26,NULL,NULL,'2007-04-09 13:00:31','2007-04-09 13:00:34','2007-05-08 05:40:40',NULL,'2007-05-29 10:00:16'),(11,'平和記念公園の空','IMGP1365.jpg','ガジュマルの緑が濃いですね〜\n',810,543,100,67,39,26,127.72205114365,26.095792421296,'2007-04-12 12:40:53','2007-04-12 12:40:54','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:19'),(12,'平和記念公園のガジュマル２','IMGP1367.jpg','綺麗な木漏れ日でした。',810,543,100,67,39,26,127.72192239761,26.095850232105,'2007-04-12 12:41:29','2007-04-17 19:44:35','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:22'),(13,'平和記念公園のガジュマル','IMGP1369.jpg','かすかな木漏れ日に惹かれて撮りました。',810,543,100,67,39,26,127.72205114365,26.095599718392,'2007-04-12 12:42:02','2007-04-17 19:44:04','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:25'),(14,'平和記念公園の杉？２','IMGP1371.jpg','花粉症の人は見たくないかと思いますが・・・（笑）',810,543,100,67,39,26,127.72133231163,26.092969292021,'2007-04-12 12:50:32','2007-04-12 12:50:34','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:28'),(15,'平和記念公園の杉？','IMGP1372.jpg','新芽の黄緑が綺麗でした。',810,543,100,67,39,26,127.72128939629,26.09301746886,'2007-04-12 12:50:41','2007-04-12 12:50:42','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:32'),(16,'平和記念公園の小径','IMGP1374.jpg','日差しが強かったので日陰が涼しかった。',810,543,100,67,39,26,127.72131085396,26.092872938284,'2007-04-12 12:54:02','2007-04-12 12:54:04','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:34'),(17,'慰霊の丘の空','IMGP1375.jpg','この日は久しぶりに晴れて暑かったので、全部お参りするのに２時間以上かかってきつかった。',810,543,100,67,39,26,127.72092461586,26.092506793359,'2007-04-12 12:55:51','2007-04-12 12:55:52','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:35'),(18,'慰霊の丘のベンチ','IMGP1379.jpg','涼しげだけど、きっと蚊がたくさん・・・',810,543,100,67,39,26,127.72119283676,26.091755229133,'2007-04-12 13:05:03','2007-04-12 13:05:06','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:37'),(19,'慰霊の丘の休憩所シーサー','IMGP1380.jpg','慰霊の丘をずっと見守ってきたシーサー。でも割と新しそうにも見えるから二代目？',810,543,100,67,39,26,127.72139668465,26.09192866746,'2007-04-12 13:10:08','2007-04-12 13:10:10','2007-05-13 15:31:38',NULL,'2007-05-29 10:00:38'),(20,'慰霊の丘から','IMGP1382.jpg','こうした景色ひとつからも粛々とした空気の漂う丘でした。',810,543,100,67,39,26,127.72191166878,26.091283090163,'2007-04-12 13:12:25','2007-04-12 13:12:26','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:39'),(21,'慰霊の丘のテッポウユリ','IMGP1383.jpg','大きくうなだれたテッポウユリ。',810,543,100,67,39,26,127.72160053253,26.092044292868,'2007-04-12 13:35:32','2007-04-13 12:48:59','2007-05-11 10:06:34',NULL,'2007-05-29 10:00:41'),(22,'慰霊の丘の花２','IMGP1384.jpg','慰霊の碑のそばに咲いていたスミレの一種？',810,543,100,67,39,26,127.72157907486,26.09212137641,'2007-04-12 13:39:29','2007-04-12 13:39:30','2007-05-11 10:06:25',NULL,'2007-05-29 10:00:42'),(23,'慰霊の丘の花','IMGP1385.jpg','静かに一輪だけ咲いていました。ハイビスカスかな？',810,543,100,67,39,26,127.7216219902,26.092025021975,'2007-04-12 13:47:15','2007-04-12 13:47:16','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:44'),(24,'愛国の碑（愛知）より','IMGP1387.jpg','慰霊の丘から祖国・愛知を望む。',810,543,100,67,39,26,127.7225446701,26.091292725671,'2007-04-12 14:55:16','2007-04-18 15:25:51','2007-05-08 05:38:00',NULL,'2007-05-29 10:00:45'),(25,'平和記念公園','IMGP1389.jpg','修学旅行生がたくさんわいわい来てたけど、できればひとり静かに訪れたい場所です。',810,543,100,67,39,26,127.72307038307,26.094588022941,'2007-04-12 15:22:58','2007-04-12 15:23:00','2007-05-08 05:38:00',NULL,'2007-05-29 10:00:46'),(26,'平和記念公園前のレストラン２','IMGP1390.jpg','チューリップっぽいランプがかわいらしかったので。',810,543,100,67,39,26,127.72137522697,26.096447608793,'2007-04-12 15:34:38','2007-04-12 15:34:40','2007-05-13 15:31:38',NULL,'2007-05-29 10:00:48'),(27,'平和記念公園前のガジュマル','IMGP1392.jpg','沖縄にはそこかしこにこのレベルの樹があるので撮るまでもなかったと言えば、そうですけど。',810,543,100,67,39,26,127.72132158279,26.096360893011,'2007-04-12 16:01:44','2007-04-12 16:01:46','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:49'),(28,'平和記念公園前のレストラン。','IMGP1393.jpg','いい感じにさびれたお店でした。\nサンドイッチがおいしかった。',810,543,100,67,39,26,127.72132158279,26.096360893011,'2007-04-12 16:03:51','2007-05-06 21:36:37','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:50'),(29,'樋川一丁目','IMGP1394.jpg','ガソリンスタンドの壁です。',810,543,100,67,39,26,NULL,NULL,'2007-04-12 17:28:28','2007-04-12 17:28:30','2007-05-08 05:40:40',NULL,'2007-05-29 10:00:52'),(30,'農連市場の白い姉妹','IMGP1395.jpg','兄弟かもしれないですが。',810,543,100,67,39,26,127.68988609314,26.211130665728,'2007-04-12 17:34:51','2007-04-12 17:34:54','2007-05-08 05:39:25',NULL,'2007-05-29 10:00:53'),(31,'開南通りの街路樹','IMGP1397.jpg','ところどころ赤い葉が混じる不思議な樹。夕方に撮りました。',810,543,100,67,39,26,127.68968760967,26.211684137421,'2007-04-12 17:37:17','2007-04-12 17:37:20','2007-05-11 21:40:26',NULL,'2007-05-29 10:00:55'),(32,'浮島通りのパンダさん','IMGP1398.jpg','雨の日も晴れの日も店番を続けた結果（？）、いい感じに灼けました。',810,543,100,67,39,26,127.68790125847,26.213845058224,'2007-04-12 17:43:03','2007-04-12 17:43:06','2007-05-13 15:31:38',NULL,'2007-05-29 10:00:56'),(33,'那覇の朝','IMGP1399.jpg','ゲストハウス柏屋の屋上。\nちなみに右半分は違う建物の屋上です。',810,543,100,67,39,26,127.6879709959,26.213840245527,'2007-04-13 06:24:45','2007-04-13 06:24:46','2007-05-08 05:38:30',NULL,'2007-05-29 10:00:57'),(34,'ギロチン式トイレ','IMGP1401.jpg','ゲストハウス柏屋のトイレ。ワイヤーでつり下げられた扉を上下して出入りします。',365,543,44,67,17,26,127.6879709959,26.213840245527,'2007-04-13 06:38:24','2007-04-17 11:59:33','2007-05-08 05:40:43',NULL,'2007-05-29 10:00:58'),(35,'ギロチン式トイレ２','IMGP1404.jpg','外から見るとこんな感じ。かがんで入ります。',365,543,44,67,17,26,127.6879709959,26.213840245527,'2007-04-13 06:39:36','2007-04-17 11:59:43','2007-05-08 05:40:43',NULL,'2007-05-29 10:01:00'),(36,'ゲストハウス柏屋','IMGP1407.jpg','となりの建物（よその家）との渡り廊下。通れないようにふさがれてますが、そもそもなんで繋げたんだろう？',365,543,44,67,17,26,127.6879709959,26.213840245527,'2007-04-13 06:42:19','2007-04-17 11:59:58','2007-05-08 05:55:28',NULL,'2007-05-29 10:01:01'),(37,'那覇浮島通りの雑居街','IMGP1409.jpg','店のひしめき合う市場裏はこんな感じ。隣の屋上へまたげるほどの距離。しかもつぎはぎ。アジアだなぁ。',810,543,100,67,39,26,127.6879709959,26.213840245527,'2007-04-13 07:14:17','2007-04-13 07:14:20','2007-05-11 21:49:24',NULL,'2007-05-29 10:01:02'),(38,'那覇浮島通りの雑居街２','IMGP1410.jpg','家の上に家があったり、二階に玄関があったり。',810,543,100,67,39,26,127.68807291985,26.213820994739,'2007-04-13 07:15:19','2007-04-13 07:15:20','2007-05-11 21:49:18',NULL,'2007-05-29 10:01:03'),(39,'ゲストハウス柏屋の朝','IMGP1411.jpg','屋上から。',810,543,100,67,39,26,127.68807291985,26.213820994739,'2007-04-13 07:18:03','2007-04-13 07:18:04','2007-05-11 21:49:28',NULL,'2007-05-29 10:01:05'),(40,'ゲストハウス柏屋の朝２','IMGP1412.jpg','雑多な建物の合間に見える南国チックな樹木が那覇っぽい。',810,543,100,67,39,26,127.68807291985,26.213820994739,'2007-04-13 07:18:15','2007-04-13 07:18:16','2007-05-11 21:49:31',NULL,'2007-05-29 10:01:06'),(41,'牧志公設市場そばの石敢當','IMGP1417.jpg','表札型（やや大）。敢の字が厳の旧字で、効果も強そう？',810,543,100,67,39,26,127.68793344498,26.214706527713,'2007-04-13 12:38:16','2007-04-13 12:38:18','2007-05-21 11:38:41',NULL,'2007-05-29 10:01:08'),(42,'泊港の夕暮れ。','IMGP1421.jpg','と言っても赤くないけどね。\nちなみに爬龍とはハーリーの事です。',810,543,100,67,39,26,127.68162488937,26.227218773202,'2007-04-13 17:34:49','2007-04-13 17:34:50','2007-05-08 05:38:21',NULL,'2007-05-29 10:01:09'),(43,'泊港の夕暮れ２。','IMGP1423.jpg','日が傾いて赤くなっていく少し前。',810,543,100,67,39,26,127.68156051636,26.231934578016,'2007-04-13 17:40:39','2007-04-13 17:40:40','2007-05-11 21:40:26',NULL,'2007-05-29 10:01:10'),(44,'フェリー飛竜２１の石敢當','IMGP1424.jpg','埋め込み石碑型。律儀にもT字路の突き当たりにありました。',810,543,100,67,39,26,127.6181101799,26.204041182495,'2007-04-14 02:14:45','2007-04-18 09:59:04','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:58'),(45,'フェリー飛竜２１の中。','IMGP1425.jpg','豪華客船かホテルのような内装。\nでも私は２等客室ですけど。',810,543,100,67,39,26,127.6181101799,26.204041182495,'2007-04-14 02:15:30','2007-04-18 09:58:33','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:59'),(46,'フェリー飛竜２１の壁アート','IMGP1426.jpg','かなりとって付けた感のある調度品ですが。',810,543,100,67,39,26,127.6181101799,26.204041182495,'2007-04-14 02:16:21','2007-04-18 09:58:46','2007-06-01 12:18:35',NULL,'2007-06-01 13:24:00'),(47,'宮古島北環状線上の月。','IMGP1441.jpg','若干ぶれてしまってます。',810,543,100,67,39,26,125.28229236603,24.815056499861,'2007-04-14 04:59:26','2007-04-14 04:59:30','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:16'),(48,'宮古島の三日月','IMGP1447.jpg','まだ夜明け前です。',810,543,100,67,39,26,125.28559684753,24.817588409324,'2007-04-14 05:47:07','2007-04-14 05:47:10','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:17'),(49,'大和井の夜明け','IMGP1448.jpg','まさに太陽が出て消え行こうとしている月。',810,543,100,67,39,26,125.28735637665,24.812368723976,'2007-04-14 06:11:28','2007-04-14 06:11:30','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:19'),(50,'菅直人来たる!!','IMGP1449.jpg','安倍晋三の来訪にぶつけた演説ポスター。でも総理のポスターと比べるとちょっと安っぽいです。',810,543,100,67,39,26,125.28714179993,24.811550693657,'2007-04-14 06:16:31','2007-04-14 06:16:32','2007-06-01 12:24:09',NULL,'2007-06-01 13:24:07'),(51,'安倍総理来たる!!','IMGP1450.jpg','宮古島に現職総理が来るのはン十年ぶりとのことでブックボックス前はかなりにぎわっていたそうです。でも私はこの人が好きではありません。',810,543,100,67,39,26,125.28671264648,24.811472785726,'2007-04-14 06:19:06','2007-04-14 06:19:08','2007-06-01 12:24:09',NULL,'2007-06-01 13:24:09'),(52,'宮古島私立北中学校','IMGP1451.jpg','まだ早朝なので誰もいませんでした。',810,543,100,67,39,26,125.28834342957,24.808122698365,'2007-04-14 06:27:17','2007-04-14 06:27:18','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:23'),(53,'宮古島市立北中学校の朝陽','IMGP1453.jpg','キタチュー（勝手に略）の校庭で撮った写真。不法侵入？まあまあテーゲーに。',810,543,100,67,39,26,125.28834342957,24.808122698365,'2007-04-14 06:27:38','2007-04-14 06:27:40','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:24'),(54,'犬が現れた!!','IMGP1459.jpg','後ろを車がびゅんびゅん走ってます。',809,543,100,67,38,26,125.28825759888,24.807226729423,'2007-04-14 06:32:08','2007-04-17 17:23:17','2007-05-11 21:40:26',NULL,'2007-05-29 10:01:25'),(55,'道案内する犬。','IMGP1463.jpg','しかし言葉が通じないのでどこに案内してくれるのかは不明。',810,543,100,67,39,26,125.28825759888,24.807226729423,'2007-04-14 06:34:46','2007-04-14 06:34:48','2007-05-11 21:40:26',NULL,'2007-05-29 10:01:27'),(56,'名残惜しそうな犬。','IMGP1469.jpg','よく見たら首輪してないけど、野良犬なのか？',810,543,100,67,39,26,125.28632640839,24.806642398362,'2007-04-14 06:35:39','2007-04-14 06:35:42','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:28'),(57,'用事のある犬。','IMGP1471.jpg','声をかけたが振り向きもせず、一目散に走って消えた。',807,543,100,67,38,26,125.28606891632,24.806252842792,'2007-04-14 06:41:15','2007-04-17 17:23:27','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:29'),(58,'マクラム通りの赤い街路樹','IMGP1472.jpg','見た事ない樹なので撮ってみました。',810,543,100,67,39,26,125.28267860413,24.804889388655,'2007-04-14 06:50:04','2007-04-14 06:50:06','2007-05-11 21:40:26',NULL,'2007-05-29 10:01:31'),(59,'宮古島市立図書館','IMGP1474.jpg','色落ちの具合もとても味のある建物。\nすぐ近くに県立図書館もあります。なぜ？',810,543,100,67,39,26,125.28179883957,24.805064690741,'2007-04-14 06:50:17','2007-04-14 06:50:20','2007-05-11 21:40:26',NULL,'2007-05-29 10:01:32'),(60,'西里通りの自販機','IMGP1475.jpg','特に沖縄じゃないですけど、撮ってみた。',810,543,100,67,39,26,125.28031826019,24.805210775623,'2007-04-14 06:56:57','2007-04-14 06:56:58','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:34'),(61,'シーサーとカマキリ','IMGP1476.jpg','頭に乗られたシーサーは少し困惑気味です。',810,543,100,67,39,26,125.27689576149,24.803818092741,'2007-04-14 08:12:37','2007-04-14 08:12:38','2007-05-13 15:31:38',NULL,'2007-05-29 10:01:35'),(62,'巨大な石敢當','IMGP1477.jpg','表札型（特大、中、小）。表札より大きい。と言うか石敢當付け過ぎ？',810,543,100,67,39,26,125.27753949165,24.804110265272,'2007-04-14 08:14:41','2007-04-14 08:14:42','2007-05-21 11:40:08',NULL,'2007-05-29 10:01:36'),(63,'青い戸と石敢當','IMGP1478.jpg','表札型（小）。黒いタイルにとけ込んだ石敢當とエメラルドブルー（もとい宮古ブルー）の戸。なかなか目を引くセンスです。',810,543,100,67,39,26,125.27765750885,24.803857049118,'2007-04-14 08:15:32','2007-04-14 08:15:34','2007-05-21 11:40:29',NULL,'2007-05-29 10:01:38'),(64,'日除けのブーゲンビリア','IMGP1479.jpg','涼しげでいいですね。',810,543,100,67,39,26,125.27890205383,24.802688352477,'2007-04-14 08:30:23','2007-04-14 08:30:24','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:39'),(65,'横断歩道の花','IMGP1481.jpg','アスファルトの境目から生えてきた健気な花。',810,543,100,67,39,26,125.27913808823,24.802113739255,'2007-04-14 08:31:46','2007-04-14 08:31:48','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:41'),(66,'川満電子波治療院','IMGP1482.jpg','どこから入るかも謎ですが、この外観で電子波（？）治療を施すギャップ。というか何を治療してくれるのでしょう？',810,543,100,67,39,26,125.27948141098,24.801685212407,'2007-04-14 08:34:36','2007-04-14 08:34:38','2007-05-11 21:40:26',NULL,'2007-05-29 10:01:42'),(67,'恵子美術館','IMGP1483.jpg','超現実、幻想美術館。\n失礼ながら、建物の不思議さに入れませんでした。',810,543,100,67,39,26,125.2807956934,24.802138087327,'2007-04-14 08:37:37','2007-04-18 15:09:43','2007-05-11 21:40:26',NULL,'2007-05-29 10:01:43'),(68,'下里通りのベンチにて。','IMGP1488.jpg','休憩がてらに一枚。宮古島の市街地にはなぜかベンチがたくさんありました。',810,543,100,67,39,26,125.28062939644,24.802089391178,'2007-04-14 08:39:49','2007-04-14 08:39:52','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:45'),(69,'下里通りのポスト','IMGP1491.jpg','まだ開いていない薬局前にて。',810,543,100,67,39,26,125.28056502342,24.802123478484,'2007-04-14 08:41:32','2007-04-14 08:41:34','2007-05-20 21:36:05',NULL,'2007-05-29 10:01:46'),(70,'裏通りの住屋御嶽（ウタキ）','IMGP1493.jpg','市街地を歩いててこつ然と現れる御嶽。',810,543,100,67,39,26,125.28065621853,24.805619812379,'2007-04-14 09:10:30','2007-04-18 15:08:07','2007-05-20 22:12:05',NULL,'2007-05-29 10:01:48'),(71,'マクラム通りのガジュマル','IMGP1494.jpg','樹根がめっちゃ張り巡らされています。\nなお、手前は月極駐車場のようです。',810,543,100,67,39,26,125.28254985809,24.804631304576,'2007-04-14 09:11:49','2007-05-09 18:06:33','2007-05-20 22:12:05',NULL,'2007-05-29 10:01:49'),(72,'マクラム通りの御嶽（ウタキ）','IMGP1495.jpg','わかりにくいかもしれませんが入り口が完璧にふさがっています。',809,543,100,67,38,26,125.28273224831,24.804538783738,'2007-04-14 09:18:39','2007-04-17 12:40:01','2007-05-20 22:12:05',NULL,'2007-05-29 10:01:50'),(73,'軒先のブーゲンビリア','IMGP1496.jpg','沖縄ではこんな風にごく自然に民家の軒先に花が咲き誇っていました。',810,543,100,67,39,26,125.28010368347,24.80118850898,'2007-04-14 09:45:52','2007-04-14 09:45:54','2007-05-11 21:39:28',NULL,'2007-05-29 21:27:15'),(74,'平良市街外れのガジュマル','IMGP1497.jpg','近くには墓地（亀甲墓）が密集していました。',810,543,100,67,39,26,125.27576386929,24.803603832448,'2007-04-14 13:50:21','2007-04-14 13:50:24','2007-05-11 21:40:26',NULL,'2007-05-29 10:01:53'),(75,'パイナガマビーチと蝶','IMGP1498.jpg','どうやら蝶を撮ろうとしたらしい自分。（中央上）',805,543,99,67,38,26,125.27090370655,24.802371828574,'2007-04-14 14:10:20','2007-04-17 12:35:59','2007-05-21 12:01:32',NULL,'2007-05-29 10:01:54'),(76,'宮古島・４月の空','IMGP1499.jpg','雲はなかったけど、少しかすんだ感じです。',810,543,100,67,39,26,125.27090370655,24.802371828574,'2007-04-14 14:13:21','2007-04-14 14:13:22','2007-05-11 21:40:26',NULL,'2007-05-29 10:01:56'),(77,'パイナガマビーチ','IMGP1500.jpg','宿（風家）から徒歩５分のビーチ。サンダル脱いでぼーっとしてたらいつの間にか波にさらわれ、裸足で帰るハメに（泣）',810,543,100,67,39,26,125.27090370655,24.802371828574,'2007-04-14 14:13:57','2007-04-14 14:13:58','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:57'),(78,'軒先のランタナ','IMGP1502.jpg','この時雨が降る直前の重い空気でした。',810,543,100,67,39,26,125.27810275555,24.803530789081,'2007-04-14 16:47:34','2007-04-14 16:47:36','2007-05-11 21:39:28',NULL,'2007-05-29 10:01:58'),(79,'軒先のランタナ２','IMGP1504.jpg','琉球舞踊で使われる花笠のようなかわいらしい花。本土でも見た事あると思う。（多分）',810,543,100,67,39,26,125.27810275555,24.803530789081,'2007-04-14 16:47:51','2007-04-14 16:47:52','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:00'),(80,'裸の御嶽（ウタキ）','IMGP1510.jpg','色々事情はありましょうが、実際目にすると寂しい光景です。',810,543,100,67,39,26,125.2810049057,24.803930092293,'2007-04-14 16:49:08','2007-04-14 16:49:10','2007-05-20 22:12:05',NULL,'2007-05-29 10:02:01'),(81,'外される石敢当','IMGP1516.jpg','このあと、この石敢当はどこへいくのでしょう...當は当の旧字です。表札型（中）',810,543,100,67,39,26,125.2810049057,24.803930092293,'2007-04-14 16:49:49','2007-04-14 16:49:50','2007-05-21 11:41:00',NULL,'2007-05-29 10:02:03'),(82,'軒先のランタナ３','IMGP1517.jpg','よく見ると琉球舞踊で使われる花笠を思わせるかわいらしい花です。',810,543,100,67,39,26,125.2780598402,24.803633049782,'2007-04-14 17:13:50','2007-04-14 17:13:52','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:04'),(83,'市場通り角の黒犬３','IMGP1519.jpg','ピント合わせるのを忘れててひどいことになってますが、交差点の中央で立ち止まってます。\n宮古では人も犬も信号を守る気にならないようです。',810,543,100,67,39,26,125.27997493744,24.805322773917,'2007-04-15 18:45:05','2007-04-17 12:17:22','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:05'),(84,'市場通り角の犬','IMGP1520.jpg','カメラを向けても反応なし。撮られ慣れてるのか？',810,543,100,67,39,26,125.27997493744,24.805322773917,'2007-04-15 18:45:14','2007-04-15 18:45:16','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:07'),(85,'市場通りの夕方','IMGP1523.jpg','この日は午前中嵐のように風雨がひどかったけど、夕方にはやんでいました。',810,543,100,67,39,26,125.27984082699,24.805483466944,'2007-04-15 18:46:43','2007-04-18 15:03:46','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:08'),(86,'市場通り角の黒犬','IMGP1524.jpg','ちゃんとカメラ目線をくれた愛い奴。女の子です。',810,543,100,67,39,26,125.27994811535,24.805322773917,'2007-04-15 18:47:30','2007-04-15 18:47:32','2007-05-13 15:16:28',NULL,'2007-05-29 10:02:10'),(87,'市場通り角の黒犬２','IMGP1525.jpg','事件かっ！\nてな感じで急に起き上がりました。',810,543,100,67,39,26,125.27994811535,24.805322773917,'2007-04-15 18:47:36','2007-04-15 18:47:38','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:11'),(88,'ファミマトイレの張り紙１','IMGP1526.jpg','ぶれてたので二日後に撮り直しに行ったら破られてた！なんで？\n「つまらないことが多いのは感謝することを知らないから\n心配することが多いのは今を一生懸命生きてないから\n行きづまることが多いのは自分が裸になれないから\n苦しいことが多いのは自分に甘えがあるから\n悲しいことが多いのは自分のことしかわからないから」\n',810,543,100,67,39,26,125.28088152409,24.804529044699,'2007-04-15 18:55:41','2007-04-15 18:55:42','2007-06-01 12:24:09',NULL,'2007-06-01 13:24:11'),(89,'ファミマトイレの張り紙２','IMGP1527.jpg','宮沢和史氏による詩（？）\nこれをトイレで読ませるなんて\n宮古島のファミマはちょっと憎い。',810,543,100,67,39,26,125.28088152409,24.804529044699,'2007-04-15 18:55:44','2007-04-15 18:55:46','2007-06-01 12:24:09',NULL,'2007-06-01 13:24:12'),(90,'市場通りの壁','IMGP1529.jpg','かつて家が建ってたかと思わせるレンガの壁。',810,543,100,67,39,26,125.28048992157,24.805887633333,'2007-04-17 15:02:00','2007-04-17 15:02:02','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:15'),(91,'GIFT SHOP１ねん２くみ','IMGP1530.jpg','那覇の国際通りでも見たような...ちなみに乗れません。店の名前も気になる。',810,543,100,67,39,26,125.28199732304,24.803525919522,'2007-04-17 15:10:20','2007-04-17 15:10:22','2007-05-13 15:31:38',NULL,'2007-05-29 10:02:16'),(92,'海邦銀行のプランター','IMGP1531.jpg','ちょっと一休みに撮ってみました。綺麗な葉の色。',810,543,100,67,39,26,125.28223872185,24.803477223918,'2007-04-17 15:11:59','2007-04-17 15:12:00','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:18'),(93,'西里通り・菊之露酒造所','IMGP1532.jpg','たぶん宮古で一番有名な酒造。奥には販売所が見えます。',810,543,100,67,39,26,125.2824640274,24.803116875858,'2007-04-17 15:12:40','2007-04-17 15:12:42','2007-06-02 11:05:19',NULL,'2007-06-02 12:17:32'),(94,'マクラム通りの古本屋','IMGP1534.jpg','宮古の古書などを扱っている模様。「見学お断り」との事。',810,543,100,67,39,26,125.28259813786,24.802396176595,'2007-04-17 15:17:02','2007-04-17 15:17:04','2007-05-11 21:40:26',NULL,'2007-05-29 10:02:21'),(95,'恵子美術館の壁。','IMGP1535.jpg','これが建物の下半分をぎっしりと。',810,543,100,67,39,26,125.280854702,24.80211860887,'2007-04-17 15:20:35','2007-04-17 15:20:38','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:22'),(96,'ギターを弾くH氏','IMGP1540.jpg','宿・ゆらりのドミトリーにて。\nH氏は兼業ギタリストになりたいとの事です。\n',810,509,100,62,39,24,125.28559148312,24.803769397253,'2007-04-18 10:57:24','2007-04-18 17:56:21','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:23'),(97,'八重干瀬祭り','P4190111.jpg','年に三日だけの解禁のため全国各地から訪れる観光客。主に５０代男女とか。この写真をくれた方もこのために宮古を訪れたとの事。',720,543,89,67,34,26,125.23984909058,24.960848935965,'2007-04-19 11:19:44','2007-04-19 11:19:44','2007-06-01 12:18:35',NULL,'2007-06-01 13:24:21'),(98,'八重干瀬（やびじ）、上陸','P4190128.jpg','この日は４〜５００人くらいでしょうか。',720,543,89,67,34,26,125.23984909058,24.960848935965,'2007-04-19 13:09:56','2007-04-19 13:09:56','2007-06-01 12:18:35',NULL,'2007-06-01 13:24:31'),(99,'ホッパートイレにて。','IMGP3046.jpg','しかし、思いつくまま書いたような詩に見えるが・・・、店員さんの作かな？',810,543,100,67,39,26,125.30652344227,24.787426111117,'2007-04-22 14:42:59','2007-04-22 14:43:00','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:14'),(100,'八重干瀬（やびじ）、上陸２','P4190007.jpg','かなりでかいです。',720,543,89,67,34,26,125.23984909058,24.960848935965,'2007-04-19 13:50:16','2007-04-19 13:50:16','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:31'),(101,'ギターを持つビール職人（？）','IMGP1555.jpg','なお、ギターはただ単に持ってもらっただけです。宿・ゆらりにて。',810,543,100,67,39,26,125.28572559357,24.803808353645,'2007-04-19 09:06:07','2007-04-19 09:06:08','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:33'),(102,'狩俣のプライベートビーチ','IMGP1556.jpg','人目につかない所なので裸で泳ぎました。ちなみに私は男ですが、女の子もやるそうです。気持ち良かった！\n',810,543,100,67,39,26,NULL,NULL,'2007-04-19 11:10:40','2007-04-19 11:10:42','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:34'),(103,'宮古島・快晴','IMGP1557.jpg','紫外線がめっちゃ強かった。',810,543,100,67,39,26,NULL,NULL,'2007-04-19 12:02:06','2007-04-19 12:02:08','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:35'),(104,'彼方を指すH氏。','IMGP1561.jpg','この日は（私の）宮古史上最高の晴れですごく綺麗でした。',810,543,100,67,39,26,NULL,NULL,'2007-04-19 12:28:08','2007-04-19 22:34:31','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:37'),(105,'ひょうたん型','IMGP1563.jpg','このひょうたんには半分ほどまで海が入っております。残りの半分は空（から）です。',810,543,100,67,39,26,NULL,NULL,'2007-04-19 12:28:44','2007-04-19 12:28:46','2007-05-13 15:16:18',NULL,'2007-05-29 10:02:38'),(106,'干潮','IMGP1564.jpg','透明度がすごいです。',810,543,100,67,39,26,NULL,NULL,'2007-04-19 12:29:19','2007-04-19 12:29:20','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:40'),(107,'海の川','IMGP1570.jpg','宮古島は珊瑚でできているので波の浸食でこうなったと思われます。',810,543,100,67,39,26,NULL,NULL,'2007-04-19 12:31:10','2007-04-19 12:31:12','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:41'),(108,'インディアンサラダ（と水）','IMGP1572.jpg','まなつのスパイスカフェ・茶音間にて。\n下にセロリと大根が入ってクセのあるスパイスがかかっていました。',810,543,100,67,39,26,125.28006076813,24.888344064795,'2007-04-19 12:48:32','2007-04-19 12:48:34','2007-05-21 12:00:36',NULL,'2007-05-29 10:02:42'),(109,'茶音間の生け花。','IMGP1573.jpg','南国風アレンジです。',810,543,100,67,39,26,125.28006076813,24.888344064795,'2007-04-19 12:48:38','2007-04-19 12:48:40','2007-05-13 15:31:38',NULL,'2007-05-29 10:02:44'),(110,'「無題」','IMGP1577.jpg','これはH氏の作品。レンタバイクのキーも画材として採り入れた前衛的作風。',810,543,100,67,39,26,125.28006076813,24.888344064795,'2007-04-19 12:51:58','2007-04-19 12:52:02','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:45'),(111,'Heartful Face','IMGP1580.jpg','浜辺で拾った貝がらで作りました。',810,543,100,67,39,26,125.28006076813,24.888344064795,'2007-04-19 12:54:08','2007-04-19 12:54:10','2007-05-11 21:39:28',NULL,'2007-05-29 10:02:47'),(112,'池間大橋疾走中。','IMGP1586.jpg','レンタバイクでアクセル全開。風が気持ち良かった。原付ですが、何か？',810,543,100,67,39,26,125.26285171509,24.9179271534,'2007-04-19 14:08:36','2007-04-19 14:08:38','2007-06-03 00:03:04',NULL,'2007-06-03 18:07:34'),(113,'池間大橋の橋桁。','IMGP1589.jpg','なお、橋桁の間に張ってあるロープはぶら下がって遊べます（バカ）\n',810,509,100,62,39,24,125.25564193726,24.924582370879,'2007-04-19 14:13:11','2007-04-19 22:55:05','2007-05-13 15:31:38',NULL,'2007-05-29 10:02:49'),(114,'出港！','IMGP1590.jpg','池間漁港を出たところ。',810,543,100,67,39,26,125.2489900589,24.924815880759,'2007-04-19 14:32:44','2007-04-19 14:32:46','2007-06-01 12:18:35',NULL,'2007-06-01 13:25:35'),(115,'航跡','IMGP1595.jpg','シャッタースピードが遅くしてみました。',810,543,100,67,39,26,125.2489900589,24.924815880759,'2007-04-19 14:33:52','2007-04-19 23:09:57','2007-06-01 12:18:35',NULL,'2007-06-01 13:25:41'),(116,'海からの池間大橋','IMGP1601.jpg','自転車では結構きつい坂ですね。',810,543,100,67,39,26,125.2534532547,24.920923991689,'2007-04-19 14:34:28','2007-04-19 23:10:12','2007-06-01 12:18:35',NULL,'2007-06-01 13:25:47'),(117,'うねり','IMGP1605.jpg','小型船だったので、かなり揺れました。',810,543,100,67,39,26,125.2534532547,24.920923991689,'2007-04-19 14:34:53','2007-04-19 23:10:44','2007-06-01 12:18:35',NULL,'2007-06-01 13:25:53'),(118,'海からの池間大橋２','IMGP1609.jpg','これは宮古島側です。',810,543,100,67,39,26,125.2534532547,24.920923991689,'2007-04-19 14:35:19','2007-04-19 23:12:47','2007-06-01 12:18:35',NULL,'2007-06-01 13:25:58'),(119,'４月の雲たち','IMGP1621.jpg','向こうに見えるのは西平安名崎です。',810,543,100,67,39,26,125.2534532547,24.920923991689,'2007-04-19 14:36:27','2007-04-19 23:18:24','2007-06-01 12:18:35',NULL,'2007-06-01 13:26:07'),(120,'海からの西平安名崎','IMGP1622.jpg','あのポールは・・・何でしょう？\n（無知ですみません）',810,543,100,67,39,26,125.2534532547,24.920923991689,'2007-04-19 14:36:28','2007-04-19 23:19:03','2007-06-01 12:18:35',NULL,'2007-06-01 13:26:10'),(121,'橋の下１','IMGP1629.jpg','西側。',810,543,100,67,39,26,125.25817394257,24.922013733011,'2007-04-19 14:36:34','2007-04-19 14:36:38','2007-06-01 12:18:35',NULL,'2007-06-01 13:26:16'),(122,'橋の下２','IMGP1632.jpg','東側。',810,543,100,67,39,26,125.25817394257,24.922013733011,'2007-04-19 14:36:36','2007-04-19 14:36:42','2007-06-01 12:18:35',NULL,'2007-06-01 13:26:18'),(123,'池間の水面','IMGP1639.jpg','綺麗なエメラルド♪',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:37:26','2007-04-19 14:37:28','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:03'),(124,'飲酒運転？','IMGP1641.jpg','あれ？奥に見えるのはオリオンでは・・・',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:38:11','2007-04-19 14:38:14','2007-06-02 11:06:11',NULL,'2007-06-02 12:17:53'),(125,'八重干瀬もどき','IMGP1647.jpg','いわゆる「幻の大陸」八重干瀬（やびじ）はもっと大きいそうです。。。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:39:41','2007-04-19 14:39:42','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:06'),(126,'池間島沖の空','IMGP1652.jpg',NULL,810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:39:48','2007-04-21 11:03:36','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:08'),(127,'キラキラ','IMGP1654.jpg','水しぶき。偶然撮れました。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:39:50','2007-04-19 23:29:44','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:09'),(128,'偽・八重干瀬２','IMGP1655.jpg','この時は既に干潮を過ぎて満ち始めでした。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:39:51','2007-04-19 23:27:55','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:10'),(129,'ひこうきぐも','IMGP1658.jpg','青い空に点線。\n山折りなのかキリトリセンなのか。',810,509,100,62,39,24,125.26388168335,24.924076431288,'2007-04-19 14:42:45','2007-04-19 23:31:17','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:12'),(130,'生きたサンゴ','IMGP1663.jpg','完全に空中に出ちゃってます。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:52:03','2007-04-19 14:52:06','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:13'),(131,'八重干瀬（もどき）の浅瀬','IMGP1664.jpg','この青い魚は悠々と泳いでました。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:53:31','2007-04-19 14:53:32','2007-05-15 12:00:40',NULL,'2007-05-29 10:03:14'),(132,'珊瑚とドーベルマン','IMGP1665.jpg','ボートを出してる店の飼い犬です。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:53:34','2007-04-19 14:53:36','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:16'),(133,'魚の家','IMGP1668.jpg','身を守る家なわけですな。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:53:57','2007-04-19 14:53:58','2007-05-15 12:00:40',NULL,'2007-05-29 10:03:17'),(134,'車いすの息子（？）と一緒に・・・','IMGP3210.jpg','トライアスロンには一人一人、物語があるんだなぁ。順位はともかく、完走した人も、完走できなかった人も。そして応援する人にも。',810,543,100,67,39,26,125.29875040054,24.801714430194,'2007-04-22 19:09:48','2007-04-22 19:09:50','2007-05-12 10:08:43',NULL,'2007-05-29 10:03:19'),(135,'青い魚','IMGP1669.jpg','名前わからなくてすみません。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:53:58','2007-04-19 14:54:02','2007-05-15 12:00:40',NULL,'2007-05-29 10:03:20'),(136,'おかえりなさい！','IMGP3212.jpg','トップは15時過ぎにゴールしますが、この時間あたりが一番たくさん帰ってきます。約12時間がんばってきた選手みんなに「おかえりなさーい！」と声をかける。',810,509,100,62,39,24,125.29875040054,24.801714430194,'2007-04-22 19:12:59','2007-05-12 10:06:53','2007-05-12 10:08:58',NULL,'2007-05-29 10:03:21'),(137,'珊瑚島。','IMGP1673.jpg','向こう側に見えるのはすべて死んだサンゴです。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:55:22','2007-04-19 14:55:24','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:23'),(138,'青い魚３','IMGP1679.jpg',NULL,810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:55:44','2007-04-19 14:55:48','2007-05-15 12:00:40',NULL,'2007-05-29 10:03:24'),(139,'うろたえる犬','IMGP1681.jpg','潮が満ちてきてパニックになってます。\nこの後背中に爪を立ててすがられました（痛たっ）',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:55:52','2007-04-19 14:55:54','2007-05-13 15:15:56',NULL,'2007-05-29 10:03:26'),(140,'偽・八重干瀬のサンゴ','IMGP1682.jpg','サンゴって空気中でも死なないのかな？',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:56:29','2007-04-19 14:56:30','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:27'),(141,'岩にはまったシャコ貝','IMGP1684.jpg','改めて見ると結構グロい。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:57:11','2007-04-19 14:57:12','2007-05-15 12:00:40',NULL,'2007-05-29 10:03:29'),(142,'緑の魚','IMGP1686.jpg','オレンジの尾びれがかわいい。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 14:59:51','2007-04-19 14:59:54','2007-05-15 12:00:40',NULL,'2007-05-29 10:03:30'),(143,'サンゴの畑。','IMGP1688.jpg','何種類もの珊瑚がひしめきあっています。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 15:01:13','2007-04-19 15:01:16','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:31'),(144,'焼けた海鼠','IMGP1690.jpg','火であぶったように片面だけ真っ黒になってます。何かあったのか？',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 15:04:02','2007-04-19 15:04:04','2007-05-15 12:00:40',NULL,'2007-05-29 10:03:33'),(145,'テーブルサンゴ','IMGP1691.jpg','死んだサンゴだったら乗っても結構大丈夫です。',810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 15:04:28','2007-04-19 15:04:30','2007-05-11 21:39:28',NULL,'2007-05-29 10:03:34'),(146,'青い魚４','IMGP1692.jpg',NULL,810,543,100,67,39,26,125.26388168335,24.924076431288,'2007-04-19 15:10:04','2007-04-19 15:10:06','2007-05-15 12:00:40'