06-01 12:18:35',NULL,'2007-06-01 13:23:16'),(157,'緑×オレンジの魚','IMGP1712.jpg','大きなサンゴの上をゆうゆうと泳いでいます。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:19:05','2007-05-08 06:21:08','2007-05-15 12:00:40',NULL,'2007-05-29 14:44:52'),(158,'夜明けの出港２','IMGP3255.jpg','宮古が青い薄明の中に消えていく。',810,543,100,67,39,26,125.27306556702,24.811394877746,'2007-04-24 06:26:16','2007-04-24 22:19:16','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:17'),(159,'フェリーから御願崎を望む','IMGP3261.jpg','かなり曇っています。',810,543,100,67,39,26,124.05040740967,24.450900033171,'2007-04-24 09:37:13','2007-04-24 09:37:14','2007-05-11 21:51:20',NULL,'2007-05-29 14:50:08'),(160,'離島へ向かう高速船。','IMGP3264.jpg','高速船はめっちゃ速いです。後ろに飛ばす水しぶきも尋常じゃない！向こうには石垣の街並が。',810,543,100,67,39,26,124.12490844727,24.333958804122,'2007-04-24 10:08:43','2007-05-11 21:52:45','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:19'),(161,'緑の珊瑚','IMGP1724.jpg','こんな間近で見たのは初めてです。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:20:59','2007-05-07 14:26:52','2007-05-11 21:39:28',NULL,'2007-05-29 14:45:01'),(162,'石垣港の灯台','IMGP3267.jpg','高層ビルやらホテルやらマンションが立ち並ぶ。石垣は都会ですなぁ。',810,543,100,67,39,26,124.1425037384,24.335053675309,'2007-04-24 10:12:07','2007-05-12 09:06:39','2007-05-11 21:54:15',NULL,'2007-05-29 14:50:44'),(163,'埋め立て地。','IMGP3269.jpg','また開発が進むのかねぇ。',810,543,100,67,39,26,124.1425037384,24.335053675309,'2007-04-24 10:14:29','2007-05-12 09:06:46','2007-05-11 23:37:36',NULL,'2007-05-29 14:50:48'),(164,'緑×オレンジの魚２','IMGP1729.jpg','２匹でのんびりと。まったく逃げる気配なし。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:22:48','2007-04-19 15:22:50','2007-05-15 12:00:40',NULL,'2007-05-29 14:45:11'),(165,'離島桟橋の鳩','IMGP3279.jpg','逃げる気、０。',810,543,100,67,39,26,124.15649414062,24.33638314903,'2007-04-24 12:29:35','2007-04-24 12:29:36','2007-05-12 08:59:45',NULL,'2007-05-29 14:51:12'),(166,'見送り','IMGP3280.jpg','旅で知り合った人を見送る時に撮った一枚。',810,543,100,67,39,26,124.15649414062,24.33638314903,'2007-04-24 12:32:34','2007-04-24 12:32:36','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:20'),(167,'とうめ美容室','IMGP3281.jpg','カット＆パーマの字体がなんかカッコいいな。店の前面には鮮やかな葉の花が（名前わかりません）',810,543,100,67,39,26,NULL,NULL,'2007-04-24 13:34:36','2007-05-12 09:05:04','2007-05-12 09:01:22',NULL,'2007-05-29 10:04:05'),(168,'緑×オレンジの魚３','IMGP1737.jpg','よく見ると尾びれがすぼまっていて黒い点があります。どっちが前かわからなくなるという擬態？',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:23:39','2007-04-19 15:23:42','2007-05-15 12:00:40',NULL,'2007-05-29 14:45:18'),(169,'とうめ美容室の花','IMGP3282.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-04-24 13:34:46','2007-05-12 09:05:14','2007-05-12 09:04:21',NULL,'2007-05-29 10:04:08'),(170,'あ！','IMGP3283.jpg','「あ」という店。営業時間不定のTシャツ屋。俺も一枚持ってるさぁ。',810,543,100,67,39,26,124.15710031986,24.33879767224,'2007-04-24 13:41:40','2007-05-12 09:05:19','2007-05-12 09:12:11',NULL,'2007-05-29 14:53:09'),(171,'泡盛屋のキューピー','IMGP3284.jpg','もはやどこにでもいるな、こいつら。２年前にもいたっけ？',810,543,100,67,39,26,124.1572290659,24.339066492827,'2007-04-24 13:42:12','2007-05-12 09:05:28','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:28'),(172,'とうめ美容室の花２','IMGP3285.jpg','模様が少しずつ違うのはやはり品種が少しずつ違うってことなのかな。',810,543,100,67,39,26,NULL,NULL,'2007-04-24 17:11:43','2007-05-12 09:05:48','2007-05-12 09:12:56',NULL,'2007-05-29 10:04:12'),(173,'とうめ美容室の花３','IMGP3286.jpg','黄緑色の外側に補色の紫がにじみでてくる。見れば見るほど不思議。',810,543,100,67,39,26,NULL,NULL,'2007-04-24 17:11:58','2007-05-12 09:06:02','2007-05-12 09:13:04',NULL,'2007-05-29 10:04:14'),(174,'採れたてのシャコ貝','IMGP1742.jpg','こりこりして美味♪磯の塩味が効いてます。お店のお兄さんが採ってくれました。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:26:22','2007-04-19 15:26:24','2007-05-15 12:00:40',NULL,'2007-05-29 14:45:26'),(175,'拡大図２','IMGP3287.jpg','しそのような色。',810,543,100,67,39,26,NULL,NULL,'2007-04-24 17:45:20','2007-05-12 09:06:09','2007-05-12 09:13:16',NULL,'2007-05-29 10:04:16'),(176,'サンゴの国境','IMGP1743.jpg','どちらかが上に出る事もなくきれいにくっついてます。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:27:24','2007-04-19 15:27:26','2007-05-11 21:39:28',NULL,'2007-05-29 14:45:33'),(177,'黒い海鼠','IMGP1744.jpg','ナマコって触ってみると意外と柔らかくない・・・',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:28:35','2007-04-19 15:28:38','2007-05-15 12:00:40',NULL,'2007-05-29 14:45:36'),(178,'水没していくサンゴ','IMGP1745.jpg','引き潮に出現し満ち潮とともに水面に消えゆくサンゴたち。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:29:10','2007-04-19 15:29:12','2007-05-11 21:39:28',NULL,'2007-05-29 14:45:43'),(179,'拡大図','IMGP3290.jpg','これ、ほんとふしぎだよねぇ。なんでこんな色の染まり具合になるのか。',810,543,100,67,39,26,NULL,NULL,'2007-04-24 17:56:01','2007-05-12 09:06:15','2007-05-12 09:13:22',NULL,'2007-05-29 10:04:22'),(180,'サンゴの花','IMGP1747.jpg','ちなみに長靴を借りて散策しました。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:30:39','2007-04-21 11:12:48','2007-05-11 21:39:28',NULL,'2007-05-29 14:45:44'),(181,'サンゴの花２','IMGP1748.jpg',NULL,810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:30:43','2007-04-21 11:12:11','2007-05-11 21:39:28',NULL,'2007-05-29 14:45:51'),(182,'新川付近の花','IMGP3294.jpg','これ、バラの一種かなぁ？',810,543,100,67,39,26,124.14792180061,24.348562824902,'2007-04-24 18:13:02','2007-04-24 18:13:04','2007-05-12 09:13:33',NULL,'2007-05-29 14:54:02'),(183,'新川の石敢當','IMGP3296.jpg','表札型（中）と、表札石碑型。右の大きい方、後から壁に埋めたような感じさね。',810,543,100,67,39,26,124.14760529995,24.348836512026,'2007-04-24 18:18:44','2007-04-24 18:18:46','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:22'),(184,'恋しくて','IMGP3297.jpg','沖縄県産純愛ラブストーリー。純愛ラブってくどいって！\nBEGINがBEGINとして出演しているらしい。GWのみの上映らしくて観に行けなかった。個人的には「ナビィの恋」を超えたという辺りが気になる。',810,543,100,67,39,26,124.1470849514,24.349232379855,'2007-04-24 18:18:58','2007-04-24 18:19:00','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:23'),(185,'後良川のマングローブ','IMGP3298.jpg','後良と書いてシイラ。石垣から来た人も読めなかった。',810,543,100,67,39,26,123.9101600647,24.32347884412,'2007-04-26 10:36:59','2007-04-26 10:37:00','2007-05-12 09:16:11',NULL,'2007-05-29 14:55:38'),(186,'後良川の干潟','IMGP3299.jpg','満潮時にはこの土の部分が全て水になる訳です。',810,543,100,67,39,26,123.9101600647,24.32347884412,'2007-04-26 10:38:55','2007-04-26 10:38:58','2007-05-12 09:16:04',NULL,'2007-05-29 14:55:41'),(187,'青い魚２匹','IMGP1754.jpg','５、６種類の魚がいたけどこの魚が一番たくさんいました。他の魚は用心深くて撮れなかった。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:34:32','2007-04-19 15:34:34','2007-05-15 12:00:40',NULL,'2007-05-29 14:45:58'),(188,'マングローブの森','IMGP3300.jpg','奥の方は既に陸化してます。',810,543,100,67,39,26,123.9101600647,24.32347884412,'2007-04-26 10:42:10','2007-04-26 10:42:12','2007-05-12 09:18:52',NULL,'2007-05-29 14:55:54'),(189,'アマゾン？','IMGP3301.jpg','を彷彿とさせる後良川。自然体験ツアーと称してカヌーで遡るのが人気です。',810,543,100,67,39,26,123.9101600647,24.32347884412,'2007-04-26 10:43:08','2007-04-26 10:43:10','2007-05-12 09:16:58',NULL,'2007-05-29 14:56:32'),(190,'ピンクの花','IMGP3304.jpg','良く見るけど、名前がわからない・・・',810,509,100,62,39,24,123.91187667847,24.320506757445,'2007-04-26 10:58:37','2007-04-26 12:25:44','2007-05-12 09:17:12',NULL,'2007-05-29 14:56:48'),(191,'イリオモテヤマネコ！','IMGP3305.jpg','の剥製です。自然生物観察センターにて。',810,543,100,67,39,26,123.90874385834,24.331143377623,'2007-04-26 14:20:39','2007-04-26 14:20:40','2007-05-12 09:17:58',NULL,'2007-05-29 21:29:19'),(192,'西表の山々','IMGP3306.jpg','八重山にこんな山深き島があるなんて知らなかったよ。',810,543,100,67,39,26,123.88149261475,24.384469429285,'2007-04-26 14:33:01','2007-04-26 14:33:04','2007-05-12 09:18:49',NULL,'2007-05-29 14:58:09'),(193,'船浦へ向かう山中にて。','IMGP3307.jpg','黄色いふわふわした花？を付けてます。これも結構見かける。',810,543,100,67,39,26,123.87908935547,24.392442947552,'2007-04-26 14:36:04','2007-04-26 14:36:06','2007-05-13 14:06:28',NULL,'2007-05-29 14:58:16'),(194,'船浦へ向かう山中にて２','IMGP3308.jpg','ピントの範囲（被写界深度）がかなり浅くて見づらい。すみません。',810,543,100,67,39,26,123.87582778931,24.39791467877,'2007-04-26 14:48:57','2007-04-26 14:48:58','2007-05-13 14:06:22',NULL,'2007-05-29 14:58:22'),(195,'舟浦へ向かう山中にて３','IMGP3309.jpg','名前不明。',810,543,100,67,39,26,123.87582778931,24.39791467877,'2007-04-26 14:49:21','2007-04-26 14:49:22','2007-05-12 16:36:17',NULL,'2007-05-29 14:58:41'),(196,'舟浦へ向かう山中にて４','IMGP3310.jpg','これも名前不明。',810,543,100,67,39,26,123.8796043396,24.396820351485,'2007-04-26 15:06:36','2007-04-26 15:06:38','2007-05-12 16:35:58',NULL,'2007-05-29 14:58:50'),(197,'テーブルサンゴ２','IMGP1764.jpg','真ん中がポコッと突き出てます。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:45:41','2007-04-19 15:45:44','2007-05-11 21:39:28',NULL,'2007-05-29 14:46:23'),(198,'舟浦へ向かう山中にて５','IMGP3313.jpg','名前不明',810,543,100,67,39,26,123.8595199585,24.394788004235,'2007-04-26 16:40:33','2007-04-26 16:40:34','2007-05-12 16:36:05',NULL,'2007-05-29 14:59:16'),(199,'舟浦の入り江','IMGP3315.jpg','道路でせき止められて大きな湖のようになっています。あんまし沖縄臭のしない絵だな。',810,543,100,67,39,26,123.8207244873,24.397133017391,'2007-04-26 17:14:33','2007-04-26 17:14:34','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:25'),(200,'ヘゴの一種','IMGP3317.jpg','これ、ワラビみたいにして食えるらしい。ワラビーじゃないッすよ。',810,543,100,67,39,26,123.85591506958,24.397133017391,'2007-04-26 18:13:07','2007-04-26 18:13:10','2007-05-12 09:22:37',NULL,'2007-05-29 14:59:47'),(201,'小さいサンゴ','IMGP1767.jpg','子どもの握りこぶしくらいでしょうか。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:46:58','2007-04-19 15:47:00','2007-05-11 21:39:28',NULL,'2007-05-29 14:46:25'),(202,'ヘゴの一種２','IMGP3318.jpg','茎はざらざらしています。',810,543,100,67,39,26,123.85591506958,24.397133017391,'2007-04-26 18:13:57','2007-04-26 18:14:00','2007-05-12 09:22:21',NULL,'2007-05-29 14:59:55'),(203,'浸食による造形','IMGP1768.jpg','何に見える？',810,509,100,62,39,24,125.27297973633,24.91928936165,'2007-04-19 15:49:06','2007-05-08 05:32:34','2007-05-13 15:31:38',NULL,'2007-05-29 14:46:33'),(204,'舟浦付近にて。','IMGP3319.jpg','背が高いけど上の方にとがった葉が茂ってるだけ。しかも枝の伸び方、これでいいのか？',810,543,100,67,39,26,123.87325286865,24.398852666039,'2007-04-26 18:33:36','2007-04-26 18:33:38','2007-05-12 09:22:45',NULL,'2007-05-29 15:00:12'),(205,'美原付近のカーブ','IMGP3321.jpg','海の向こうに見えているのは（確か）由布島です。',810,543,100,67,39,26,123.93899917603,24.364298873347,'2007-04-26 18:51:02','2007-04-26 18:51:04','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:30'),(206,'水没するサンゴ島','IMGP1770.jpg','小型船で離れていくとこ。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:51:47','2007-04-19 15:51:50','2007-06-01 12:18:35',NULL,'2007-06-01 13:26:44'),(207,'古見小学校','IMGP3322.jpg','泊まっていた宿の目の前にある小学校。',810,543,100,67,39,26,123.90711307526,24.318942473312,'2007-04-27 15:00:33','2007-04-27 15:00:36','2007-05-12 09:23:35',NULL,'2007-05-31 19:32:34'),(208,'豊原のトヨタ車','IMGP3323.jpg','地元の人はこういうファンキーな車か古い型の軽、あとはバンと軽トラばかり。新しい型の車はレンタカーばかり。\nそれにしてもこの車。ナンバープレートがダッシュボードにあるよ。',810,543,100,67,39,26,123.86449813843,24.259407131648,'2007-04-27 15:30:51','2007-05-11 22:30:51','2007-05-14 09:18:11',NULL,'2007-05-29 15:01:56'),(209,'豊原の空','IMGP3325.jpg','西表ではいつも空に雲があった印象。（４月下旬〜５月初旬）',810,543,100,67,39,26,123.86455178261,24.258966966902,'2007-04-27 15:33:05','2007-04-27 15:33:06','2007-05-14 09:18:03',NULL,'2007-05-29 15:02:43'),(210,'波しぶき','IMGP1773.jpg','あえてピントをずらしたもの。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:51:58','2007-04-19 15:52:02','2007-05-11 21:39:28',NULL,'2007-05-29 14:46:49'),(211,'豊原の空２','IMGP3326.jpg','空の色も薄かった。',810,543,100,67,39,26,123.86612892151,24.259475601583,'2007-04-27 15:33:26','2007-04-27 15:33:28','2007-05-14 09:17:55',NULL,'2007-05-29 15:03:15'),(212,'波しぶき２','IMGP1774.jpg','あえてピントをずらしたもの',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:51:59','2007-04-19 15:52:02','2007-05-11 21:39:28',NULL,'2007-05-29 14:46:53'),(213,'豊原の急カーブ','IMGP3327.jpg','この看板は曲と書いてカーブと読ませたいのだろうか。',810,543,100,67,39,26,123.86486291885,24.259015874171,'2007-04-27 15:36:41','2007-04-27 15:36:42','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:31'),(214,'豊原にて２','IMGP3331.jpg','民家の軒先に割と多い花。例によって名前は知らない。',810,543,100,67,39,26,123.86531352997,24.259035437074,'2007-04-27 15:37:35','2007-04-27 15:37:36','2007-05-14 09:17:34',NULL,'2007-05-29 15:03:36'),(215,'淡い橙のハイビスカス','IMGP3333.jpg','黄色と赤の色素が淡く交じってとても綺麗。',810,543,100,67,39,26,123.86531352997,24.259035437074,'2007-04-27 15:38:13','2007-04-27 15:38:14','2007-05-12 09:39:37',NULL,'2007-05-29 15:03:40'),(216,'犬とニーニー','IMGP1777.jpg','犬もやっと帰れて安心している様子。',810,543,100,67,39,26,125.27297973633,24.91928936165,'2007-04-19 15:52:50','2007-04-19 15:52:52','2007-06-02 23:04:06',NULL,'2007-06-02 23:13:11'),(217,'豊原の空３','IMGP3334.jpg',NULL,810,543,100,67,39,26,123.86619329453,24.259573415711,'2007-04-27 15:39:35','2007-04-27 15:39:38','2007-05-14 09:17:14',NULL,'2007-05-29 15:03:49'),(218,'豊原付近にて。','IMGP3336.jpg','危！遠くからでもわかりすいです。',810,543,100,67,39,26,123.86748075485,24.260218987071,'2007-04-27 15:42:45','2007-04-27 15:42:46','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:33'),(219,'茂みの牛','IMGP3339.jpg','道路の端を歩いていたら真横で牛の鳴き声。びっくりしました。',810,543,100,67,39,26,123.86881113052,24.260864555153,'2007-04-27 15:45:17','2007-04-27 15:45:18','2007-05-12 09:31:06',NULL,'2007-05-29 15:05:06'),(220,'豊原付近にて２','IMGP3340.jpg','制限速度の標識をもじった安全運転の看板なのでしょうが、西表の人はみんな飛ばすので島速度と言われてもピンとこない。',810,543,100,67,39,26,123.87073159218,24.262811020889,'2007-04-27 15:47:19','2007-04-27 15:47:20','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:34'),(221,'豊原付近のうろこ雲','IMGP3341.jpg','ほんとのうろこみたい。',810,543,100,67,39,26,123.87145042419,24.263564167975,'2007-04-27 15:51:07','2007-04-27 15:51:08','2007-05-14 09:16:48',NULL,'2007-05-29 15:05:26'),(222,'帰りの池間大橋','IMGP1783.jpg','原付に乗りながら片手で撮ったら斜めった。',810,543,100,67,39,26,125.26534080505,24.916058957619,'2007-04-19 16:46:30','2007-04-19 16:46:32','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:18'),(223,'豊原付近のモクマオウ','IMGP3342.jpg','本土の人はよく「やる気のない松」と表現するけど、実は折れても折れてもまた生えてくるかなり生命力の強い樹。針みたいな葉だけど広葉樹。県指定の防風林だったが５月に指定から外された。',810,543,100,67,39,26,123.86978745461,24.261490557435,'2007-04-27 15:51:28','2007-04-27 15:51:30','2007-05-14 16:37:55',NULL,'2007-05-29 15:05:51'),(224,'ゆらりでの誕生会','IMGP1784.jpg','なお、誕生会一連の撮影者はこの家族の次男坊です。',810,543,100,67,39,26,125.28561294079,24.803764527703,'2007-04-19 21:32:51','2007-04-19 21:32:54','2007-05-11 21:39:28',NULL,'2007-05-29 15:17:23'),(225,'竹富町交流センター','IMGP3343.jpg','中には入らなかったので何があるのかはわかりません。',810,543,100,67,39,26,123.86926174164,24.264004316804,'2007-04-27 15:52:07','2007-04-27 15:52:10','2007-05-12 09:32:32',NULL,'2007-05-29 15:06:02'),(226,'豊原付近の空','IMGP3345.jpg',NULL,810,543,100,67,39,26,123.87182593346,24.263769570952,'2007-04-27 15:54:47','2007-04-27 15:54:48','2007-05-14 09:16:27',NULL,'2007-05-29 15:06:22'),(227,'豊原の丘を下る','IMGP3346.jpg','向こうに見えているのは大原の集落と仲間川。',810,543,100,67,39,26,123.87235164642,24.264111908508,'2007-04-27 15:55:11','2007-04-27 15:55:12','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:36'),(228,'行き倒れ','IMGP3347.jpg',NULL,810,543,100,67,39,26,0,0,'2007-04-27 15:55:48','2007-04-27 15:55:50','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:37'),(229,'大原のオキナワスズメウリ','IMGP3348.jpg','スイカみたいだけど食べられません。直径３cm程度の小さな実。',810,543,100,67,39,26,123.87694358826,24.266635396903,'2007-04-27 16:00:41','2007-04-27 16:00:42','2007-05-12 09:36:52',NULL,'2007-05-29 15:07:05'),(230,'大原のオオバイヌビワ','IMGP3349.jpg','食べれません。',810,543,100,67,39,26,123.8772547245,24.267016850092,'2007-04-27 16:03:02','2007-04-27 16:03:04','2007-05-12 09:36:59',NULL,'2007-05-29 15:07:12'),(231,'大原にて','IMGP3350.jpg','てぃんさぐの花じゃないけど（あれは鳳仙花）昔よく潰して遊んでたなぁ。潰してみたらやっぱり紺の汁で指が染まった。',810,543,100,67,39,26,123.87753367424,24.267261370765,'2007-04-27 16:07:57','2007-04-27 16:07:58','2007-05-12 09:37:06',NULL,'2007-05-29 15:07:23'),(232,'大原にて２','IMGP3351.jpg','道ばたのオレンジの花。落ちかけていますね・・・',810,543,100,67,39,26,123.87774825096,24.267623260497,'2007-04-27 16:09:17','2007-04-27 16:09:20','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:39'),(233,'月桃の花','IMGP3352.jpg','方言名はサンニン、サニン。葉っぱでムーチー（餅）を包んだりします。いい香り。',810,543,100,67,39,26,0,0,'2007-04-27 16:12:12','2007-04-27 16:12:12','2007-05-12 09:37:43',NULL,'2007-05-29 15:07:40'),(234,'大原にて３','IMGP3353.jpg','かなり大きい葉っぱ。葉脈もきれいに出てますね。',365,543,44,67,17,26,123.87781262398,24.267584137333,'2007-04-27 16:13:21','2007-05-11 22:59:34','2007-05-12 09:37:54',NULL,'2007-05-29 15:07:49'),(235,'大原にて４','IMGP3354.jpg','人んちの軒先にあったので毒見はできませんでした。',810,543,100,67,39,26,123.8781774044,24.268004710721,'2007-04-27 16:19:00','2007-04-27 16:19:02','2007-05-12 09:38:20',NULL,'2007-05-29 15:07:53'),(236,'大原にて５','IMGP3355.jpg','サボテンの一種がかなり上の方まで伸びてる・・・',810,509,100,62,39,24,123.88060212135,24.270753074643,'2007-04-27 16:19:29','2007-05-11 23:01:07','2007-05-12 09:38:33',NULL,'2007-05-29 15:08:55'),(237,'大原の石敢當','IMGP3356.jpg','表札石碑型（中）。花壇に据えられたもの。\n西表島は石敢當の数が少なく、変則的に置かれたものが多かった（気がする）',810,543,100,67,39,26,123.88009786606,24.271085612866,'2007-04-27 16:19:44','2007-04-27 16:19:46','2007-05-21 11:45:42',NULL,'2007-05-29 15:09:16'),(238,'はしゃぐ女の子とお母さん','IMGP1797.jpg','カメラを向けられちょっと照れている様子。ちなみに左端で顔出しNG？になっているのが私。',810,543,100,67,39,26,125.28561294079,24.803764527703,'2007-04-19 21:34:01','2007-04-19 21:34:02','2007-05-11 21:39:28',NULL,'2007-05-29 15:17:13'),(239,'大原にて６','IMGP3357.jpg',NULL,810,543,100,67,39,26,123.88148188591,24.272405976633,'2007-04-27 16:21:03','2007-04-27 16:21:04','2007-05-12 09:39:00',NULL,'2007-05-29 15:09:32'),(240,'大原にて７','IMGP3358.jpg','沖縄の民家には樹は花がたくさんあるけど、西表島は特にそう。',810,543,100,67,39,26,123.88181447983,24.272464659149,'2007-04-27 16:21:20','2007-04-27 16:21:22','2007-05-12 09:39:26',NULL,'2007-05-29 15:09:38'),(241,'大原集落を散歩中','IMGP3359.jpg','普通に放し飼いだったりします。',810,543,100,67,39,26,123.87931466103,24.271398589222,'2007-04-27 16:21:55','2007-04-27 16:21:58','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:40'),(242,'大原のブーゲンとおばぁ','IMGP3360.jpg','買い物に行くところかな？',810,543,100,67,39,26,123.88113856316,24.271672442901,'2007-04-27 16:23:03','2007-04-27 16:23:06','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:42'),(243,'大原集落を舞う蝶','IMGP3362.jpg','蝶を撮るのってけっこう難しい・・・',810,543,100,67,39,26,123.8805270195,24.27205388097,'2007-04-27 16:25:01','2007-04-27 16:25:02','2007-05-21 12:01:32',NULL,'2007-05-29 15:10:11'),(244,'壁に埋まった石敢當','IMGP3363.jpg','表札石碑型（大）。後から色塗った感があるんですけど・・・',810,543,100,67,39,26,123.88002276421,24.271652881943,'2007-04-27 16:25:38','2007-04-27 16:25:40','2007-05-21 11:45:08',NULL,'2007-05-29 15:10:41'),(245,'大原集落のアカバナー','IMGP3364.jpg','よく見るとスクリューみたいにも見える気が（気のせい？\n）アカバナーというのは方言名ですね。ちなみにハイビスカスには270（か170？）の品種があり赤くないのもたくさんあるわけですが。',810,543,100,67,39,26,123.88015151024,24.271887613235,'2007-04-27 16:26:22','2007-04-27 16:26:24','2007-05-12 09:46:34',NULL,'2007-05-29 15:10:54'),(246,'大原集落の植込み','IMGP3365.jpg','歩道の植込みにトマトって・・・なったら誰が食べるんだろう？',810,543,100,67,39,26,123.88192176819,24.272474439565,'2007-04-27 16:38:04','2007-04-27 16:38:06','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:43'),(247,'大原創立５５周年記念碑','IMGP3366.jpg','割りと西表島にこういう碑が多いのはかつてマラリア戦争のあった島だからかも知れません。マラリアで廃村になった集落も数知れず・・・つい50〜100年程前の話です。',810,543,100,67,39,26,123.88084888458,24.273687205394,'2007-04-27 16:42:50','2007-04-27 16:42:52','2007-05-13 15:31:38',NULL,'2007-05-29 15:11:13'),(248,'大原神社','IMGP3367.jpg','鳥居の脇には、漁で使う浮き！？さらに拝殿には招き猫の姿が・・・',810,543,100,67,39,26,123.88121366501,24.273589402127,'2007-04-27 16:43:26','2007-04-27 16:43:28','2007-05-20 22:12:05',NULL,'2007-05-29 15:11:18'),(249,'大原神社の詩と格言','IMGP3368.jpg','これを唱えて拝んだのでしょうか。',810,543,100,67,39,26,123.88121366501,24.273589402127,'2007-04-27 16:44:52','2007-04-27 16:44:54','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:27'),(250,'大原神社の中殿と本殿','IMGP3369.jpg','今度は金の招き猫と赤の浮きが。',810,543,100,67,39,26,123.88121366501,24.273589402127,'2007-04-27 16:46:33','2007-04-27 16:46:36','2007-05-13 15:31:38',NULL,'2007-05-29 15:11:33'),(251,'本殿脇のシーサー（？）','IMGP3370.jpg','よく見てみると、目が・・・？',810,543,100,67,39,26,123.88121366501,24.273589402127,'2007-04-27 16:47:04','2007-04-27 16:47:06','2007-05-20 22:12:05',NULL,'2007-05-29 15:11:36'),(252,'大原公民館','IMGP3372.jpg','役場移転早期実現！！って。竹富町役場を移すって事？\nわりといくつかの集落に同様の看板がありました。',810,543,100,67,39,26,123.88055920601,24.273491598785,'2007-04-27 16:51:23','2007-04-27 16:51:24','2007-05-12 09:50:39',NULL,'2007-05-29 15:11:40'),(253,'古見のアカバナー','IMGP3373.jpg','赤のにじみ方がとても綺麗。',810,543,100,67,39,26,123.90844345093,24.32002769748,'2007-04-27 17:08:15','2007-04-27 17:08:16','2007-05-12 09:52:20',NULL,'2007-05-29 15:12:23'),(254,'古見にて','IMGP3374.jpg','古見は西表島の中に現存する中でかなり古い集落に属する小さい集落です。集落の中にも花や樹がたくさんあります。',810,543,100,67,39,26,123.90899062157,24.319538858914,'2007-04-28 10:20:53','2007-04-28 10:20:56','2007-05-13 15:12:40',NULL,'2007-05-29 15:12:29'),(255,'古見の干潟','IMGP3375.jpg','大潮の時だったらしく、かなり遠くまで、というか見渡す限り干上がっています。',810,543,100,67,39,26,123.90974164009,24.318864258599,'2007-04-28 10:25:38','2007-04-28 10:25:40','2007-05-13 15:13:39',NULL,'2007-05-29 15:12:37'),(256,'古見のマングローブ','IMGP3376.jpg','マングローブとは淡水と海水の混じる汽水域に生える樹全般を指し、八重山ではヤエヤマヒルギが代表的ですが、これがそれかはわかりません。',810,543,100,67,39,26,123.90974164009,24.318864258599,'2007-04-28 10:26:22','2007-04-28 10:26:24','2007-05-13 15:14:39',NULL,'2007-05-29 15:12:39'),(257,'古見のマングローブ２','IMGP3377.jpg','これ、新芽は食べられるそうな。',810,543,100,67,39,26,123.90974164009,24.318864258599,'2007-04-28 10:26:33','2007-04-28 10:26:34','2007-05-13 15:14:48',NULL,'2007-05-29 15:12:44'),(258,'古見の干潟２','IMGP3378.jpg','見渡す限り、何もありません。ぼこぼこしているのは主にカニの巣穴です。',810,543,100,67,39,26,123.90974164009,24.318864258599,'2007-04-28 10:36:33','2007-04-28 10:36:36','2007-05-13 15:19:39',NULL,'2007-05-29 15:12:50'),(259,'古見の干潟３','IMGP3379.jpg','岸からここまで歩いて来ましたが粘り気があるので歩くのも一苦労。泥もはねるし。この距離の２倍くらい沖まで行けそうでしたが、ここで引き返しました。',810,543,100,67,39,26,123.90974164009,24.318864258599,'2007-04-28 10:37:04','2007-04-28 10:37:06','2007-05-13 15:19:58',NULL,'2007-05-29 15:12:52'),(260,'撮影者近影','IMGP1820.jpg','カメラを貸したら大張りきりで撮りまくっていました。',810,543,100,67,39,26,125.28561294079,24.803764527703,'2007-04-19 21:39:35','2007-04-19 21:39:38','2007-05-11 21:39:28',NULL,'2007-05-29 15:17:01'),(261,'古見にいたカニ','IMGP3383.jpg','泡を吹くのに忙しくこちらに気づかない様子・・・',810,543,100,67,39,26,123.90974164009,24.318864258599,'2007-04-28 10:38:25','2007-04-28 10:38:28','2007-05-15 12:00:40',NULL,'2007-05-29 15:13:08'),(262,'マングローブの芽？！','IMGP3384.jpg','マングローブの種は樹上の段階で根を伸ばし、それから落下！地面に突き刺さって成長するらしいですが、これはそれかな？',810,543,100,67,39,26,123.90974164009,24.318864258599,'2007-04-28 10:50:59','2007-04-28 10:51:00','2007-05-13 15:20:33',NULL,'2007-05-29 15:13:06'),(263,'雨降り前。','IMGP3385.jpg','大富集落から古見集落に向かう途中にて。',810,543,100,67,39,26,123.88620257378,24.285080770606,'2007-04-28 17:10:25','2007-04-28 17:10:28','2007-05-13 15:20:46',NULL,'2007-05-29 15:14:41'),(264,'雨降り前２','IMGP3386.jpg','牛たちはお構いなしに餌箱に首を突っ込んでいます。',810,543,100,67,39,26,123.88620257378,24.285080770606,'2007-04-28 17:11:07','2007-04-28 17:11:10','2007-05-13 15:21:01',NULL,'2007-05-29 15:14:49'),(265,'てんとう虫','IMGP3388.jpg','止まっているのは自転車のブレーキワイヤです。',810,543,100,67,39,26,123.88620257378,24.285080770606,'2007-04-28 17:17:05','2007-04-28 17:17:06','2007-05-13 15:21:16',NULL,'2007-05-29 15:14:58'),(266,'仲間貝塚上を飛ぶ鳥','IMGP3389.jpg',NULL,810,543,100,67,39,26,123.89356255531,24.286479223633,'2007-04-28 17:24:53','2007-04-28 17:24:56','2007-05-13 15:21:45',NULL,'2007-05-29 15:15:05'),(267,'牛の子、仔牛','IMGP3391.jpg','おまえ意外とかわいい顔してんな。でもそのピアスはイケてないぜ。',810,543,100,67,39,26,123.89221072197,24.285080770606,'2007-04-28 17:26:20','2007-04-28 17:26:22','2007-05-13 15:22:14',NULL,'2007-05-29 15:15:17'),(268,'三線を弾くお兄ちゃん','IMGP1830.jpg','次男坊のお兄ちゃん。かなりの腕前でした。奥の方はなんとプロ（三線？民謡？すみません忘れました）だそうです。',365,543,44,67,17,26,125.28561294079,24.803764527703,'2007-04-19 21:44:21','2007-04-20 07:37:36','2007-05-11 21:39:28',NULL,'2007-05-29 15:16:54'),(269,'水田のサギたち。','IMGP3394.jpg','サギは割と警戒心が強くこれぐらいの距離でもカメラを向けると飛び立とうとする。',810,543,100,67,39,26,123.89313340187,24.285765329956,'2007-04-29 10:22:23','2007-04-29 10:22:24','2007-05-13 15:22:27',NULL,'2007-05-29 15:15:28'),(270,'宿・ゆらりオーナー','IMGP1831.jpg','本土からの移住だそうです。',365,543,44,67,17,26,125.28561294079,24.803764527703,'2007-04-19 21:45:15','2007-04-20 07:37:38','2007-05-11 21:39:28',NULL,'2007-05-29 15:16:48'),(271,'カラス？','IMGP3395.jpg','にしちゃくちばしや頭の形がおかしい。',810,543,100,67,39,26,123.89503240585,24.287232230421,'2007-04-29 10:25:38','2007-04-29 10:25:40','2007-05-13 15:22:40',NULL,'2007-05-29 15:15:44'),(272,'野原の空','IMGP3396.jpg','野原と言うのは地名です。念のため。',810,543,100,67,39,26,123.93762588501,24.35866930688,'2007-04-29 10:46:24','2007-04-29 10:46:26','2007-05-13 15:22:54',NULL,'2007-05-29 15:22:45'),(273,'野原にて','IMGP3398.jpg','こちらはかなり日差しも強いのに山沿いには重そうな雲が・・・',810,543,100,67,39,26,123.93762588501,24.35866930688,'2007-04-29 10:47:47','2007-04-29 10:47:48','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:45'),(274,'野原の東屋','IMGP3399.jpg','飛んでるのは鳥です。念のため。',810,543,100,67,39,26,123.9395570755,24.361992345151,'2007-04-29 10:49:26','2007-05-12 16:41:22','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:47'),(275,'野原の牛たち','IMGP3403.jpg','向こうに見えるのは由布島だったか、違う島だったか・・・',810,543,100,67,39,26,123.9395570755,24.361992345151,'2007-04-29 10:51:49','2007-04-29 10:51:50','2007-05-13 15:25:20',NULL,'2007-05-29 15:23:01'),(276,'朝焼けを見上げるハイビスカス','IMGP1835.jpg','色の掠れ具合がまた沖縄っぽいなぁと。',810,543,100,67,39,26,125.28611719608,24.803365223958,'2007-04-20 06:40:43','2007-04-20 06:40:44','2007-05-11 21:39:28',NULL,'2007-05-29 15:44:16'),(277,'野原の東屋２','IMGP3404.jpg','向こうに見える島は、わかりません。。。',810,543,100,67,39,26,123.9395570755,24.361992345151,'2007-04-29 10:51:58','2007-05-12 16:47:01','2007-05-13 15:25:35',NULL,'2007-05-29 15:23:13'),(278,'朝焼けを見上げるハイビスカス２','IMGP1836.jpg',NULL,810,543,100,67,39,26,125.28611719608,24.803365223958,'2007-04-20 06:41:03','2007-04-20 06:41:04','2007-05-11 21:39:28',NULL,'2007-05-29 15:44:20'),(279,'近寄ってくる牛','IMGP3405.jpg','エサはやらんどぉ。',810,543,100,67,39,26,123.93992185593,24.362852411429,'2007-04-29 10:53:30','2007-04-29 10:53:32','2007-05-13 15:25:48',NULL,'2007-05-29 21:31:53'),(280,'振り向く若者たち','IMGP3406.jpg','顔がまったく違う！',810,543,100,67,39,26,123.9395570755,24.361992345151,'2007-04-29 10:53:57','2007-04-29 10:54:00','2007-05-13 15:26:00',NULL,'2007-05-29 15:23:24'),(281,'無人島','IMGP3407.jpg','鳥の住処だそうな。',810,543,100,67,39,26,123.94170284271,24.365393482184,'2007-04-29 10:58:02','2007-04-29 10:58:04','2007-05-13 15:26:19',NULL,'2007-05-29 15:23:45'),(282,'轢かれちゃった・・・','IMGP3408.jpg','サキシマハブです。地元の人は路上でハブを見つけるとバックしてでも轢くのだそうな。そこまで憎まなくてもいいのに。',810,543,100,67,39,26,123.89398097992,24.383648597376,'2007-04-29 11:03:29','2007-04-29 11:03:32','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:49'),(283,'高那付近にて。','IMGP3409.jpg','降りそうに見えて、なかなか降らない。島の東西で天気が違う。従って天気予報はまったく当たらない。そんな島です。',810,543,100,67,39,26,123.88758659363,24.381694214234,'2007-04-29 11:06:00','2007-04-29 11:06:02','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:50'),(284,'平良市街の朝陽','IMGP1842.jpg','たまには早起きしてみました。',810,543,100,67,39,26,125.28715252876,24.802590960593,'2007-04-20 06:45:09','2007-04-20 06:45:12','2007-05-11 21:39:28',NULL,'2007-05-29 15:44:32'),(285,'西表島温泉','IMGP3412.jpg','日本最南端だそうな。入泉料が1500円と、私の泊まっていた宿より高かったため、ついつい入りませんでした。',810,543,100,67,39,26,123.9079284668,24.381264245888,'2007-04-29 11:20:16','2007-04-29 11:20:18','2007-06-04 11:32:45',NULL,'2007-06-04 11:47:46'),(286,'野原付近の浜','IMGP3413.jpg','割りと荒い砂の浜です。誰もいなかった。',810,543,100,67,39,26,123.88788700104,24.384039470379,'2007-04-29 11:45:51','2007-04-29 11:45:52','2007-05-13 15:29:15',NULL,'2007-05-29 15:24:35'),(287,'野原付近の浜２','IMGP3414.jpg',NULL,810,543,100,67,39,26,123.88788700104,24.384039470379,'2007-04-29 11:46:08','2007-04-29 11:46:10','2007-05-13 15:29:10',NULL,'2007-05-29 15:24:38'),(288,'野原付近の浜３','IMGP3417.jpg',NULL,810,543,100,67,39,26,123.88788700104,24.384039470379,'2007-04-29 11:52:02','2007-04-29 11:52:04','2007-05-13 15:29:04',NULL,'2007-05-29 15:24:46'),(289,'平良市街の朝陽２','IMGP1846.jpg','朝陽に染まる雲。',810,509,100,62,39,24,125.28715252876,24.802590960593,'2007-04-20 06:47:17','2007-04-20 07:43:57','2007-05-13 15:17:34',NULL,'2007-05-29 15:44:42'),(290,'野原付近の浜４','IMGP3418.jpg','何かの巣穴ですね...',810,543,100,67,39,26,123.88788700104,24.384039470379,'2007-04-29 11:57:44','2007-04-29 11:57:46','2007-05-13 15:29:28',NULL,'2007-05-29 15:24:55'),(291,'野原付近のアダン','IMGP3419.jpg','やしがに君の好物らしい。食べると味は甘いが繊維が多く果汁が少ない。「普通は人は食べないよ」と言われた。',810,543,100,67,39,26,123.88046264648,24.387557273007,'2007-04-29 12:00:50','2007-04-29 12:00:54','2007-05-14 20:07:17',NULL,'2007-05-29 15:25:07'),(292,'平良市街の朝陽３','IMGP1848.jpg',NULL,810,509,100,62,39,24,125.28715252876,24.802590960593,'2007-04-20 06:47:59','2007-04-20 07:44:57','2007-05-11 21:39:28',NULL,'2007-05-29 15:44:49'),(293,'美原付近の蝶','IMGP3426.jpg','なかなか止まってくれずいい写真が撮れなかった。\n初心者ですみません。',810,543,100,67,39,26,123.91582489014,24.335679311739,'2007-04-29 12:27:46','2007-04-29 12:27:48','2007-05-21 12:01:32',NULL,'2007-05-29 15:25:45'),(294,'クロシマベーカリー','IMGP1849.jpg','一級技能士という資格があるらしいですがそれを看板にも戸にも掲げています。ベーカリーってパン屋というわけではないんですね。',810,543,100,67,39,26,125.28703451157,24.802844179332,'2007-04-20 06:48:47','2007-04-20 06:48:48','2007-05-11 21:39:28',NULL,'2007-05-29 15:44:58'),(295,'美原付近の蝶２','IMGP3436.jpg','４枚の写真を撮るのに５〜６０枚ボツにしました。蝶って撮るの難しいな。',810,543,100,67,39,26,123.91582489014,24.335679311739,'2007-04-29 12:28:48','2007-04-29 12:28:50','2007-05-21 12:01:32',NULL,'2007-05-29 15:25:49'),(296,'階段に射す朝陽','IMGP1851.jpg',NULL,810,543,100,67,39,26,125.28699696064,24.802790613873,'2007-04-20 06:49:25','2007-04-20 06:49:28','2007-05-14 16:27:35',NULL,'2007-05-29 15:45:09'),(297,'屋上の犬','IMGP1852.jpg','格子の隙間から顔を出してほえられました。',810,543,100,67,39,26,125.28699696064,24.802790613873,'2007-04-20 06:49:48','2007-04-20 06:49:50','2007-05-11 21:39:28',NULL,'2007-05-29 15:45:13'),(298,'美原付近の蝶３','IMGP3458.jpg','ようやく葉っぱに止まった！・・・と思ったのも束の間。',810,543,100,67,39,26,123.91582489014,24.335679311739,'2007-04-29 12:30:27','2007-04-29 12:30:30','2007-05-21 12:01:32',NULL,'2007-05-29 15:25:56'),(299,'屋上の犬２','IMGP1854.jpg','あまりにもじっと見つめてくるので監視されてる気分になります。',810,543,100,67,39,26,125.28699696064,24.802790613873,'2007-04-20 06:50:01','2007-04-20 06:50:02','2007-05-11 21:39:28',NULL,'2007-05-29 15:45:19'),(300,'美原付近の蝶４','IMGP3472.jpg','もう一匹どこからか現れた。',810,543,100,67,39,26,123.91582489014,24.335679311739,'2007-04-29 12:33:12','2007-04-29 12:33:14','2007-05-21 12:01:32',NULL,'2007-05-29 15:26:04'),(301,'電線の鳥','IMGP1856.jpg',NULL,810,543,100,67,39,26,125.28687894344,24.802805222637,'2007-04-20 06:50:24','2007-04-20 06:50:26','2007-05-11 21:39:28',NULL,'2007-05-29 15:45:31'),(302,'葉っぱとハエ？','IMGP3478.jpg','ハエにしては足が長くてスマートな気も。',810,543,100,67,39,26,123.91582489014,24.335679311739,'2007-04-29 12:34:26','2007-04-29 12:34:28','2007-05-13 15:30:34',NULL,'2007-05-29 15:26:19'),(303,'美原付近の蝶５','IMGP3479.jpg','今度は黄色い蝶。',810,543,100,67,39,26,123.91582489014,24.335679311739,'2007-04-29 12:41:44','2007-04-29 12:41:46','2007-05-21 12:01:32',NULL,'2007-05-29 15:26:24'),(304,'トタンの隙間から','IMGP1858.jpg','真っ白いトタンにピンクのハイビスカス。',810,509,100,62,39,24,125.28666973114,24.80291235352,'2007-04-20 06:51:02','2007-05-09 18:24:43','2007-05-14 16:13:54',NULL,'2007-05-29 15:45:40'),(305,'西表のお墓','IMGP3480.jpg','西表島はわりと四角っぽいお墓が多いようです。',810,543,100,67,39,26,NULL,NULL,'2007-04-29 12:52:53','2007-04-29 12:52:56','2007-05-20 21:38:03',NULL,'2007-05-29 10:07:19'),(306,'庭のハイビスカス','IMGP1859.jpg','逆光になってますが、ハイビスカスたちです。',810,543,100,67,39,26,125.28615474701,24.803345745693,'2007-04-20 06:51:23','2007-04-20 06:51:24','2007-05-11 21:39:28',NULL,'2007-05-29 15:45:55'),(307,'野原付近の東屋３','IMGP3481.jpg','何かの石碑が立っていました。\nESSAYONS L.Z.',810,543,100,67,39,26,123.93908500671,24.363595191236,'2007-04-29 13:02:30','2007-04-29 13:02:32','2007-05-13 15:32:16',NULL,'2007-05-29 15:26:48'),(308,'古見の空','IMGP3482.jpg','鮮やかな快晴。',810,543,100,67,39,26,123.90827178955,24.318355861786,'2007-04-30 13:51:24','2007-04-30 13:51:26','2007-05-14 08:55:03',NULL,'2007-05-29 15:27:28'),(309,'古見の空２','IMGP3483.jpg','細い雲が琉球織物の模様のよう。',810,543,100,67,39,26,123.90801429749,24.317730139834,'2007-04-30 13:53:45','2007-04-30 13:53:46','2007-05-13 15:32:41',NULL,'2007-05-29 15:27:41'),(310,'古見の空３','IMGP3484.jpg','入道雲が横切っています。',810,543,100,67,39,26,123.90801429749,24.317730139834,'2007-04-30 13:54:00','2007-04-30 13:54:02','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:53'),(311,'古見のサキシマスオウ群落','IMGP3485.jpg','天然記念物指定です。',810,543,100,67,39,26,123.90522480011,24.312254941036,'2007-04-30 13:57:48','2007-04-30 13:57:50','2007-05-20 22:12:05',NULL,'2007-05-29 15:27:57'),(312,'ＮＴＴの電波塔','IMGP1864.jpg','平良市街北西の目印。',810,543,100,67,39,26,125.28624594212,24.804042091743,'2007-04-20 06:53:39','2007-04-20 06:53:40','2007-05-11 21:39:28',NULL,'2007-05-29 15:46:07'),(313,'古見のサキシマスオウ','IMGP3486.jpg','弱い地盤でも踏ん張れるように板根を張り巡らしています。',810,543,100,67,39,26,123.90522480011,24.312254941036,'2007-04-30 13:58:45','2007-04-30 13:58:48','2007-05-13 15:34:19',NULL,'2007-05-29 15:28:10'),(314,'古見のサキシマスオウ２','IMGP3487.jpg',NULL,810,543,100,67,39,26,123.90522480011,24.312254941036,'2007-04-30 13:59:09','2007-04-30 13:59:12','2007-05-13 15:34:30',NULL,'2007-05-29 15:28:11'),(315,'古見のサキシマスオウ３','IMGP3489.jpg',NULL,810,543,100,67,39,26,123.90522480011,24.312254941036,'2007-04-30 14:00:30','2007-04-30 14:00:32','2007-05-13 15:34:36',NULL,'2007-05-29 15:28:13'),(316,'古見のサキシマスオウ４','IMGP3490.jpg','下から見上げたところ。',810,543,100,67,39,26,123.90522480011,24.312254941036,'2007-04-30 14:01:46','2007-04-30 14:01:48','2007-05-13 15:34:42',NULL,'2007-05-29 15:28:20'),(317,'平良市街の空。','IMGP1865.jpg',NULL,810,543,100,67,39,26,125.28572022915,24.803720701745,'2007-04-20 10:36:04','2007-04-20 10:36:06','2007-05-11 21:39:28',NULL,'2007-05-29 15:46:22'),(318,'仲間港','IMGP3491.jpg','仲間川の橋から撮ったもの。',810,543,100,67,39,26,123.87994766235,24.27951614412,'2007-04-30 14:28:23','2007-04-30 14:28:24','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:29'),(319,'大原付近の空','IMGP3492.jpg','見上げたら標識があった。',810,543,100,67,39,26,123.87797355652,24.268210106521,'2007-04-30 15:24:38','2007-04-30 15:24:40','2007-05-13 15:35:55',NULL,'2007-05-29 15:29:01'),(320,'ブーゲンと４月の空','IMGP1867.jpg','平良市街にて。',810,543,100,67,39,26,125.2858543396,24.803642788892,'2007-04-20 10:38:02','2007-04-20 10:38:04','2007-05-11 21:39:28',NULL,'2007-05-31 19:36:27'),(321,'大原付近の花','IMGP3493.jpg','筒状の花が４つに割れて中のめしべとおしべが顔を出す面白い花。',810,543,100,67,39,26,123.87664318085,24.266997288418,'2007-04-30 15:26:37','2007-04-30 15:26:40','2007-05-13 15:37:34',NULL,'2007-05-29 15:29:10'),(322,'南風見付近のパパイア','IMGP3494.jpg','まだ未熟かなー。未熟なものは野菜としてパパヤーちゃんぷるーにします。',810,543,100,67,39,26,123.85497093201,24.263124017623,'2007-04-30 15:45:16','2007-04-30 15:45:18','2007-05-13 15:37:41',NULL,'2007-05-29 15:29:40'),(323,'宿・ゆらり','IMGP1869.jpg','１泊２食付きで２０００円は安い！しかもオーナーは元板前だそうな。',810,543,100,67,39,26,125.28561294079,24.803735310399,'2007-04-20 10:39:13','2007-05-12 09:10:27','2007-05-11 21:39:28',NULL,'2007-05-29 15:46:36'),(324,'南風見田ビーチ','IMGP3495.jpg','ここが西表島の最果て。これより南はジャングルです。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 15:55:39','2007-04-30 15:55:40','2007-05-13 15:38:04',NULL,'2007-05-29 15:29:57'),(325,'来間島の空','IMGP1870.jpg','あれは狼煙？　ではないですね。',810,543,100,67,39,26,125.24487018585,24.718357334202,'2007-04-20 12:55:56','2007-04-20 12:55:58','2007-06-03 11:37:36',NULL,'2007-06-03 18:09:00'),(326,'貝殻交差点。','IMGP3496.jpg','ヤドカリたちの道の跡。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 15:56:10','2007-04-30 15:56:12','2007-05-13 15:38:36',NULL,'2007-05-29 15:30:09'),(327,'来間大橋より','IMGP1871.jpg','綺麗な宮古ブルーをモーターボートが疾走しています。',810,510,100,62,39,24,125.26004076004,24.722937775155,'2007-04-20 13:20:21','2007-05-12 09:10:14','2007-05-12 09:02:40',NULL,'2007-05-29 15:47:27'),(328,'ヤドカリの地図','IMGP3497.jpg','たくさんの路線が交差しています。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 15:56:30','2007-04-30 15:56:32','2007-05-13 15:38:57',NULL,'2007-05-29 15:30:20'),(329,'来間大橋より２','IMGP1872.jpg','もう何も言う事はないです。',810,543,100,67,39,26,125.26004076004,24.722937775155,'2007-04-20 13:20:50','2007-05-12 09:09:53','2007-05-12 09:02:37',NULL,'2007-05-29 15:47:34'),(330,'南風見田ビーチ２','IMGP3498.jpg','ここも遠浅で海草が多く泳いでいる人はいなかった。でももずくがたくさん生えていたよ。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 16:00:50','2007-04-30 16:00:52','2007-05-13 15:39:15',NULL,'2007-05-29 15:30:23'),(331,'ピンぼけエイ','IMGP1873.jpg','中央に黒っぽい菱形のがエイです。１メートルないくらいだと思います。',810,543,100,67,39,26,125.26004076004,24.722937775155,'2007-04-20 13:21:34','2007-04-20 13:21:36','2007-05-15 12:00:40',NULL,'2007-05-29 15:47:44'),(332,'来間大橋より３','IMGP1874.jpg','リーフの内側では地元の方々が何かの漁？をしていました。',810,543,100,67,39,26,125.26004076004,24.722937775155,'2007-04-20 13:22:16','2007-05-12 09:09:44','2007-05-12 09:02:31',NULL,'2007-05-29 15:47:51'),(334,'南風見田のもずく','IMGP3502.jpg','その場で抜いて食えます。塩味はちょうどいい感じ。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 16:08:43','2007-04-30 16:08:46','2007-05-13 15:39:24',NULL,'2007-05-29 15:30:32'),(335,'来間島の水面','IMGP1876.jpg','かなり透明度高いです！',810,543,100,67,39,26,125.26077032089,24.723249628835,'2007-04-20 13:23:52','2007-04-20 13:23:54','2007-05-11 21:39:47',NULL,'2007-05-29 15:48:07'),(336,'ビーチを散歩する犬','IMGP3506.jpg','30分後くらいに車がやってきて犬を回収していきました。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 16:28:08','2007-04-30 16:28:10','2007-05-13 15:40:17',NULL,'2007-05-29 15:30:37'),(337,'来間大橋','IMGP1877.jpg','この橋、１７００mほどあるんですよ。一回だけ徒歩で渡ったけど、長っ！',810,543,100,67,39,26,125.26077032089,24.723249628835,'2007-04-20 13:24:42','2007-04-20 13:24:44','2007-06-03 11:37:36',NULL,'2007-06-03 18:09:07'),(338,'伸びるハマヒルガオ','IMGP3507.jpg','砂浜を覆い尽くす勢いです。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 16:28:37','2007-04-30 16:28:38','2007-05-13 15:40:25',NULL,'2007-05-29 15:30:43'),(339,'青空の二本線','IMGP1878.jpg',NULL,810,543,100,67,39,26,125.26077032089,24.723249628835,'2007-04-20 13:26:36','2007-04-20 13:26:38','2007-05-11 21:40:38',NULL,'2007-05-29 15:48:19'),(340,'小鳥の子','IMGP3508.jpg','波打ち際でうずくまる鳥。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 16:39:54','2007-04-30 16:39:56','2007-05-13 15:40:38',NULL,'2007-05-29 15:30:52'),(341,'小鳥の子２','IMGP3509.jpg','おそるおそるつついてみると目を覚ましました。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 16:39:59','2007-04-30 16:40:00','2007-05-13 15:40:46',NULL,'2007-05-29 15:30:58'),(342,'行き止まり','IMGP1880.jpg','やけに中途半端なまま工事が中断していた道。てーげーやさ。',810,543,100,67,39,26,125.30160427094,24.717012406759,'2007-04-20 13:34:44','2007-04-20 13:34:46','2007-06-03 11:37:36',NULL,'2007-06-03 18:09:11'),(343,'小鳥の子３','IMGP3515.jpg','まだねぼけている様子。親とはぐれてしまったのでしょうか。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 16:40:15','2007-04-30 16:40:16','2007-05-13 15:40:57',NULL,'2007-05-29 15:31:08'),(344,'さとうきび畑の空','IMGP1882.jpg','農家の方、暑いだろうなぁ。',810,543,100,67,39,26,125.30675411224,24.720209022122,'2007-04-20 13:36:41','2007-04-20 13:36:44','2007-05-11 21:41:25',NULL,'2007-05-29 15:49:05'),(345,'手乗りの小鳥２','IMGP3518.jpg','このあと飛んで逃げていきました。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 16:40:36','2007-04-30 16:40:38','2007-05-13 15:41:26',NULL,'2007-05-29 15:31:15'),(346,'匍匐にて前進中。','IMGP3520.jpg','ヤドカリの足跡ってこうやって付くんだね。',810,543,100,67,39,26,123.84707450867,24.26610722906,'2007-04-30 16:51:53','2007-05-13 15:41:51','2007-05-15 12:00:40',NULL,'2007-05-29 15:31:22'),(347,'枯れたオキナワスズメウリ','IMGP3523.jpg',NULL,810,543,100,67,39,26,123.85050773621,24.265950734462,'2007-04-30 17:03:21','2007-04-30 17:03:24','2007-05-13 15:41:57',NULL,'2007-05-29 15:31:33'),(348,'花畑の石敢當','IMGP3525.jpg','表札型（中）。一応石を組んでいるつもりなのかな？',810,543,100,67,39,26,123.86197686195,24.260414614109,'2007-04-30 17:07:07','2007-04-30 17:07:10','2007-05-21 11:46:25',NULL,'2007-05-29 15:31:49'),(349,'古見のスコール','IMGP3526.jpg','さすが亜熱帯。宿で雨宿りです。',810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:06:48','2007-05-01 08:06:50','2007-05-13 15:44:00',NULL,'2007-05-29 15:32:33'),(350,'古見のスコール２','IMGP3527.jpg','雨をぼーっと眺めるのが好き。',810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:07:02','2007-05-01 08:07:04','2007-05-13 15:44:08',NULL,'2007-05-29 15:32:52'),(351,'雨のテラス','IMGP3528.jpg','あっと言う間（３分ほど）に池みたいになっています。',810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:07:24','2007-05-01 08:07:26','2007-05-13 15:44:25',NULL,'2007-05-29 15:32:53'),(352,'雨に濡れる庭','IMGP3530.jpg','農宿・さとうきび畑の庭です。',810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:08:34','2007-05-01 08:08:36','2007-05-13 15:44:37',NULL,'2007-05-29 15:32:54'),(353,'雨に濡れる庭２','IMGP3533.jpg','空の色がきれい。',810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:09:13','2007-05-01 08:09:14','2007-05-13 15:45:04',NULL,'2007-05-29 15:32:55'),(354,'雨に濡れる庭３','IMGP3534.jpg',NULL,810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:09:20','2007-05-01 08:09:22','2007-05-13 15:44:59',NULL,'2007-05-29 15:32:57'),(355,'農宿・さとうきび畑のトイレ','IMGP3538.jpg','黄色の入ったピーチに近いピンクが優しい感じ。',365,543,44,67,17,26,123.90788555145,24.318199431588,'2007-05-01 08:13:42','2007-05-06 18:09:00','2007-05-13 15:45:19',NULL,'2007-05-29 15:32:57'),(356,'農宿さとうきび畑裏の樹','IMGP3539.jpg','スコールに打たれうなだれた感じ。',810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:14:11','2007-05-01 08:14:14','2007-05-13 15:45:39',NULL,'2007-05-29 15:32:59'),(357,'雨だれ','IMGP3541.jpg',NULL,810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:14:48','2007-05-01 08:14:50','2007-05-13 15:45:50',NULL,'2007-05-29 15:33:00'),(358,'クラウン','IMGP3543.jpg',NULL,810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:17:46','2007-05-01 08:17:48','2007-05-13 15:46:04',NULL,'2007-05-29 15:33:01'),(359,'雨だれ２','IMGP3545.jpg',NULL,810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:18:31','2007-05-01 08:18:32','2007-05-13 15:46:10',NULL,'2007-05-29 15:33:03'),(360,'クラウン２','IMGP3551.jpg',NULL,810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:19:19','2007-05-01 08:19:24','2007-05-13 15:46:16',NULL,'2007-05-29 15:33:05'),(361,'雨に濡れる庭４','IMGP3555.jpg',NULL,810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:20:08','2007-05-01 08:20:10','2007-05-13 15:46:30',NULL,'2007-05-29 15:33:06'),(362,'雨だれ３','IMGP3566.jpg',NULL,810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:21:50','2007-05-01 08:21:52','2007-05-13 15:46:46',NULL,'2007-05-29 15:33:07'),(363,'雨だれ４','IMGP3575.jpg',NULL,810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:22:21','2007-05-01 08:27:28','2007-05-13 15:46:51',NULL,'2007-05-29 15:33:08'),(364,'雨だれ５','IMGP3576.jpg',NULL,810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 08:22:22','2007-05-01 12:49:38','2007-05-13 15:46:55',NULL,'2007-05-29 15:33:09'),(365,'雨の日の古見小学校','IMGP3585.jpg','農宿さとうきび畑の真向かいです。',810,543,100,67,39,26,123.90788555145,24.318199431588,'2007-05-01 10:33:31','2007-05-01 10:33:34','2007-05-13 15:47:15',NULL,'2007-05-29 15:33:13'),(366,'上原の軽トラ','IMGP3588.jpg','荷台を真っ黒く塗装した軽トラ。非常に沖縄っぽいセンスです。',810,543,100,67,39,26,123.79866600037,24.416751254798,'2007-05-01 11:57:26','2007-05-13 14:02:50','2007-05-13 15:47:41',NULL,'2007-05-29 15:33:39'),(367,'みどり荘のシーサー','IMGP3589.jpg','玄関マットをかぶせられ威厳０。',810,543,100,67,39,26,123.7991809845,24.416516791872,'2007-05-01 11:59:13','2007-05-01 11:59:14','2007-05-13 15:48:20',NULL,'2007-05-29 15:33:51'),(368,'S60.5.25船浦中野球部優勝','IMGP3591.jpg','うーん、丁度ここの建設中に息子の所属する野球部が優勝した記念とか？うーん。',810,543,100,67,39,26,123.79847288132,24.41796263964,'2007-05-01 11:59:46','2007-05-01 11:59:48','2007-05-13 15:48:28',NULL,'2007-05-29 15:34:13'),(369,'新八食堂','IMGP3592.jpg','電話番号２桁しかないけど、それでかかるの？',810,543,100,67,39,26,123.79847288132,24.41796263964,'2007-05-01 12:00:13','2007-05-01 12:00:14','2007-05-13 15:48:52',NULL,'2007-05-29 15:34:22'),(370,'雨の上原港','IMGP3593.jpg','雨のせいか海も濁ってます。',810,543,100,67,39,26,123.79978179932,24.419369394542,'2007-05-01 12:15:22','2007-05-01 12:15:24','2007-05-13 15:49:13',NULL,'2007-05-29 15:34:29'),(371,'紅芋団子','IMGP3595.jpg','デンサ食堂前で無人販売してます。めっちゃうまい。おばぁの手作りかな？',810,543,100,67,39,26,123.79834413528,24.418783248572,'2007-05-01 12:36:56','2007-05-01 12:36:58','2007-05-21 12:00:36',NULL,'2007-05-29 15:34:38'),(372,'巨大なめくじ','IMGP3596.jpg','目が小さくて最初ナメクジだとわからなかった。',810,543,100,67,39,26,123.79862308502,24.419213089216,'2007-05-01 12:42:38','2007-05-01 12:42:40','2007-05-13 15:50:24',NULL,'2007-05-29 15:34:46'),(373,'雨に濡れるハイビスカス','IMGP3598.jpg','上原にて。',810,543,100,67,39,26,123.79862308502,24.419213089216,'2007-05-01 12:43:36','2007-05-01 12:43:38','2007-05-13 15:50:46',NULL,'2007-05-29 15:34:47'),(374,'雨に濡れるハイビスカス２','IMGP3599.jpg','めしべから水がしたたりそう。',810,543,100,67,39,26,123.79862308502,24.419213089216,'2007-05-01 12:44:19','2007-05-01 12:44:20','2007-05-13 15:50:55',NULL,'2007-05-29 15:34:54'),(375,'避難場所の地図','IMGP3603.jpg','もはや色あせて日本宝くじ協会寄贈ってとこが一番目立ってる。',810,543,100,67,39,26,123.79881620407,24.418822325055,'2007-05-01 12:48:14','2007-05-01 12:48:16','2007-05-13 15:56:54',NULL,'2007-05-29 15:35:03'),(376,'上原バス停','IMGP3608.jpg','西表は基本的に道は一本だけ。その５０kmほどの県道をバスは一日３往復しております。',810,543,100,67,39,26,123.79819393158,24.419174012855,'2007-05-01 12:59:44','2007-05-01 12:59:46','2007-05-20 21:39:23',NULL,'2007-05-29 15:35:14'),(377,'雨の日のポスト','IMGP3610.jpg','ちなみに西表島にはゴミ箱がありません。出たゴミはすべて持ち帰るほかないのです。くれぐれも捨てないように！',810,543,100,67,39,26,123.79819393158,24.419174012855,'2007-05-01 13:18:37','2007-05-01 13:18:40','2007-05-21 14:26:33',NULL,'2007-05-29 15:35:16'),(378,'雨の日のアカバナー','IMGP3611.jpg','鮮やかに濡れた花もまた乙。',810,543,100,67,39,26,123.79819393158,24.419174012855,'2007-05-01 13:19:51','2007-05-01 13:19:52','2007-05-13 15:52:26',NULL,'2007-05-29 15:35:18'),(379,'上原港のENEOS','IMGP3612.jpg','土木屋さんがガソリンスタンドとレンタカーまでやってます。でも、西表島に空港はないんですが。',810,543,100,67,39,26,123.79819393158,24.419349856387,'2007-05-01 13:24:25','2007-05-01 13:24:26','2007-05-13 15:52:51',NULL,'2007-05-29 15:35:42'),(380,'新城カラー西表営業所','IMGP3613.jpg','由布島水牛車乗り場前の写真屋SUN。でもカラーの字のカラーが褪せちゃってるぜ。',810,543,100,67,39,26,123.92719745636,24.344711593358,'2007-05-01 15:00:32','2007-05-01 15:00:34','2007-05-13 15:53:20',NULL,'2007-05-29 15:36:30'),(381,'大原集落のウォールアート','IMGP3615.jpg','かなり微笑ましい感じ。',810,543,100,67,39,26,123.88072013855,24.272630926129,'2007-05-01 15:29:25','2007-05-01 15:29:28','2007-05-13 15:53:44',NULL,'2007-05-29 15:36:58'),(382,'大原集落のウォールアート２','IMGP3616.jpg','男の子の隣にいるのは、なんだろうね。',810,543,100,67,39,26,123.88072013855,24.272630926129,'2007-05-01 15:29:54','2007-05-01 15:29:56','2007-05-13 15:53:54',NULL,'2007-05-29 15:36:59'),(383,'大原集落の花','IMGP3617.jpg','花と言ってもこれ、葉っぱだよね。でも太陽に透ける赤がとてもきれいです。',810,543,100,67,39,26,123.88080596924,24.27284609484,'2007-05-01 15:30:44','2007-05-01 15:30:46','2007-05-13 15:54:08',NULL,'2007-05-29 15:37:09'),(384,'大原にて８','IMGP3619.jpg','何故か黄緑が異様に濃い。',810,543,100,67,39,26,123.8810312748,24.273237309744,'2007-05-01 15:40:00','2007-05-01 15:40:02','2007-05-13 15:54:17',NULL,'2007-05-29 15:37:15'),(385,'高齢◯◯◯勲記念樹','IMGP3620.jpg','雪の結晶みたい。',810,543,100,67,39,26,123.88060212135,24.273696985716,'2007-05-01 15:42:20','2007-05-01 15:42:22','2007-05-13 15:54:27',NULL,'2007-05-29 15:37:27'),(386,'親子ヤギ','IMGP3622.jpg','子ヤギの足取りがおぼつかなくかわいらしい。',810,543,100,67,39,26,123.90930175781,24.319685510682,'2007-05-02 08:56:10','2007-05-02 08:56:14','2007-05-13 15:54:39',NULL,'2007-05-29 15:37:44'),(387,'石垣へ','IMGP3623.jpg','歯の診療のために石垣島に向かう。高速船の起こす波はみかけによらず大きい。',810,543,100,67,39,26,124.0665435791,24.292659614785,'2007-05-02 09:40:09','2007-05-02 09:40:12','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:31'),(388,'タウンパルやまだ','IMGP3627.jpg','石垣島にある日本最南端の本屋。輸送手段等を考えればやむを得ないが離島には本屋は存在しない。IT云々の情報格差より本が手に入らない情報格差の方がよほどひどいと思うのだが。',810,543,100,67,39,26,124.15843069553,24.339599244668,'2007-05-02 12:51:25','2007-05-02 12:51:28','2007-06-04 11:32:45',NULL,'2007-06-04 11:48:27'),(389,'美崎町ホッパーの植込み','IMGP3628.jpg','ゴミはダメだけどゼニははイイよというわかりやすい看板。ま、これを見て銭捨てる人もいないでしょうが。',810,543,100,67,39,26,124.15692329407,24.339090931034,'2007-05-02 13:04:13','2007-05-02 13:04:16','2007-05-20 21:39:06',NULL,'2007-05-29 15:39:06'),(390,'日本最南端の出版社','IMGP3629.jpg','八重山に関する書籍や雑誌、フリーペーパーを出版している小さな出版社。',810,543,100,67,39,26,124.16089296341,24.336744841672,'2007-05-02 14:03:49','2007-05-02 14:03:52','2007-06-04 11:32:45',NULL,'2007-06-04 11:48:32'),(391,'登野城の路地','IMGP3630.jpg','赤瓦の家の隣に真新しいアパート。石垣では見慣れた光景やなぁ。',810,543,100,67,39,26,124.16089296341,24.336744841672,'2007-05-02 14:04:39','2007-05-02 14:04:40','2007-06-03 11:37:36',NULL,'2007-06-03 18:04:55'),(392,'登野城の古民家','IMGP3631.jpg','今なお赤瓦の家に住む人たちは琉球時代の士族の家とか名士が多い気がする（たぶん）',810,543,100,67,39,26,124.16093587875,24.336930575331,'2007-05-02 14:05:42','2007-05-02 14:05:44','2007-05-13 16:02:43',NULL,'2007-05-29 15:40:42'),(393,'工事中〜','IMGP3632.jpg','石垣市中心部は建設ラッシュです。地元の人曰く、向こう10年は流れが続くと見ての所業だそうですが、その後どーすんの？10年やそこらのスパンでスクラップ＆ビルドですか？',810,543,100,67,39,26,124.16030287743,24.337619742577,'2007-05-02 14:06:27','2007-05-02 14:06:28','2007-05-13 16:03:22',NULL,'2007-05-29 15:41:03'),(394,'登野城の石敢當','IMGP3633.jpg','表札型（小）。',810,543,100,67,39,26,124.16013121605,24.337878790289,'2007-05-02 14:07:10','2007-05-02 14:07:12','2007-05-21 11:46:39',NULL,'2007-05-29 15:41:18'),(395,'八重山博物館','IMGP3634.jpg','一口にオキナワと言っても八重山の歴史や文化は沖縄本島とはかなり異なります。八重山が好きな人は一度は行ってみるべし。',810,543,100,67,39,26,124.1596698761,24.338132949793,'2007-05-02 14:09:01','2007-05-02 14:09:02','2007-05-13 16:03:47',NULL,'2007-05-29 15:41:34'),(396,'石垣港出港','IMGP3635.jpg','八重山は航跡の泡の色も綺麗なんですよ。',810,543,100,67,39,26,124.15626347065,24.336089883967,'2007-05-02 14:33:37','2007-05-02 14:33:38','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:32'),(397,'石垣港出港２','IMGP3636.jpg','丁度船の混み合う時間帯だったのか、各観光会社譲り合っていました。',810,543,100,67,39,26,124.15626347065,24.336089883967,'2007-05-02 14:33:57','2007-05-02 14:33:58','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:34'),(398,'石垣港の海面','IMGP3637.jpg',NULL,810,543,100,67,39,26,124.15626347065,24.336089883967,'2007-05-02 14:34:40','2007-05-02 14:34:42','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:35'),(399,'全速前進！','IMGP3640.jpg','入り江を出てエンジン全開で加速する高速船。',810,543,100,67,39,26,124.15538907051,24.335493576246,'2007-05-02 14:35:52','2007-05-02 14:35:54','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:37'),(400,'バスを待つオオジョロウグモ','IMGP3650.jpg','んなわけねーか。大原バス停にいついってもいる、日本最大のクモです。暇だったのか自分の足を食っていました。',810,543,100,67,39,26,123.88048410416,24.273520939796,'2007-05-02 15:38:02','2007-05-02 15:38:04','2007-05-13 16:06:12',NULL,'2007-05-29 15:49:56'),(401,'ゴーヤーを背負うヤドカリ','IMGP3651.jpg','ゴーヤーチャンプルになる前にそそくさと逃げて行きました。',810,543,100,67,39,26,123.8449716568,24.267515671766,'2007-05-03 14:57:53','2007-05-03 14:57:56','2007-05-15 12:00:40',NULL,'2007-05-29 15:50:18'),(402,'ゴーヤー？','IMGP3652.jpg','イボイボの感じがそっくり！',810,543,100,67,39,26,123.8449716568,24.267515671766,'2007-05-03 14:57:56','2007-05-03 14:57:58','2007-05-15 12:00:40',NULL,'2007-05-29 15:50:20'),(403,'緑のヤドカリ','IMGP3659.jpg','この緑は苔の一種のようです。',810,543,100,67,39,26,123.8449716568,24.267515671766,'2007-05-03 15:00:07','2007-05-03 15:00:08','2007-05-15 12:00:40',NULL,'2007-05-29 15:50:26'),(404,'夜の古見','IMGP3665.jpg','もう、何も見えないくらい真っ暗。集落を出るともう鳥の鳴き声とジャングルがガサガサいう音しかなくなります。',810,543,100,67,39,26,123.90694141388,24.316635118987,'2007-05-03 20:58:07','2007-05-03 20:58:08','2007-05-13 16:06:50',NULL,'2007-05-29 15:50:48'),(405,'農宿さとうきび畑の居間','IMGP3673.jpg','かなりアットホーム。本、CD、ビデオなど揃ってます！',810,543,100,67,39,26,123.90822887421,24.318355861786,'2007-05-04 12:37:35','2007-05-04 12:37:38','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:38'),(406,'古見の空４','IMGP3674.jpg','入道雲がもくもくと。',810,543,100,67,39,26,123.90822887421,24.318355861786,'2007-05-04 12:39:55','2007-05-04 12:39:56','2007-05-13 16:07:22',NULL,'2007-05-29 15:51:01'),(407,'古見の空５','IMGP3678.jpg','真昼の暑い日射しです。',810,543,100,67,39,26,123.90822887421,24.318355861786,'2007-05-04 12:40:55','2007-05-13 14:49:54','2007-05-13 16:07:37',NULL,'2007-05-29 15:51:02'),(408,'古見の空６','IMGP3679.jpg','あまり太陽って撮っちゃいけないんだろうな。と思いつつ。',810,543,100,67,39,26,123.90822887421,24.318355861786,'2007-05-04 12:40:59','2007-05-13 14:50:35','2007-05-13 16:07:44',NULL,'2007-05-29 15:51:09'),(409,'古見の空７','IMGP3680.jpg',NULL,810,543,100,67,39,26,123.90822887421,24.318355861786,'2007-05-04 12:41:03','2007-05-13 14:53:48','2007-05-13 16:07:49',NULL,'2007-05-29 15:51:12'),(410,'農宿さとうきび畑','IMGP3683.jpg','まあ、見た目はフォローしづらいですけど、中身はとてもいい宿ですよ。',810,543,100,67,39,26,123.90822887421,24.318355861786,'2007-05-04 12:42:27','2007-05-04 12:42:28','2007-05-26 23:43:15',NULL,'2007-05-29 15:51:13'),(411,'農宿さとうきび畑の庭','IMGP3684.jpg','まあ厳密には地主さんの空き地と言ったところでしょうか。毎日牛さんが草むしりに精をだしております。（写真右側）',810,543,100,67,39,26,123.90822887421,24.318355861786,'2007-05-04 13:25:15','2007-05-04 13:25:18','2007-05-13 16:08:20',NULL,'2007-05-29 15:51:19'),(412,'三角雲の兄弟','IMGP3685.jpg','古見集落より。',810,543,100,67,39,26,123.90822887421,24.318355861786,'2007-05-04 13:38:02','2007-05-04 13:38:04','2007-05-13 16:08:36',NULL,'2007-05-29 15:51:20'),(413,'古見の白い花','IMGP3686.jpg',NULL,810,543,100,67,39,26,123.9093875885,24.319294438925,'2007-05-04 13:41:47','2007-05-04 13:41:50','2007-05-13 16:08:47',NULL,'2007-05-29 15:51:30'),(414,'古見の白い花２','IMGP3687.jpg','拡大したところ。',810,543,100,67,39,26,123.9093875885,24.319294438925,'2007-05-04 13:42:10','2007-05-04 13:42:12','2007-05-13 16:08:55',NULL,'2007-05-29 15:51:32'),(415,'古見のサンゴ','IMGP3688.jpg','立派なサンゴですね。イスとしても使えるかも（痛いか？）',810,543,100,67,39,26,123.90979528427,24.319793055203,'2007-05-04 13:45:03','2007-05-04 13:45:04','2007-05-13 16:09:02',NULL,'2007-05-29 15:51:56'),(416,'巻き付き','IMGP3689.jpg','古見集落にて。',810,543,100,67,39,26,123.90979528427,24.319793055203,'2007-05-04 13:46:59','2007-05-04 13:47:02','2007-05-13 16:09:08',NULL,'2007-05-29 15:52:00'),(417,'巻き付き２','IMGP3690.jpg','下から見上げるとこんな感じ。',365,543,44,67,17,26,123.90979528427,24.319793055203,'2007-05-04 13:47:28','2007-05-06 18:09:30','2007-05-13 16:09:14',NULL,'2007-05-29 15:52:02'),(418,'古見集落にて２','IMGP3691.jpg','もくもくふくらむ入道雲。',810,543,100,67,39,26,123.91080915928,24.320169460311,'2007-05-04 13:49:03','2007-05-04 13:49:06','2007-05-13 19:14:17',NULL,'2007-05-29 15:52:14'),(419,'古見のカラス','IMGP3693.jpg','西表島のカラスは体も小さく、都会でスレてないので純朴でずる賢くもないかわいい奴です。',810,543,100,67,39,26,123.91080915928,24.320169460311,'2007-05-04 13:50:04','2007-05-14 16:10:53','2007-05-26 23:44:03',NULL,'2007-05-29 15:52:17'),(420,'古見の空８','IMGP3695.jpg',NULL,810,543,100,67,39,26,123.91049802303,24.320360106627,'2007-05-04 13:50:33','2007-05-04 13:50:34','2007-05-14 16:11:06',NULL,'2007-05-29 15:52:28'),(421,'古見集落にて３','IMGP3699.jpg','蝶を撮ろうとして失敗！',810,543,100,67,39,26,123.90914082527,24.320242785851,'2007-05-04 13:52:53','2007-05-04 13:52:56','2007-05-14 16:11:21',NULL,'2007-05-29 15:52:39'),(422,'飛んでいく鳥。','IMGP3701.jpg','カラスよりもっと大きい鳥。何だろう？',810,543,100,67,39,26,123.90914082527,24.320242785851,'2007-05-04 13:54:30','2007-05-04 13:54:32','2007-05-14 16:11:36',NULL,'2007-05-29 15:52:32'),(423,'石垣とテッポウユリ','IMGP3702.jpg',NULL,810,543,100,67,39,26,123.90872240067,24.320477427295,'2007-05-04 13:55:29','2007-05-04 13:55:32','2007-05-14 16:11:51',NULL,'2007-05-29 15:52:51'),(424,'古見の空９','IMGP3703.jpg',NULL,810,543,100,67,39,26,123.9079874754,24.318834928069,'2007-05-04 14:02:43','2007-05-04 14:02:44','2007-05-14 16:1