007-05-29 15:53:58'),(435,'後良川','IMGP3714.jpg','満潮になるとここ全体が川になるらしい。',810,543,100,67,39,26,123.91068577766,24.322178564774,'2007-05-04 14:14:09','2007-05-04 14:14:10','2007-05-14 16:18:10',NULL,'2007-05-29 15:54:05'),(436,'後良川の入道雲','IMGP3715.jpg',NULL,810,543,100,67,39,26,123.91068577766,24.322178564774,'2007-05-04 14:16:32','2007-05-14 16:19:26','2007-05-14 16:19:46',NULL,'2007-05-29 15:54:09'),(437,'古見のヤモリ','IMGP3727.jpg','沖縄の安宿に泊まった事のある人は知ってるはず。キュッキュッと鳴くかわいい奴。蚊を始め虫を食べて家を守ってくれます。',810,543,100,67,39,26,123.90790164471,24.318223873819,'2007-05-04 14:53:58','2007-05-04 14:54:06','2007-06-03 22:01:15',NULL,'2007-06-04 00:38:54'),(438,'古見のヤモリ２','IMGP3738.jpg',NULL,810,543,100,67,39,26,123.90790164471,24.318223873819,'2007-05-04 14:54:15','2007-05-13 19:35:56','2007-06-03 22:01:15',NULL,'2007-06-04 00:38:55'),(439,'古見のヤモリ３','IMGP3742.jpg',NULL,810,543,100,67,39,26,123.90790164471,24.318223873819,'2007-05-04 14:55:32','2007-05-04 14:55:34','2007-06-03 22:01:15',NULL,'2007-06-04 00:38:57'),(440,'古見の空12','IMGP3756.jpg','曇ってきました。',810,543,100,67,39,26,123.90790164471,24.318223873819,'2007-05-04 18:21:52','2007-05-14 16:21:04','2007-05-14 16:21:32',NULL,'2007-05-29 15:54:35'),(441,'仲間川の川岸','IMGP3757.jpg','亜熱帯ですなぁ。',810,543,100,67,39,26,123.87940049171,24.279007589647,'2007-05-04 18:25:03','2007-05-04 18:25:04','2007-05-14 16:21:52',NULL,'2007-05-29 15:55:37'),(442,'大富付近のコンロンカ','IMGP3759.jpg','星形の花と白い額縁が綺麗。',810,543,100,67,39,26,123.89533281326,24.287628290642,'2007-05-04 18:40:38','2007-05-04 18:40:40','2007-05-14 16:22:05',NULL,'2007-05-29 15:56:14'),(443,'大富付近のコンロンカ２','IMGP3760.jpg','花びらのふちが裏側にめくれて星形になるっぽい。',810,543,100,67,39,26,123.89533281326,24.287628290642,'2007-05-04 18:41:27','2007-05-06 18:22:10','2007-05-14 16:22:10',NULL,'2007-05-29 15:56:15'),(444,'大富付近のギンランイヌビワ','IMGP3762.jpg','花をつけない無花果で、虫を媒介として受精する。',810,543,100,67,39,26,123.8950753212,24.287261568258,'2007-05-04 18:46:40','2007-05-06 18:22:38','2007-05-14 16:22:19',NULL,'2007-05-29 15:56:20'),(445,'大富付近の空','IM