4',NULL,'2007-05-29 15:57:57'),(456,'野原付近のアダンの実','IMGP3802.jpg','うまそうだけど、普通の人は食べません。',810,543,100,67,39,26,123.92174720764,24.367230840013,'2007-05-05 10:59:39','2007-05-05 10:59:40','2007-05-14 20:04:23',NULL,'2007-05-29 15:58:14'),(457,'西表島温泉の樹','IMGP3803.jpg','幹の模様が面白い。成長するにつれて葉が落ちていった跡なのだろう。',810,543,100,67,39,26,123.90749931335,24.380287039663,'2007-05-05 11:54:06','2007-05-05 11:54:08','2007-05-14 16:25:29',NULL,'2007-05-29 15:58:50'),(458,'西表島温泉の虫','IMGP3804.jpg','イモムシっぽいんだけど変な触覚みたいなのがある〜。怖いので触りませんでした。',810,509,100,62,39,24,123.90749931335,24.380287039663,'2007-05-05 11:54:24','2007-05-13 19:53:02','2007-05-14 16:25:45',NULL,'2007-05-29 15:58:54'),(459,'野原付近の空２','IMGP3808.jpg','何やら立ちこめて来ましたが・・・',810,543,100,67,39,26,123.90234947205,24.380091597511,'2007-05-05 12:11:16','2007-05-05 12:11:18','2007-05-14 16:25:59',NULL,'2007-05-29 15:59:22'),(460,'ヘゴの一種３','IMGP3809.jpg',NULL,810,543,100,67,39,26,123.88870239258,24.382006917568,'2007-05-05 12:13:41','2007-05-05 12:13:42','2007-05-14 16:26:08',NULL,'2007-05-29 15:59:29'),(461,'第２３回宮古島トライアスロン','IMGP2005.jpg','前浜ビーチからスタート。\nスイム３kmバイク155kmラン42.195と、トライアスロンの中でもかなりロングの部類に入るそうです。',810,543,100,67,39,26,125.26059865952,24.739523407899,'2007-04-22 07:27:49','2007-05-12 09:08:48','2007-05-11 21:43:26',NULL,'2007-05-29 23:52:20'),(462,'ヘゴの一種４','IMGP3812.jpg','何となくナウシカの腐海を思い出す。',810,543,100,67,39,26,123.88870239258,24.382006917568,'2007-05-05 12:20:25','2007-05-05 12:20:26','2007-05-14 16:26:14',NULL,'2007-05-29 15:59:37'),(463,'高那付近の海','IMGP3814.jpg','海の色が複雑。',810,543,100,67,39,26,123.88780117035,24.384899386729,'2007-05-05 12:21:17','2007-05-05 12:21:18','2007-05-14 16:26:24',NULL,'2007-05-29 15:59:50'),(464,'高那付近の海２','IMGP3815.jpg','ビーチだけど泳げる感じじゃないな。',810,543,100,67,39,26,123.88780117035,24.384899386729,'2007-05-05 12:21:46','2007-05-05 12:21:48','2007-05-14 16:26:45',NULL,'2007-05-29 15:59:51'),(465,'スタート！','IMGP2015.jpg','何だか鮭の遡上を思い出すなぁ。',810,543,100,67,39,26,125.26062011719,24.739172618351,'2007-04-22 07:32:12','2007-04-22 07:32:14','2007-05-11 21:43:50',NULL,'2007-05-29 23:55:41'),(466,'西表島十景「夜霧の浪漫街道」','IMGP3816.jpg','他の九景は見かけませんでしたが、少なくとも西表の夜霧は不気味か、何か動物を轢くんじゃないかとビクビクしてるかのどちらかだと思いますが・・・',810,543,100,67,39,26,123.86947631836,24.396468601416,'2007-05-05 12:30:04','2007-05-05 12:30:06','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:02'),(467,'はるか遠く','IMGP2018.jpg','スイム３kmともなるともはや遠泳ですな。',810,543,100,67,39,26,125.25993347168,24.739893684683,'2007-04-22 07:37:33','2007-05-12 09:08:30','2007-05-11 21:44:11',NULL,'2007-05-29 23:55:57'),(468,'月桃のつぼみ','IMGP3821.jpg','まさに花開く直前の桃色。',810,543,100,67,39,26,123.86647224426,24.394436248507,'2007-05-05 12:32:43','2007-05-05 12:32:44','2007-05-14 16:27:49',NULL,'2007-05-29 16:00:29'),(469,'大見謝ロードパークにて','IMGP3822.jpg','蝶。なかなかいいショットが撮れない・・・',810,543,100,67,39,26,123.86424064636,24.394553500526,'2007-05-05 12:47:41','2007-05-05 12:47:44','2007-05-21 12:01:32',NULL,'2007-05-29 16:00:36'),(470,'大見謝ロードパークから','IMGP3823.jpg','岩肌が荒々しくのぞいています。',810,543,100,67,39,26,123.86424064636,24.394553500526,'2007-05-05 12:50:45','2007-05-05 12:50:46','2007-05-14 16:28:12',NULL,'2007-05-29 16:00:48'),(471,'大見謝川','IMGP3824.jpg','地元の子どもたちが遊びに来てました。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 12:53:24','2007-05-05 12:53:26','2007-05-14 16:28:39',NULL,'2007-05-29 16:01:23'),(472,'大見謝川２','IMGP3825.jpg','山を下ってきてそのまま海に注ぐ距離の短い川。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 12:53:50','2007-05-05 12:53:52','2007-05-14 16:29:04',NULL,'2007-05-29 16:01:25'),(473,'大見謝川３','IMGP3830.jpg',NULL,810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 12:55:48','2007-05-05 12:55:50','2007-05-14 16:29:11',NULL,'2007-05-29 16:01:33'),(474,'大見謝川４','IMGP3831.jpg','向こうに見えるのはマングローブです。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 12:56:13','2007-05-05 12:56:16','2007-05-14 16:29:40',NULL,'2007-05-29 16:01:33'),(475,'大見謝川５','IMGP3832.jpg','このくぼみに水が流れ続けてるという事はどこかで海に続いているのか・・・',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 12:57:13','2007-05-13 20:16:52','2007-05-14 16:29:48',NULL,'2007-05-29 16:01:34'),(476,'大見謝川の水たまり','IMGP3833.jpg','オタマジャクシがたくさん。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 12:58:16','2007-05-05 12:58:18','2007-06-03 22:01:15',NULL,'2007-06-04 00:38:59'),(477,'大見謝川のテッポウユリ','IMGP3834.jpg','わからないと思いますが、岩の隙間から水平に咲いています。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 12:59:13','2007-05-05 12:59:14','2007-05-14 16:30:27',NULL,'2007-05-29 16:01:41'),(478,'大見謝川から海へ','IMGP3836.jpg',NULL,810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:00:09','2007-05-05 13:00:12','2007-05-14 16:30:42',NULL,'2007-05-29 16:01:47'),(479,'大見謝川の滝','IMGP3842.jpg','海へと注ぐ滝。シャッタースピード1/20秒。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:01:46','2007-05-05 13:01:48','2007-05-14 16:30:52',NULL,'2007-05-29 16:01:48'),(480,'大見謝川の滝２','IMGP3843.jpg','海へと注ぐ滝。シャッタースピード1/60秒。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:01:49','2007-05-05 13:01:52','2007-05-14 16:31:38',NULL,'2007-05-29 16:01:50'),(481,'大見謝川の滝３','IMGP3845.jpg',NULL,810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:02:52','2007-05-05 13:02:54','2007-05-14 16:31:47',NULL,'2007-05-29 16:02:07'),(482,'大見謝川の滝４','IMGP3852.jpg','海へ注ぐ滝。上から。シャッターは1/30秒。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:07:18','2007-05-05 13:07:20','2007-05-14 16:32:56',NULL,'2007-05-29 16:02:07'),(483,'大見謝川の滝５','IMGP3855.jpg','海へ注ぐ滝。上から。シャッターは1/1000秒',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:07:58','2007-05-05 13:08:00','2007-05-14 16:32:50',NULL,'2007-05-29 16:02:08'),(484,'大見謝川６','IMGP3856.jpg',NULL,810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:09:41','2007-05-05 13:09:44','2007-05-14 16:32:00',NULL,'2007-05-29 16:02:09'),(485,'大見謝川の滝６','IMGP3857.jpg','海へ注ぐ滝。シャッターは1/1000秒。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:10:51','2007-05-05 13:10:52','2007-05-14 16:32:39',NULL,'2007-05-29 16:02:11'),(486,'大見謝川の滝７','IMGP3860.jpg','海へ注ぐ滝。シャッターは1/40秒。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:11:10','2007-05-05 13:11:12','2007-05-14 16:33:17',NULL,'2007-05-29 16:02:12'),(487,'大見謝川の滝８','IMGP3862.jpg','滝壺の泡立ち方が海っぽい。ていうか海なんだけどね。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:11:55','2007-05-05 13:11:56','2007-05-14 16:33:30',NULL,'2007-05-29 16:02:14'),(488,'大見謝川のマングローブ','IMGP3864.jpg',NULL,810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:12:26','2007-05-05 13:12:28','2007-05-14 16:33:51',NULL,'2007-05-29 16:02:14'),(489,'大見謝川７','IMGP3865.jpg','滝の手前は淡水だからこの魚たちは淡水魚。海と山が同時に存在する不思議な川。',810,543,100,67,39,26,123.86352181435,24.394279912314,'2007-05-05 13:12:56','2007-05-06 18:26:06','2007-05-15 12:00:40',NULL,'2007-05-29 16:02:15'),(490,'船浦の急カーブ','IMGP3869.jpg','急カーブと言うより90度の曲がり角と言った方が正しい。西表は飛ばし屋が多いので気をつけてそうしないとドクロマークですよ。ってこれ、明らかに道交法で規定された看板じゃないよな。',810,509,100,62,39,24,123.81093978882,24.404714928661,'2007-05-05 13:49:26','2007-05-14 16:36:14','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:03'),(491,'船浦の急カーブ２','IMGP3870.jpg','坂を上りきったところの急カーブ。',810,543,100,67,39,26,123.80870819092,24.406356313431,'2007-05-05 13:52:43','2007-05-14 16:36:49','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:05'),(492,'舟浦の集落にて','IMGP3871.jpg','確かめなかったけど、モクマオウかな。',365,543,44,67,17,26,123.80879402161,24.407294238006,'2007-05-05 13:53:01','2007-05-06 18:09:59','2007-05-14 16:37:33',NULL,'2007-05-29 16:03:08'),(493,'船浦中学校','IMGP3872.jpg','シーサーが両側に目を光らせています。ところでなんで葛飾区の警官が木炭を売るために西表まで出張に来ているのか。',810,543,100,67,39,26,123.80845069885,24.408075836497,'2007-05-05 13:55:13','2007-05-14 16:39:56','2007-05-14 16:39:52',NULL,'2007-05-29 16:03:16'),(494,'上原小学校','IMGP3874.jpg','なんとうえシシというマスコットがいる。モデルはリュウキュウイノシシかな。でもキバの生え方がおかしい。',810,543,100,67,39,26,123.7917137146,24.426207563019,'2007-05-05 14:26:12','2007-05-05 14:26:14','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:07'),(495,'中野ビーチ入り口','IMGP3875.jpg','星砂でできた浜です。',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:29:04','2007-05-14 16:42:23','2007-05-14 16:41:43',NULL,'2007-05-29 16:03:46'),(496,'中野ビーチの砂','IMGP3876.jpg','星砂がたくさん混じってるけど、わかりにくいかな？',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:30:15','2007-05-05 14:30:16','2007-05-14 16:42:44',NULL,'2007-05-29 16:03:55'),(497,'中野ビーチ','IMGP3877.jpg','茶色っぽいのは全部海草です。深さは７〜８cm。やっぱり泳げない・・・',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:31:09','2007-05-14 16:43:33','2007-05-14 16:43:06',NULL,'2007-05-29 16:03:57'),(498,'中野ビーチの海面','IMGP3880.jpg','海面すれすれをパチリ。',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:32:16','2007-05-14 16:44:20','2007-05-14 16:44:17',NULL,'2007-05-29 16:04:02'),(499,'中野ビーチの海面２','IMGP3881.jpg','カメラを濡らさないように・・・',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:32:30','2007-05-14 16:44:48','2007-05-14 16:44:45',NULL,'2007-05-29 16:04:03'),(500,'中野ビーチの海面３','IMGP3882.jpg','これも海面すれすれ。',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:32:33','2007-05-14 16:45:12','2007-05-14 16:45:02',NULL,'2007-05-29 16:04:18'),(501,'ん？','IMGP3884.jpg','海草の畑の中にオレンジっぽいものが・・・、',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:33:20','2007-05-05 14:33:22','2007-05-15 12:00:40',NULL,'2007-05-29 16:04:18'),(502,'なんか動いてる。','IMGP3887.jpg','貝かな〜と思って近づくと',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:33:27','2007-05-05 14:33:30','2007-05-15 12:00:40',NULL,'2007-05-29 16:04:19'),(503,'なんとカニの一種でした。','IMGP3891.jpg','動きもとろいしハサミのするどくない。何食べるんだろ。',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:33:54','2007-05-05 14:33:56','2007-05-15 12:00:40',NULL,'2007-05-29 16:04:20'),(504,'逃げていくカニ','IMGP3898.jpg','潮を噴きながらよたよたと。',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:34:39','2007-05-05 14:34:44','2007-05-15 12:00:40',NULL,'2007-05-29 16:04:20'),(505,'星砂','IMGP3903.jpg','これが星砂です。でも砂じゃなくて虫の骨格らしいです。',810,543,100,67,39,26,123.78888130188,24.430818233122,'2007-05-05 14:40:02','2007-05-05 14:40:04','2007-05-14 16:46:34',NULL,'2007-05-29 16:04:22'),(506,'ニラカナイ反対','IMGP3904.jpg','リゾート開発に対する抗議の看板。ホテルからの排水が生態系のバランスを崩し、浦内川にしか生息しない生物を絶滅させるという。',810,543,100,67,39,26,123.77883911133,24.41948662341,'2007-05-05 14:50:12','2007-05-05 14:50:14','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:08'),(507,'壊発元ユニマット','IMGP3905.jpg','地元と対立しながら金の力で強引に開発するのは観光事業とは呼べないわな。まあそれはそうと、西表にホテルなんぞ立てて採算取れるんかという方が謎なんだが。',810,543,100,67,39,26,123.77969741821,24.415110005173,'2007-05-05 14:54:18','2007-05-05 14:54:20','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:10'),(508,'浦内川','IMGP3906.jpg','これまた干満の差で川の太さが非常に変化する川。ここに固有の生物が360種もいるらしい。',810,543,100,67,39,26,123.777551651,24.403933309366,'2007-05-05 15:01:44','2007-05-05 15:01:46','2007-05-14 16:48:38',NULL,'2007-05-29 16:05:01'),(509,'浦内川べりのマングローブ','IMGP3907.jpg','もはや奥の方は陸化して山と一体化しつつあるようです。',810,543,100,67,39,26,123.77446174622,24.402057403323,'2007-05-05 15:04:14','2007-05-05 15:04:18','2007-05-14 16:49:35',NULL,'2007-05-29 16:05:12'),(510,'浦内川２','IMGP3909.jpg','ほんと太くて立派な川だね。',810,543,100,67,39,26,123.77446174622,24.402057403323,'2007-05-05 15:04:34','2007-05-05 15:04:36','2007-05-14 16:49:51',NULL,'2007-05-29 16:05:19'),(511,'干立集落のエネオス','IMGP3910.jpg','西表島のガソリンスタンドはほとんど（と言うか全部？）エネオスです。',810,543,100,67,39,26,123.75660896301,24.395257010349,'2007-05-05 15:14:17','2007-05-05 15:14:20','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:11'),(512,'干立集落','IMGP3911.jpg','静かな集落。旅行客なんてあまり立ち入らないんだろうなぁ。',810,543,100,67,39,26,123.75557899475,24.394397164477,'2007-05-05 15:14:27','2007-05-05 15:14:28','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:13'),(513,'平井順光生誕の地碑','IMGP3912.jpg','干立集落にて。写真を見た事はないです。すみません。',810,543,100,67,39,26,123.75533223152,24.394299454349,'2007-05-05 15:14:38','2007-05-05 15:14:40','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:14'),(514,'石垣と黄色い花','IMGP3913.jpg','この石垣、すべてサンゴかなぁ。',810,543,100,67,39,26,123.75533223152,24.394299454349,'2007-05-05 15:15:23','2007-05-05 15:15:24','2007-05-14 16:51:40',NULL,'2007-05-29 16:06:16'),(515,'干立集落の花','IMGP3914.jpg','この花もいろんな色を見かける。名前調べねば。',810,543,100,67,39,26,0,0,'2007-05-05 15:15:40','2007-05-05 15:15:42','2007-05-14 16:51:54',NULL,'2007-05-29 16:06:37'),(516,'窓の中には、','IMGP3915.jpg','緑が広がっている模様。って、えぇ？！',810,543,100,67,39,26,123.75439882278,24.394802660703,'2007-05-05 15:17:12','2007-05-05 15:17:14','2007-05-14 16:52:25',NULL,'2007-05-29 16:06:41'),(517,'干立のビーチ','IMGP3916.jpg','干上がってますね。西表島では泳いでる人を一人も見なかったなぁ。自分以外。',810,543,100,67,39,26,123.75395894051,24.39519838468,'2007-05-05 15:17:23','2007-05-13 21:17:44','2007-05-14 16:52:46',NULL,'2007-05-29 16:06:56'),(518,'窓の中は、','IMGP3917.jpg','外！？',810,509,100,62,39,24,123.75449001789,24.394807546191,'2007-05-05 15:17:55','2007-05-14 16:53:23','2007-05-14 16:53:01',NULL,'2007-05-29 16:07:09'),(519,'干立集落２','IMGP3918.jpg',NULL,810,543,100,67,39,26,123.75487625599,24.394060064215,'2007-05-05 15:19:18','2007-05-05 15:19:20','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:16'),(520,'干立集落３','IMGP3919.jpg','あの原付、タイヤが土と一体化してるような。',810,543,100,67,39,26,123.75487625599,24.394060064215,'2007-05-05 15:19:37','2007-05-05 15:19:40','2007-05-14 16:53:56',NULL,'2007-05-29 16:07:25'),(521,'干立集落の空','IMGP3920.jpg',NULL,810,543,100,67,39,26,123.75481724739,24.393825559154,'2007-05-05 15:21:27','2007-05-14 16:55:24','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:17'),(522,'島おこしライブ会場','IMGP3921.jpg','南ぬ風人ことまーちゃんによるまーちゃんの実家の民宿を舞台にした無料ライブ。まーちゃんは沖縄のみならず地球環境問題に関する活動を音楽を中心に行っています。',810,543,100,67,39,26,123.75435590744,24.393722963053,'2007-05-05 15:21:36','2007-05-05 15:21:38','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:19'),(523,'123°45\'6789\"','IMGP3922.jpg','東経123度45分67秒89の子午線上を示すモニュメント。でも、グーグルマップで見ると西表島は127度あたりなんだよね。謎。',810,543,100,67,39,26,123.74940991402,24.390205332055,'2007-05-05 15:24:39','2007-05-13 21:18:04','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:20'),(524,'西表小中学校の校庭','IMGP3924.jpg','向こうに見えるのは堤防。その先は当然海。球技は細心の注意を払って行いましょう。',810,543,100,67,39,26,123.74940991402,24.390830695834,'2007-05-05 15:25:26','2007-05-13 21:17:21','2007-05-14 16:56:26',NULL,'2007-05-29 16:09:41'),(525,'西表の子午線モニュメント','IMGP3925.jpg','向こうに見える赤瓦は子午線ふれあい館。西表の工芸品などが置いてあり・・・って何の関係もないやん！',810,543,100,67,39,26,123.74930262566,24.390293274024,'2007-05-05 15:26:21','2007-05-05 15:26:24','2007-05-14 16:56:56',NULL,'2007-05-29 16:09:49'),(526,'西表中学校','IMGP3926.jpg','中学校にあんなに遊具が？と思ったら小学校も併設でした。',810,543,100,67,39,26,123.74930262566,24.390293274024,'2007-05-05 15:28:16','2007-05-05 15:28:18','2007-05-14 16:57:18',NULL,'2007-05-29 16:09:59'),(527,'祖納集落','IMGP3928.jpg','静かな集落です。',810,543,100,67,39,26,123.7472641468,24.389316137603,'2007-05-05 15:30:06','2007-05-05 15:30:08','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:22'),(528,'友達を呼ぶ女の子','IMGP3929.jpg',NULL,810,543,100,67,39,26,123.7472641468,24.389316137603,'2007-05-05 15:30:20','2007-05-05 15:30:22','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:23'),(529,'祖納集落の子どもたち','IMGP3930.jpg','祖納集落では大人は一人も見ませんでした。',810,543,100,67,39,26,123.7472641468,24.389316137603,'2007-05-05 15:30:24','2007-05-05 15:30:26','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:25'),(530,'旧・西表郵便局','IMGP3931.jpg','もうかなり前に閉鎖されてたとおぼしき様子。',810,543,100,67,39,26,123.7464594841,24.388622366158,'2007-05-05 15:31:39','2007-05-05 15:31:42','2007-05-14 16:59:19',NULL,'2007-05-29 16:11:13'),(531,'祖納集落２','IMGP3932.jpg','海へ出る道。',810,543,100,67,39,26,123.7464594841,24.388622366158,'2007-05-05 15:31:47','2007-05-05 15:31:48','2007-05-14 16:59:28',NULL,'2007-05-29 16:11:17'),(532,'亜熱帯の水田','IMGP3933.jpg','祖納集落付近です。',810,543,100,67,39,26,123.75349760056,24.376554042345,'2007-05-05 15:34:07','2007-05-05 15:34:10','2007-05-14 16:59:37',NULL,'2007-05-29 16:11:33'),(533,'祖納港付近の海','IMGP3934.jpg','向こうに見えているのはたぶん外離島です。たぶん。',810,543,100,67,39,26,123.7524998188,24.372869798192,'2007-05-05 15:36:33','2007-05-13 21:19:47','2007-05-14 16:59:51',NULL,'2007-05-29 16:11:57'),(534,'たぶん外離島','IMGP3935.jpg','対岸の祖納港付近より。',810,543,100,67,39,26,123.7524998188,24.372869798192,'2007-05-05 15:36:51','2007-05-13 21:21:15','2007-05-14 17:00:11',NULL,'2007-05-29 16:12:00'),(535,'祖納港付近の海２','IMGP3936.jpg','おなじく向こうの島は外離島だと思われます。',810,543,100,67,39,26,123.74879837036,24.371491843754,'2007-05-05 15:37:01','2007-05-05 15:37:02','2007-05-14 17:00:31',NULL,'2007-05-29 16:12:16'),(536,'西表トンネル','IMGP3937.jpg','たぶん日本最南端のトンネルなんじゃないかなぁ。八重山の離島にトンネルがある事自体がすごいけど。',810,543,100,67,39,26,123.74716758728,24.366957192666,'2007-05-05 15:45:05','2007-05-05 15:45:08','2007-06-04 11:32:45',NULL,'2007-06-04 11:49:24'),(537,'西表トンネル２','IMGP3938.jpg','入り口を振り返って。',810,543,100,67,39,26,123.74691009521,24.366331710793,'2007-05-05 15:46:23','2007-05-05 15:46:26','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:28'),(538,'西表トンネル３','IMGP3939.jpg','対向車が来ました。自転車で走りながら撮っているのでめっちゃぶれてます。',810,543,100,67,39,26,123.74708175659,24.365784411617,'2007-05-05 15:46:34','2007-05-05 15:46:36','2007-06-04 11:32:45',NULL,'2007-06-04 11:49:25'),(539,'西表トンネル４','IMGP3940.jpg','若干不気味になってきた・・・',810,543,100,67,39,26,123.7469959259,24.365237110073,'2007-05-05 15:46:45','2007-05-05 15:46:48','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:31'),(540,'西表トンネル５','IMGP3941.jpg','大体７００mのトンネルで、今半分くらい。',810,543,100,67,39,26,123.74691009521,24.364846178949,'2007-05-05 15:46:57','2007-05-05 15:47:00','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:32'),(541,'西表トンネル６','IMGP3942.jpg','かなり怪しい写真。赤外線カメラみたい（勝手なイメージ）',810,543,100,67,39,26,123.74682426453,24.364455246618,'2007-05-05 15:47:16','2007-05-05 15:47:18','2007-06-04 11:32:45',NULL,'2007-06-04 11:49:27'),(542,'西表トンネル７','IMGP3943.jpg','出口が見えた！',810,543,100,67,39,26,123.74716758728,24.363595191236,'2007-05-05 15:47:52','2007-05-05 15:47:54','2007-06-04 11:32:45',NULL,'2007-06-04 11:49:28'),(543,'西表トンネル８','IMGP3944.jpg','なんかこの写真目にも見える。',810,543,100,67,39,26,123.74725341797,24.363438816902,'2007-05-05 15:48:10','2007-05-05 15:48:12','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:37'),(544,'西表トンネル９','IMGP3945.jpg','出口はもうそこ。',810,543,100,67,39,26,123.74716758728,24.363126067654,'2007-05-05 15:48:39','2007-05-05 15:48:40','2007-06-04 11:32:45',NULL,'2007-06-04 11:49:30'),(545,'西表トンネル10','IMGP3946.jpg','ようやく外が見えてきたぁ！',810,543,100,67,39,26,123.74729633331,24.362578754611,'2007-05-05 15:48:58','2007-05-05 15:49:00','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:40'),(546,'西表トンネル11','IMGP3947.jpg','やっと新鮮な空気が吸える！',810,543,100,67,39,26,123.74708175659,24.362344191153,'2007-05-05 15:49:03','2007-05-05 15:49:04','2007-06-04 11:32:45',NULL,'2007-06-04 11:49:31'),(547,'白浜港','IMGP3949.jpg','目の前に内離島が立ちふさがり、内海に近い雰囲気。',810,543,100,67,39,26,123.747382164,24.359412111243,'2007-05-05 15:50:33','2007-05-05 15:50:34','2007-06-01 12:18:35',NULL,'2007-06-01 13:23:41'),(548,'西部の果て','IMGP3950.jpg','こっから東の果てまで約50km。向こうに見える試験中の電光掲示板。試験が終わる日は来るのか。もしやこれも日本最南端？',810,543,100,67,39,26,123.74768257141,24.360819518079,'2007-05-05 15:50:53','2007-05-05 15:50:54','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:43'),(549,'白浜港２','IMGP3951.jpg','船浮の集落に渡るのでなければ（道路が通じていないので）特に何もないはずだが、観光バスがたくさんきていた。',810,543,100,67,39,26,123.74708175659,24.359412111243,'2007-05-05 15:52:39','2007-05-05 15:52:40','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:44'),(550,'内離島を望むキューブ','IMGP3952.jpg','あの出っ張り、不思議だなぁ。',810,543,100,67,39,26,123.7455368042,24.360506762357,'2007-05-05 15:54:29','2007-05-13 21:39:58','2007-05-14 17:06:06',NULL,'2007-05-29 16:14:18'),(551,'船浮航路の時刻表','IMGP3953.jpg','思ってたよりたくさん出てるみたい。',810,543,100,67,39,26,123.74789714813,24.359412111243,'2007-05-05 15:55:33','2007-05-05 15:55:34','2007-05-14 17:06:17',NULL,'2007-05-29 16:14:28'),(552,'台所だった。','IMGP3954.jpg','今や換気扇が風にカタカタと回っております。',810,543,100,67,39,26,123.74872326851,24.359715095981,'2007-05-05 15:59:24','2007-05-05 15:59:26','2007-05-14 17:06:43',NULL,'2007-05-29 16:14:50'),(553,'台所だった２','IMGP3955.jpg','台所を外からのぞいているみたい。',810,543,100,67,39,26,123.74872326851,24.359715095981,'2007-05-05 15:59:49','2007-05-05 15:59:50','2007-05-14 17:06:58',NULL,'2007-05-29 16:14:51'),(554,'ブルーシールアイス','IMGP3956.jpg','バニラアイスをサンドしたクッキー。けっこううまかった。',810,543,100,67,39,26,123.7485408783,24.359705322291,'2007-05-05 16:03:03','2007-05-05 16:03:06','2007-05-21 12:00:36',NULL,'2007-05-29 16:15:04'),(555,'白浜小中学校','IMGP3959.jpg','まさに山と海に挟まれた学校。',810,543,100,67,39,26,123.75113725662,24.359333921515,'2007-05-05 16:08:38','2007-05-05 16:08:40','2007-05-14 19:57:20',NULL,'2007-05-29 16:15:14'),(556,'白浜の子午線モニュメント','IMGP3960.jpg','こっちは日時計になっています。',810,543,100,67,39,26,123.75060081482,24.359871474917,'2007-05-05 16:10:07','2007-05-05 16:10:10','2007-05-14 19:58:02',NULL,'2007-05-29 16:15:21'),(557,'県道215起点。','IMGP3963.jpg','西表の主要道路の起点ここから時計回りに南風見田まで続きます。',810,543,100,67,39,26,123.74989271164,24.359939890641,'2007-05-05 16:12:03','2007-05-05 16:12:04','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:46'),(558,'石垣を覆う根２','IMGP3964.jpg','切られる前を想像すると樹の生命力ってすごいなと思いますね。',810,543,100,67,39,26,123.749345541,24.360047400989,'2007-05-05 16:13:37','2007-05-05 16:13:38','2007-05-14 19:59:57',NULL,'2007-05-29 16:17:05'),(559,'石垣を覆う根。','IMGP3965.jpg','全て奥にある樹の根です。',810,543,100,67,39,26,123.749345541,24.360047400989,'2007-05-05 16:14:18','2007-05-05 16:14:22','2007-05-14 20:00:34',NULL,'2007-05-29 16:17:11'),(560,'2000万年前の岩。','IMGP3967.jpg','八重山層群西表層に属する・・・との事。',810,543,100,67,39,26,123.7472319603,24.361884836456,'2007-05-05 16:16:48','2007-05-05 16:16:50','2007-05-14 20:00:56',NULL,'2007-05-29 16:17:22'),(561,'祖納集落付近の海３','IMGP3968.jpg','左が内、右が外離島です。',810,543,100,67,39,26,123.75163078308,24.37003569119,'2007-05-05 16:25:21','2007-05-14 20:01:32','2007-05-14 20:01:18',NULL,'2007-05-29 16:17:33'),(562,'祖納集落付近の海４','IMGP3973.jpg','これが頁岩というやつでしょうか。薄い岩が層状になって段をなしています。',810,543,100,67,39,26,123.75177025795,24.371941390823,'2007-05-05 16:28:01','2007-05-14 07:31:49','2007-05-14 20:01:43',NULL,'2007-05-29 16:17:44'),(563,'道路を横断するサキシマハブ','IMGP3975.jpg','自転車で疾走中に轢きそうになった！通常60〜120cmだどうなのでかなりでかい部類かと。',810,543,100,67,39,26,123.77261638641,24.399839499294,'2007-05-05 16:41:04','2007-05-05 16:41:06','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:47'),(564,'道路を横断するサキシマハブ２','IMGP3976.jpg','ストンと落ちて消えました。ピントが合ってないのはオートフォーカスがヘビを見失ったため。',810,543,100,67,39,26,123.77261638641,24.399839499294,'2007-05-05 16:41:11','2007-05-05 16:41:12','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:49'),(565,'浦内川を散歩するサギ','IMGP3978.jpg',NULL,810,543,100,67,39,26,123.77717614174,24.404636766949,'2007-05-05 16:43:19','2007-05-05 16:43:20','2007-05-14 20:02:50',NULL,'2007-05-29 16:18:24'),(566,'住吉付近の無人販売所','IMGP3980.jpg','料金箱にお金を入れて、品物をもらってく。お釣り銭のないようによろしくお願い致します。',810,543,100,67,39,26,123.77915024757,24.427858436725,'2007-05-05 16:51:23','2007-05-05 16:51:24','2007-05-14 20:03:06',NULL,'2007-05-29 16:18:47'),(567,'住吉付近の無人販売所２','IMGP3981.jpg','ちょうどパインの採れ始める時期だったようで、スーパーなどでもたくさん出回っていました。',810,543,100,67,39,26,123.77915024757,24.427858436725,'2007-05-05 16:51:43','2007-05-05 16:51:44','2007-05-14 20:04:01',NULL,'2007-05-29 16:18:53'),(568,'西表焼青烽窯','IMGP3982.jpg','中野集落付近の山中の工房。',810,543,100,67,39,26,123.78234744072,24.429128324874,'2007-05-05 16:55:06','2007-05-05 16:55:08','2007-05-14 20:15:08',NULL,'2007-05-29 16:19:06'),(569,'西表焼青烽窯２','IMGP3983.jpg','ゆかいなシーサー繋がり眉毛だし、目の焦点が合ってないじょ。泡盛飲りすぎ？',810,543,100,67,39,26,123.78234744072,24.429128324874,'2007-05-05 16:55:22','2007-05-05 16:55:24','2007-05-14 20:15:24',NULL,'2007-05-29 16:19:03'),(570,'上原付近のハーブ','IMGP3984.jpg','独特のクセのあるハーブ。野山に生えているので採って来て天ぷらなどに利用しました。',810,543,100,67,39,26,123.79348397255,24.424625048417,'2007-05-05 17:00:15','2007-05-05 17:00:18','2007-05-14 20:15:53',NULL,'2007-05-29 16:19:26'),(571,'上原付近のハーブ２','IMGP3986.jpg','食べた事ある気がするんだけど、名前を特定できず。',810,543,100,67,39,26,123.79348397255,24.424625048417,'2007-05-05 17:00:35','2007-05-05 17:00:36','2007-05-14 20:16:06',NULL,'2007-05-29 16:19:34'),(572,'上原付近のハーブ３','IMGP3987.jpg','拡大するとこんな感じ。',810,543,100,67,39,26,123.79348397255,24.424625048417,'2007-05-05 17:01:26','2007-05-05 17:01:28','2007-05-14 20:16:18',NULL,'2007-05-29 16:19:36'),(573,'居酒屋舟あじ','IMGP3989.jpg','上原付近にある西表島では数少ない居酒屋。離島では宅飲みが基本です。',810,543,100,67,39,26,123.79378437996,24.424478518283,'2007-05-05 17:03:33','2007-05-05 17:03:34','2007-05-14 20:17:14',NULL,'2007-05-29 16:19:58'),(574,'パーラー美々２','IMGP3993.jpg','貝殻とサンゴのすだれ。涼しげ。',810,543,100,67,39,26,123.79484653473,24.423628640151,'2007-05-05 17:08:56','2007-05-14 07:54:20','2007-05-14 20:17:56',NULL,'2007-05-29 16:20:02'),(575,'パーラー美々','IMGP3998.jpg','夕方には閉店してました。奥にベビーベッドがあり、子どもをあやしながら営業しているみたい。',810,543,100,67,39,26,123.79484653473,24.423628640151,'2007-05-05 17:10:39','2007-05-14 07:53:47','2007-05-14 20:18:09',NULL,'2007-05-29 16:20:09'),(576,'山中のパパイヤ','IMGP3999.jpg','方言名はパパヤー。一個もらってってパパヤーちゃんぷるーにしました。',810,543,100,67,39,26,123.83625984192,24.404363200577,'2007-05-05 17:49:01','2007-05-05 17:49:04','2007-05-14 20:18:31',NULL,'2007-05-29 16:20:31'),(577,'高那山中の看板','IMGP4000.jpg','確かにこの辺はみんなかなり飛ばしてますね。実際問題カンムリワシもやられているらしい。',810,543,100,67,39,26,123.89732837677,24.379778889441,'2007-05-05 18:16:22','2007-05-14 07:58:36','2007-05-14 20:18:53',NULL,'2007-05-29 16:20:46'),(578,'野原付近にて','IMGP4001.jpg','雲行きが怪しくなってきました....',810,543,100,67,39,26,123.93852710724,24.364650712935,'2007-05-05 18:33:26','2007-05-05 18:33:28','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:50'),(579,'古見の雷','IMGP4002.jpg','かなり画像が粗いですね。下の方に写っているのは白のバンです。',810,543,100,67,39,26,123.90794992447,24.318043001196,'2007-05-05 19:40:45','2007-05-06 18:28:38','2007-05-15 11:55:34',NULL,'2007-05-29 21:40:47'),(580,'古見の雷２','IMGP4006.jpg','このあと、大きいのがきます....！',810,543,100,67,39,26,123.90794992447,24.318043001196,'2007-05-05 19:40:56','2007-05-06 18:29:16','2007-05-15 11:55:58',NULL,'2007-05-29 21:40:49'),(581,'古見の雷３','IMGP4010.jpg','ちなみに雷は古見の東方、石垣島の方角でした。',810,543,100,67,39,26,123.90794992447,24.318043001196,'2007-05-05 19:41:02','2007-05-06 18:29:28','2007-05-15 11:57:14',NULL,'2007-05-29 21:40:56'),(582,'古見の雷４','IMGP4018.jpg',NULL,810,543,100,67,39,26,123.90794992447,24.318043001196,'2007-05-05 19:41:32','2007-05-06 18:29:44','2007-05-15 11:57:11',NULL,'2007-05-29 21:40:58'),(583,'古見の雷５','IMGP4064.jpg',NULL,810,543,100,67,3