-05-06 06:40:45','2007-05-14 09:03:02','2007-05-15 12:01:00',NULL,'2007-05-29 21:41:39'),(594,'古見のセマルハコガメ６','IMGP4267.jpg',NULL,810,543,100,67,39,26,123.90794992447,24.318043001196,'2007-05-06 06:40:50','2007-05-14 09:03:19','2007-05-15 12:01:07',NULL,'2007-05-29 21:41:40'),(595,'古見のセマルハコガメ７','IMGP4269.jpg','のこのこと歩いています。',810,543,100,67,39,26,123.90794992447,24.318043001196,'2007-05-06 06:40:58','2007-05-14 09:03:28','2007-05-15 12:01:15',NULL,'2007-05-29 21:41:42'),(596,'古見のセマルハコガメ８','IMGP4271.jpg',NULL,810,543,100,67,39,26,123.90794992447,24.318043001196,'2007-05-06 06:41:00','2007-05-14 09:03:35','2007-05-15 12:01:26',NULL,'2007-05-29 21:41:44'),(597,'まなつのスパイスカフェ・茶音間（ちゃのま）','IMGP4275.jpg','宮古島の間那津にあるおしゃれなカフェ。のチラシ。宮古島の宿を出るとき宿にいた茶音間の店員さんに依頼され、泊まり歩いた宿に置いてもらうという、沖縄では一般的な営業方法です。',810,543,100,67,39,26,123.90794992447,24.318043001196,'2007-05-06 06:48:33','2007-05-06 06:48:36','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:43'),(598,'大富付近の月桃','IMGP4277.jpg','花や実が鈴なりになっています。',810,543,100,67,39,26,123.89565467834,24.288278609064,'2007-05-06 15:38:28','2007-05-06 15:38:30','2007-05-15 12:02:13',NULL,'2007-05-29 21:42:05'),(599,'豊原のテッポウユリ','IMGP4280.jpg','綺麗に三輪そろっています。',810,543,100,67,39,26,123.8635969162,24.259309317392,'2007-05-06 16:11:32','2007-05-06 16:11:34','2007-05-15 12:03:00',NULL,'2007-05-29 21:42:32'),(600,'豊原バス停','IMGP4281.jpg','日本最南端のバス停。だそうです。西表島以南の離島に路線バスはないのです。',810,543,100,67,39,26,123.86295318604,24.259544071481,'2007-05-06 16:16:21','2007-05-06 16:16:22','2007-06-04 11:32:45',NULL,'2007-06-04 11:49:33'),(601,'県道215終点。','IMGP4282.jpg','白浜南風見線約50kmの往復、下に移ってるママチャリで制覇しました。２日かけてだけどね。',810,543,100,67,39,26,123.86213779449,24.25958319712,'2007-05-06 16:19:07','2007-05-06 16:19:08','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:52'),(602,'南風見田の空','IMGP4283.jpg','看板の色あせぶりがすごい。沖縄の日射しは容赦ないなという感じです。',810,543,100,67,39,26,123.8617515564,24.259994015606,'2007-05-06 16:19:42','2007-05-06 16:19:44','2007-05-15 12:05:15',NULL,'2007-05-29 21:42:59'),(603,'南風見田の空２','IMGP4284.jpg',NULL,810,543,100,67,39,26,123.83149623871,24.273129725765,'2007-05-06 16:37:58','2007-05-06 16:38:00','2007-05-15 12:05:25',NULL,'2007-05-29 21:43:59'),(604,'南風見田の空３','IMGP4285.jpg','道の両側の樹が真上にも迫る勢いです。',810,543,100,67,39,26,123.83137822151,24.272983020193,'2007-05-06 16:38:20','2007-05-06 16:38:22','2007-05-15 12:05:54',NULL,'2007-05-29 21:44:19'),(605,'南風見田の空４','IMGP4286.jpg',NULL,810,543,100,67,39,26,123.83129775524,24.272811863478,'2007-05-06 16:38:40','2007-05-06 16:38:42','2007-05-15 12:06:10',NULL,'2007-05-29 21:44:26'),(606,'南風見田のパパイア','IMGP4287.jpg','見事になっていましたが、まだ未熟かな〜',810,543,100,67,39,26,123.83123874664,24.27275807132,'2007-05-06 16:39:24','2007-05-06 16:39:26','2007-05-15 12:06:34',NULL,'2007-05-29 21:44:39'),(607,'南風見田ビーチへの道。','IMGP4288.jpg','植物がサブトロピカル（亜熱帯）である事をのぞけば日本中で見られるような道。',810,543,100,67,39,26,123.83122265339,24.27267004774,'2007-05-06 16:40:10','2007-05-06 16:40:12','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:54'),(608,'南風見田の樹','IMGP4289.jpg','幹をびっしりつる植物が覆っています。',810,543,100,67,39,26,123.83120656013,24.272621145725,'2007-05-06 16:40:22','2007-05-06 16:40:24','2007-05-15 12:07:07',NULL,'2007-05-29 21:44:48'),(609,'南風ビーチの入り口','IMGP4290.jpg','年から年中産卵するわけはないでしょうが、ともかく乗り入れは禁止です。',810,543,100,67,39,26,123.8311958313,24.272528231843,'2007-05-06 16:42:39','2007-05-06 16:42:40','2007-05-15 12:07:36',NULL,'2007-05-29 21:44:54'),(610,'南風見田ビーチ３','IMGP4291.jpg','やはり泳げそうもないな・・・',810,543,100,67,39,26,123.8311958313,24.272528231843,'2007-05-06 16:43:18','2007-05-06 16:43:20','2007-05-15 12:07:52',NULL,'2007-05-29 21:45:03'),(611,'南風見田ビーチの枯れた川。','IMGP4292.jpg','大雨とかが降るとここも立派な川となって海へと注ぐ訳です。',810,543,100,67,39,26,123.83097589016,24.272337513664,'2007-05-06 16:45:10','2007-05-06 16:45:12','2007-05-15 12:08:08',NULL,'2007-05-29 21:45:09'),(612,'南風見田ビーチの空','IMGP4293.jpg','山の向こう側は未開拓の地です。',810,543,100,67,39,26,123.8308095932,24.27227883109,'2007-05-06 16:45:33','2007-05-06 16:45:34','2007-05-15 12:08:32',NULL,'2007-05-29 21:47:21'),(613,'南風見田ビーチのサンゴ','IMGP4294.jpg','一口にさんごと言ってもいろんな形のがあるわけです。生き物の創り出す造形って不思議。',810,543,100,67,39,26,123.83114755154,24.272313062595,'2007-05-06 16:48:17','2007-05-06 16:48:20','2007-05-15 12:08:46',NULL,'2007-05-29 21:47:27'),(614,'南風見田ビーチのカニ','IMGP4311.jpg','すばしっこいけど横にしか走れないので追いかけて遊ぶと面白い（向こうは必死）',810,543,100,67,39,26,123.83114755154,24.272313062595,'2007-05-06 16:49:25','2007-05-06 16:49:38','2007-05-15 12:09:08',NULL,'2007-05-29 21:47:32'),(615,'南風見田ビーチの造形','IMGP4312.jpg','どうやってできたんだろう？',810,543,100,67,39,26,123.83099198341,24.272254380009,'2007-05-06 16:50:33','2007-05-06 16:50:34','2007-05-15 12:09:42',NULL,'2007-05-29 21:47:39'),(616,'南風見田ビーチの造形２','IMGP4313.jpg','やはり誰もいない海。西表って不思議な島。',810,543,100,67,39,26,123.83099198341,24.272254380009,'2007-05-06 16:50:50','2007-05-06 16:50:52','2007-05-15 12:09:54',NULL,'2007-05-29 21:47:40'),(617,'南風見田の空５','IMGP4314.jpg',NULL,810,543,100,67,39,26,123.83130848408,24.272396196211,'2007-05-06 16:54:46','2007-05-06 16:54:48','2007-05-15 12:10:13',NULL,'2007-05-29 21:47:50'),(618,'南風見田の空６','IMGP4316.jpg','向こうの空がかすかに赤く染まり始めてる。',810,543,100,67,39,26,123.83426427841,24.273403575713,'2007-05-06 18:04:18','2007-05-14 09:48:52','2007-05-15 12:14:09',NULL,'2007-05-29 21:47:57'),(619,'南風見田付近','IMGP4318.jpg','あれが加丁良山かな・・・？',810,543,100,67,39,26,0,0,'2007-05-06 17:05:08','2007-05-06 17:05:10','2007-05-15 12:10:24',NULL,'2007-05-29 21:48:04'),(620,'南風見田の廃バス','IMGP4319.jpg','不要なバスやバンがああやって打ち捨てられている。昔の路線バスはああいう模様だったのかな？',810,543,100,67,39,26,123.83590579033,24.272464659149,'2007-05-06 17:05:50','2007-05-06 17:05:52','2007-05-15 12:10:38',NULL,'2007-05-29 21:48:14'),(621,'豊原付近の花','IMGP4321.jpg','なんかこうおしべとめしべってよくよく見ると不思議。',810,543,100,67,39,26,123.85875821114,24.262062759949,'2007-05-06 17:20:23','2007-05-06 17:20:24','2007-05-15 12:11:08',NULL,'2007-05-29 21:48:51'),(622,'豊原の脱走牛に注意','IMGP4322.jpg','脱走できないように厳重に管理するのではなく、車の方に注意を促す標識。これも沖縄らしいと言うか。',810,543,100,67,39,26,123.86589288712,24.259108797931,'2007-05-06 17:24:26','2007-05-06 17:24:28','2007-06-03 11:37:36',NULL,'20