15 12:24:13',NULL,'2007-05-29 21:51:26'),(665,'西表島を去る','IMGP4456.jpg','港まで送迎してもらう途中。',810,543,100,67,39,26,123.89556884766,24.290312666236,'2007-05-07 10:37:43','2007-05-19 21:29:28','2007-05-15 12:24:25',NULL,'2007-05-29 21:52:04'),(666,'西表島を去る２','IMGP4458.jpg','満ちつつある仲間川。',810,543,100,67,39,26,123.88080596924,24.280924438191,'2007-05-07 10:38:18','2007-05-19 21:29:18','2007-05-15 12:24:47',NULL,'2007-05-29 21:52:16'),(667,'西表島を去る３','IMGP4459.jpg','緑が後ろに流れ消えていく。',810,543,100,67,39,26,123.87874603271,24.277794874608,'2007-05-07 10:38:31','2007-05-19 21:29:04','2007-05-15 12:24:58',NULL,'2007-05-29 21:52:25'),(668,'西表島を去る４','IMGP4461.jpg',NULL,810,543,100,67,39,26,123.87857437134,24.275291168226,'2007-05-07 10:38:33','2007-05-19 21:28:52','2007-05-15 12:25:15',NULL,'2007-05-29 21:52:30'),(669,'BAR cocoSone','IMGP4464.jpg','赤瓦の店でアワモリ＆レゲエ。これぞオキナワ。\nと思ったら、BARだけじゃなくてBARBERもやっているのでしょうか？\n',810,543,100,67,39,26,124.15758311749,24.340650078887,'2007-05-07 13:21:13','2007-05-19 21:28:36','2007-05-20 21:11:13',NULL,'2007-05-29 21:54:55'),(670,'民宿楽天屋','IMGP4466.jpg','緑に覆われた古民家の外観を残した趣のある民宿。泊まってはないですけど大変お世話になりました（？）',810,543,100,67,39,26,124.1583609581,24.340786931074,'2007-05-07 17:32:05','2007-05-19 21:28:04','2007-06-03 10:29:24',NULL,'2007-06-03 18:05:57'),(671,'民家（？）の門','IMGP4467.jpg','戸の上の方にあるのは何かの紋かな？',810,543,100,67,39,26,124.15690720081,24.342302070404,'2007-05-07 17:36:18','2007-05-19 21:27:55','2007-05-20 19:33:33',NULL,'2007-05-29 21:57:29'),(672,'きじむなあと仲間たち','IMGP4468.jpg','ゲストハウスですね。このきじむなーはここのオーナーの絵です。石垣市街を歩けば同じ絵を一度は見かけると思います。',810,543,100,67,39,26,124.15700376034,24.342306957921,'2007-05-07 17:36:20','2007-05-19 21:27:47','2007-05-20 21:11:21',NULL,'2007-05-29 21:57:36'),(673,'PAUL ANGIE','IMGP4470.jpg','魚介を使った欧風レストランでしょうか（勝手な想像）\nでもやっぱり赤瓦で石敢當（表札型）なんだね。',810,543,100,67,39,26,124.1571700573,24.342429145782,'2007-05-07 17:39:14','2007-05-19 21:27:37','2007-05-20 21:10:56',NULL,'2007-05-29 21:57:42'),(674,'玉那覇酒造所','IMGP4471.jpg','八重山最古の蔵元だそうです。',810,543,100,67,39,26,124.15719687939,24.34232162047,'2007-05-07 17:40:20','2007-05-19 21:27:25','2007-06-02 11:05:19',NULL,'2007-06-02 12:17:26'),(675,'石垣と花','IMGP4472.jpg','こういう風に石垣から奔放にはみ出た花、沖縄ではごく普通です。',810,543,100,67,39,26,NULL,NULL,'2007-05-07 17:41:11','2007-05-19 21:27:17','2007-05-20 19:35:32',NULL,'2007-05-29 10:15:51'),(676,'のっぺらぼうとガジュマル','IMGP4473.jpg','のっぺらぼうの石碑（石敢當？）。後ろのガジュマルもすごい風格を称えています。',810,543,100,67,39,26,NULL,NULL,'2007-05-07 17:41:42','2007-05-19 21:26:58','2007-05-20 19:36:04',NULL,'2007-05-29 10:15:52'),(677,'駐車場の石敢當','IMGP4474.jpg','表札型。少し大きめかな。',810,543,100,67,39,26,NULL,NULL,'2007-05-07 17:42:55','2007-05-07 17:42:56','2007-05-20 19:36:28',NULL,'2007-05-29 10:15:54'),(678,'表札？','IMGP4475.jpg','表札型（中）。いや、もしや本物・・・石垣島には石敢當さんという名前の方がいるのかな？\nって！いるわけねーだろ！',810,543,100,67,39,26,NULL,NULL,'2007-05-07 17:44:21','2007-05-19 21:26:36','2007-05-20 21:19:53',NULL,'2007-05-29 10:15:55'),(679,'谷間の御嶽（オン）','IMGP4476.jpg','ビルの谷間の御嶽。立派なものです。',365,543,44,67,17,26,124.15703594685,24.341955056222,'2007-05-07 17:49:22','2007-05-19 21:26:18','2007-05-20 22:12:05',NULL,'2007-05-29 22:00:07'),(680,'アパートの階段','IMGP4477.jpg',NULL,810,543,100,67,39,26,124.15705740452,24.340782043498,'2007-05-07 18:04:44','2007-05-19 21:25:57','2007-05-20 19:37:43',NULL,'2007-05-29 22:00:45'),(681,'mahimahiと自転車','IMGP4478.jpg',NULL,810,543,100,67,39,26,124.15824830532,24.340581652738,'2007-05-07 20:55:59','2007-05-07 20:56:02','2007-06-03 11:37:36',NULL,'2007-06-03 18:05:59'),(682,'うんでくれてありがとう','IMGP4480.jpg','店の名前よりも断然大きい自分を産み育ててくれた両親への感謝の言葉。お客さんも親の事を思い出しながら石垣牛をほおばる事でしょう。',810,543,100,67,39,26,124.156665802,24.339232672541,'2007-05-07 22:16:03','2007-05-19 21:25:09','2007-05-20 19:39:11',NULL,'2007-05-29 22:03:08'),(683,'栄福食堂','IMGP4481.jpg','知る人ぞ知る有名店（？）トニーそばは八重山そばにトーフが二切れ乗ってトニーそば。そんなセンス溢れるおじーのトークが止まらない！',810,543,100,67,39,26,124.15670871735,24.340454575506,'2007-05-08 08:31:26','2007-05-19 21:23:39','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:00'),(684,'トニーそば向かいの石敢當。','IMGP4482.jpg','表札型。（やや大）',810,543,100,67,39,26,124.15660142899,24.34060120307,'2007-05-08 08:31:44','2007-05-19 21:22:48','2007-05-20 21:25:13',NULL,'2007-05-29 22:03:26'),(685,'石垣島バスターミナル','IMGP4483.jpg','石垣島全路線の発着点。やはり観光客の利用が多いんだろうか。',810,543,100,67,39,26,124.15625810623,24.338318681416,'2007-05-08 08:44:25','2007-05-19 21:22:31','2007-05-20 19:40:28',NULL,'2007-05-29 22:03:39'),(686,'嵩','IMGP4485.jpg','バスターミナル付近にて。',810,543,100,67,39,26,124.15653169155,24.33872924509,'2007-05-08 08:55:27','2007-05-19 21:22:07','2007-05-20 21:09:16',NULL,'2007-05-29 22:03:50'),(687,'待機中。','IMGP4486.jpg','出発を待つバスたち。',810,543,100,67,39,26,124.15683746338,24.338802559892,'2007-05-08 08:55:50','2007-05-19 21:22:17','2007-05-20 21:09:44',NULL,'2007-05-29 22:03:56'),(688,'路上寝は危険！','IMGP4488.jpg','その温暖な気候が災いしてか、沖縄では飲んだ後家にたどり着く前に適当なところで寝てしまう路上寝と路上寝による交通事故死が全国一位である。南無。',810,543,100,67,39,26,124.15740072727,24.339193571451,'2007-05-08 08:59:17','2007-05-19 21:18:29','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:45'),(689,'海の家の石敢當','IMGP4489.jpg','よく見るとネジで固定してある近代的な表札型石敢當（中）。',365,543,44,67,17,26,124.15753483772,24.339208234361,'2007-05-08 09:00:44','2007-05-19 20:38:19','2007-05-20 21:19:10',NULL,'2007-05-29 22:05:01'),(690,'TATTOO','IMGP4491.jpg','10分で２週間もちます。しかも水にも強い。効率的？',810,543,100,67,39,26,124.15759921074,24.339232672541,'2007-05-08 09:01:11','2007-05-19 21:17:23','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:02'),(691,'あやぱにモールのキューピー','IMGP4493.jpg','またもこの二人組が。',810,543,100,67,39,26,124.15804445744,24.339481941703,'2007-05-08 09:02:46','2007-05-19 21:17:07','2007-05-20 21:13:15',NULL,'2007-05-29 22:05:19'),(692,'給水塔と南方増長天王？','IMGP4496.jpg','このおふだについてはまったく知識がなくどういう信仰なのかもわかりませんが、八重山で多く見かけた気がします。',810,543,100,67,39,26,124.15811419487,24.341080185262,'2007-05-08 09:29:01','2007-05-20 21:14:47','2007-05-20 21:15:05',NULL,'2007-05-29 22:06:04'),(693,'アトリエ「なちゅらる宇宙人」','IMGP4497.jpg','なんかLOVE&PEACEな看板。でも名前が書いてないよ。',810,543,100,67,39,26,124.15802836418,24.341192599187,'2007-05-08 09:29:23','2007-05-19 21:15:53','2007-05-20 21:15:22',NULL,'2007-05-29 22:05:58'),(694,'なちゅらる宇宙人のポスター','IMGP4498.jpg','トレードマークのかわいい羊です。',365,543,44,67,17,26,124.15782988071,24.341441864492,'2007-05-08 09:31:22','2007-05-09 16:28:45','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:47'),(695,'石垣の路地','IMGP4499.jpg','一通、しかも樹による高さ制限あり。',810,543,100,67,39,26,124.15780305862,24.34142231429,'2007-05-08 09:32:15','2007-05-19 21:15:35','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:04'),(696,'K house','IMGP4500.jpg','めっちゃおしゃれな色使い。古い街並に不思議とマッチします。',810,543,100,67,39,26,124.15898859501,24.341217036984,'2007-05-08 09:47:56','2007-05-19 21:15:18','2007-05-20 21:17:08',NULL,'2007-05-29 22:06:39'),(697,'お店？の石敢當','IMGP4501.jpg','表札型（大）。のぼりはあるが本当に営業しているのか？',810,543,100,67,39,26,124.15969669819,24.341876855712,'2007-05-08 09:49:48','2007-05-19 21:15:07','2007-05-20 21:31:48',NULL,'2007-05-29 22:06:54'),(698,'空飛ぶまじむん？','IMGP4502.jpg','表札型（中）だけど手彫りっぽくいい味。しかし、二階にも石敢當を配置するって事はついに魔物も空を飛ぶ時代ですか。',810,543,100,67,39,26,124.15969669819,24.341876855712,'2007-05-08 09:49:55','2007-05-19 21:14:51','2007-05-20 21:32:20',NULL,'2007-05-29 22:06:56'),(699,'隠れ身の石敢當','IMGP4503.jpg','壁に違和感なくとけ込んだ表札型石敢當（特大）。',810,543,100,67,39,26,124.15968060493,24.34178888008,'2007-05-08 09:51:12','2007-05-19 21:14:34','2007-05-20 21:32:44',NULL,'2007-05-29 22:07:12'),(700,'ブロック塀の石敢當','IMGP4504.jpg','表札型（中）。それにしても塀の補修はそれでいいんですか？',810,543,100,67,39,26,124.15979862213,24.341935506099,'2007-05-08 09:51:28','2007-05-19 21:14:15','2007-05-20 21:33:14',NULL,'2007-05-29 22:07:32'),(701,'４号線のブーゲンビリア','IMGP4505.jpg','綺麗な木陰を作っています。',810,543,100,67,39,26,124.15970742702,24.343103620654,'2007-05-08 09:54:01','2007-05-19 21:14:03','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:05'),(702,'石垣小学校近くのポスト','IMGP4509.jpg','本土でも珍しいポスト。でも犬におしっこひっかけられがち。',365,543,44,67,17,26,124.1581517458,24.344115326227,'2007-05-08 10:00:21','2007-05-19 21:13:54','2007-05-20 21:35:13',NULL,'2007-05-29 22:07:59'),(703,'石垣浅田線208','IMGP4510.jpg','石垣小学校前の上り坂。',810,543,100,67,39,26,124.1581517458,24.344115326227,'2007-05-08 10:04:02','2007-05-19 21:13:40','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:07'),(704,'石垣小のウォールアート','IMGP4511.jpg','何かの行事かお祭りでしょうか。',810,543,100,67,39,26,124.15832340717,24.344516096247,'2007-05-08 10:06:20','2007-05-19 21:12:52','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:08'),(705,'石垣の空','IMGP4512.jpg','屋根瓦と、青空。',810,543,100,67,39,26,124.1581839323,24.344169088132,'2007-05-08 10:06:55','2007-05-19 21:12:45','2007-05-20 21:47:57',NULL,'2007-05-29 22:08:41'),(706,'石垣市石垣の花','IMGP4513.jpg',NULL,810,543,100,67,39,26,124.15593624115,24.34561576357,'2007-05-08 10:10:56','2007-05-19 21:12:29','2007-05-20 21:48:10',NULL,'2007-05-29 22:10:04'),(707,'４号線のブーゲン','IMGP4522.jpg','民家のものですけど、ばっちり歩道にはみ出してます。',810,543,100,67,39,26,124.1556841135,24.345781934691,'2007-05-08 10:13:21','2007-05-19 21:12:05','2007-05-20 21:49:02',NULL,'2007-05-29 22:09:46'),(708,'４号線','IMGP4523.jpg','英語ではYon go-sen。まんまやん！',810,543,100,67,39,26,124.15548563004,24.345772159925,'2007-05-08 10:15:43','2007-05-19 21:11:42','2007-05-20 21:49:19',NULL,'2007-05-29 22:09:40'),(709,'新旧石敢當','IMGP4526.jpg','ともに表札型（中）。旧字がかっこいいっす。',810,543,100,67,39,26,124.15460050106,24.347262802986,'2007-05-08 10:21:23','2007-05-19 21:11:14','2007-05-20 21:49:42',NULL,'2007-05-29 22:10:33'),(710,'裏あやぱにモール','IMGP4527.jpg','平日昼間はこんなもん。',810,543,100,67,39,26,124.15840923786,24.339550368446,'2007-05-08 11:31:45','2007-05-19 21:10:20','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:10'),(711,'八重山郵便局','IMGP4528.jpg','沖縄でも投資信託は流行っておるのかね？',810,543,100,67,39,26,124.15889203548,24.338924751134,'2007-05-08 11:37:38','2007-05-19 21:10:01','2007-05-20 21:50:26',NULL,'2007-05-29 22:11:30'),(712,'「あ」の訴え','IMGP4529.jpg','石垣島郊外に山を二つ切り崩しての大規模住宅地。自然を顧みず開発一辺倒の本土の後を追うのか。\n\n「あなたは」どう思いますか？',810,543,100,67,39,26,124.15714323521,24.338758571016,'2007-05-08 11:57:54','2007-05-08 11:57:56','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:48'),(713,'美崎ホッパーのゴミ箱','IMGP4531.jpg','ペットボトルはまあいい。でもその隣はビソとしか読めんだろ！？',810,543,100,67,39,26,124.15684819221,24.339281548886,'2007-05-08 12:01:47','2007-05-08 12:01:48','2007-05-20 21:51:21',NULL,'2007-05-29 22:11:49'),(714,'泡盛屋の花','IMGP4533.jpg','この花、造花っぽく見えたけど紛れもなく生きてる花。綺麗・・・',810,543,100,67,39,26,124.15708422661,24.339291324152,'2007-05-08 12:03:43','2007-05-19 21:09:32','2007-06-02 11:05:19',NULL,'2007-06-02 12:17:28'),(715,'ゴーヤかうひぃ','IMGP4534.jpg','ゴーヤーとコーヒー？！　苦いもの同士、ある意味合うのか？',810,543,100,67,39,26,124.15708422661,24.339291324152,'2007-05-08 12:04:24','2007-05-19 21:08:53','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:50'),(716,'泡盛屋の石敢當','IMGP4536.jpg','表札型（中）。左上に小さく寄り添うシーサー阿と吽もキュート。',810,543,100,67,39,26,124.15708422661,24.339291324152,'2007-05-08 12:04:59','2007-05-08 12:05:00','2007-06-03 00:02:48',NULL,'2007-06-03 18:06:11'),(717,'こ、これは...','IMGP4537.jpg','北海道のパクリやろ！',810,543,100,67,39,26,124.15767431259,24.338626604297,'2007-05-08 12:43:41','2007-05-19 21:08:44','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:51'),(718,'CHOCOとアメリカンバイク','IMGP4539.jpg','チョコレートの事？',810,543,100,67,39,26,124.1577655077,24.341031309611,'2007-05-08 13:57:37','2007-05-19 21:08:36','2007-05-20 21:53:20',NULL,'2007-05-29 22:12:47'),(719,'踏みつぶされる〜！','IMGP4544.jpg','宿やしがにハウスにて。',810,543,100,67,39,26,124.15512621403,24.348181616851,'2007-05-08 14:11:16','2007-05-19 21:08:26','2007-05-20 21:53:59',NULL,'2007-05-29 22:13:05'),(720,'石垣中付近の夕日。','IMGP4553.jpg',NULL,810,543,100,67,39,26,124.15443956852,24.347008661803,'2007-05-08 17:52:08','2007-05-19 21:07:43','2007-05-20 21:54:24',NULL,'2007-05-29 22:13:17'),(721,'日焼けシーサー','IMGP4554.jpg','すげー真っ黒。てゆーか腰掛けちゃってるよ。',810,543,100,67,39,26,124.15454149246,24.347077084479,'2007-05-08 18:24:26','2007-05-19 21:07:15','2007-05-20 21:54:51',NULL,'2007-05-29 23:58:25'),(722,'市役所通りの石敢當','IMGP4555.jpg','表札型（大）。',810,543,100,67,39,26,124.15230989456,24.344516096247,'2007-05-08 18:27:36','2007-05-19 21:07:02','2007-05-20 21:55:17',NULL,'2007-05-29 23:59:04'),(723,'沖縄ツーリストの泰山石敢當','IMGP4556.jpg','表札型。石敢當ってもともと中国の風習らしい。泰山が付くとさらに効果アップ？',810,543,100,67,39,26,124.15676236153,24.33944284069,'2007-05-08 18:32:07','2007-05-19 21:06:52','2007-05-20 21:56:19',NULL,'2007-05-29 23:59:45'),(724,'断言。','IMGP4557.jpg','そうかも知れない・・・と何となく納得しかけたけど、絶対なんの調査も根拠もないやろ！',810,543,100,67,39,26,124.1570520401,24.339345088106,'2007-05-08 18:45:38','2007-05-19 21:06:43','2007-05-20 21:56:40',NULL,'2007-05-29 23:59:54'),(725,'石垣市大川の石敢當','IMGP4558.jpg','表札型ですね。サイズは中。',810,543,100,67,39,26,124.15697157383,24.339633458013,'2007-05-08 18:47:18','2007-05-19 21:06:28','2007-05-20 21:57:01',NULL,'2007-05-30 00:00:05'),(727,'LOGビルの石敢當','IMGP4560.jpg','表札型（大）しかも横幅が太いEEEEサイズ。',810,543,100,67,39,26,124.15707349777,24.339706772291,'2007-05-08 18:51:17','2007-05-08 18:51:18','2007-05-20 21:57:44',NULL,'2007-05-30 00:00:36'),(728,'石垣市街の夕焼け。','IMGP4561.jpg','梅雨入り前で空の機嫌も良い日が多かった。',810,543,100,67,39,26,124.15860235691,24.343665680303,'2007-05-08 19:03:15','2007-05-19 22:39:56','2007-05-20 21:58:43',NULL,'2007-05-30 00:04:13'),(729,'石垣市街の夕焼け２','IMGP4562.jpg','家が建ち並んでいてなかなか夕日が撮れない・・・',810,543,100,67,39,26,124.15708422661,24.344755580167,'2007-05-08 19:03:39','2007-05-19 22:40:42','2007-05-20 21:58:39',NULL,'2007-05-30 00:04:34'),(730,'石垣市街の夕焼け３','IMGP4563.jpg','ヤシの樹の影が南国風やねぇ。',810,543,100,67,39,26,124.15620982647,24.345307857682,'2007-05-08 19:04:55','2007-05-08 19:04:56','2007-05-20 21:58:36',NULL,'2007-05-30 00:04:44'),(731,'石垣市街の夕焼け４','IMGP4566.jpg','これは宿・やどかりハウス２Fベランダにて撮影。',810,543,100,67,39,26,124.15513157845,24.348186504141,'2007-05-08 19:11:25','2007-05-19 22:44:52','2007-05-20 22:00:49',NULL,'2007-05-30 00:05:03'),(732,'やどかりハウスのゴーヤー','IMGP4567.jpg','5/8はゴーヤーの日！（一日過ぎてるけど）ゴーヤーの収穫が始まり雑貨屋やパン屋の店先にもゴーヤーが並ぶ。それだけ沖縄の人はゴーヤーを育てるのが好きなんだろうね〜',810,543,100,67,39,26,124.15513157845,24.348127856649,'2007-05-09 18:40:25','2007-05-19 22:49:53','2007-05-20 22:01:08',NULL,'2007-05-30 00:05:14'),(733,'やどかりハウスのゴーヤー畑','IMGP4570.jpg','ところで野生のゴーヤーはやっぱり他の樹に巻き付いて実を付けるんだろうか。それともスイカみたいに地面かなぁ。',810,543,100,67,39,26,124.15513157845,24.348127856649,'2007-05-09 18:41:12','2007-05-19 22:50:42','2007-05-20 22:01:21',NULL,'2007-05-30 00:05:18'),(734,'石垣市石垣の月桃','IMGP4572.jpg','綺麗な庭です。',810,543,100,67,39,26,124.15476679802,24.348025223473,'2007-05-09 18:43:01','2007-05-19 22:50:56','2007-05-20 22:01:36',NULL,'2007-05-30 00:05:25'),(735,'駐車場の樹','IMGP4576.jpg','つるの巻き付き方がすごい。',810,543,100,67,39,26,124.15491163731,24.346221798368,'2007-05-09 18:48:22','2007-05-19 22:51:59','2007-05-20 22:01:51',NULL,'2007-05-30 00:05:41'),(736,'駐車場の樹２','IMGP4577.jpg','下半分を蔓植物に乗っ取られています。',365,543,44,67,17,26,124.15491163731,24.346221798368,'2007-05-09 18:48:50','2007-05-16 18:59:08','2007-05-20 22:02:21',NULL,'2007-05-30 00:05:44'),(737,'石垣の隙間の花','IMGP4579.jpg','沖縄の植物は生命力あるよ。つくづく。',810,543,100,67,39,26,124.1563385725,24.345361619082,'2007-05-09 18:53:59','2007-05-19 22:55:26','2007-05-20 22:02:36',NULL,'2007-05-30 00:06:17'),(738,'赤瓦と黒猫','IMGP4581.jpg','降りるかどうか逡巡しているご様子。',810,543,100,67,39,26,124.15869355202,24.343685230159,'2007-05-09 18:59:09','2007-05-19 22:56:18','2007-05-20 22:03:16',NULL,'2007-05-30 00:06:58'),(739,'にらみ合い。','IMGP4587.jpg','こちらの様子を窺っています。',810,543,100,67,39,26,124.15869355202,24.343685230159,'2007-05-09 18:59:29','2007-05-19 22:57:18','2007-05-20 22:03:36',NULL,'2007-05-30 00:06:59'),(740,'赤瓦と黒猫２','IMGP4590.jpg','去りながらもこちらが気になるご様子。',810,543,100,67,39,26,124.15869355202,24.343685230159,'2007-05-09 18:59:44','2007-05-09 18:59:46','2007-05-20 22:03:52',NULL,'2007-05-30 00:07:05'),(741,'一日の終わりのアカバナー','IMGP4591.jpg','今日一日石垣は快晴でした。今日も一日お疲れ様です。',810,543,100,67,39,26,124.16072130203,24.342346058049,'2007-05-09 19:02:29','2007-05-29 09:12:20','2007-05-29 09:12:18',NULL,'2007-05-30 00:08:02'),(742,'あさひ食堂の水槽','IMGP4592.jpg','オレンジのはカクレクマノミですね。それぐらいは知ってますよ。あとのは知りません。',810,543,100,67,39,26,124.16221797466,24.341534727912,'2007-05-09 19:07:21','2007-05-09 19:07:24','2007-05-20 22:04:28',NULL,'2007-05-30 00:08:17'),(743,'あさひ食堂の水槽２','IMGP4593.jpg','名前はわかりません。',810,543,100,67,39,26,124.16221797466,24.341534727912,'2007-05-09 19:07:30','2007-05-09 19:07:32','2007-06-03 12:08:54',NULL,'2007-06-03 18:06:13'),(744,'夕焼けとブーゲン','IMGP4594.jpg','ブーゲンビリアはもはや影のみですが。',810,543,100,67,39,26,124.16109681129,24.342038144211,'2007-05-09 19:39:52','2007-05-19 23:04:45','2007-05-20 22:05:23',NULL,'2007-05-30 00:08:53'),(745,'縁石のニチニチソウ','IMGP4596.jpg','艶やかな夜の花といった感じ。',810,543,100,67,39,26,124.15931046009,24.343352882198,'2007-05-09 19:44:26','2007-05-19 23:07:56','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:15'),(746,'石垣市石垣の路地','IMGP4597.jpg','沖縄旧来の街並は無彩色の壁と低彩度の赤瓦。これって緑や青空が最も映える配色なんだよね。昔の人の知恵というか。景観条例ではその辺は考慮されているのだろうか？',810,543,100,67,39,26,124.1547614336,24.347790633043,'2007-05-10 15:00:17','2007-05-10 15:00:18','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:16'),(747,'緑。','IMGP4598.jpg',NULL,810,543,100,67,39,26,124.15470778942,24.347678224974,'2007-05-10 15:01:23','2007-05-10 15:01:24','2007-05-20 22:05:57',NULL,'2007-05-30 00:10:23'),(748,'彩風のシーサー','IMGP4601.jpg','青目のシーサーです。顔つきも外人っぽい？',810,543,100,67,39,26,124.15598452091,24.341129060894,'2007-05-10 15:53:40','2007-05-19 23:13:46','2007-05-20 22:06:45',NULL,'2007-05-30 00:11:19'),(749,'レキオ・ゴーレスの石敢當','IMGP4602.jpg','表札型（やや大）。その横のオレンジの物体が何なのかも気になります。',810,543,100,67,39,26,124.15688037872,24.339662783729,'2007-05-10 15:54:55','2007-05-19 23:25:59','2007-05-20 22:07:06',NULL,'2007-05-30 00:11:42'),(750,'よくあるおみやげ。','IMGP4607.jpg','あ〜はいはい、どこの観光地行ってもあるヤツね。・・・と思ったら違った！　さすが沖縄。これ、自分で使うの？　やっぱりおみやげ？',810,543,100,67,39,26,124.15795326233,24.33842132246,'2007-05-10 16:15:39','2007-05-10 16:15:42','2007-05-20 22:07:25',NULL,'2007-05-30 00:12:04'),(751,'コンビニシーサーのシーサー','IMGP4609.jpg','ベンチの両脇にシーサー。その両脇にまたシーサー（写ってないけど）。さらにベンチの後ろにも向かいにもたくさん。さすがコンビニシーサーさね。シーサー販売もしてるさー。',810,543,100,67,39,26,124.15795862675,24.338372445783,'2007-05-10 16:19:54','2007-05-19 23:17:47','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:18'),(752,'コンビニシーサーのベンチ','IMGP4610.jpg','後ろにもシーサーがたくさん。でもこのベンチ、見ての通り板と板の間隔が広く尻が痛くなる。',810,543,100,67,39,26,124.15788352489,24.338391996456,'2007-05-10 16:20:15','2007-05-19 23:26:11','2007-05-20 22:08:15',NULL,'2007-05-30 00:12:24'),(753,'コンビニシーサーの外壁','IMGP4612.jpg','壁にもこんなにシーサーが。シーサーへのこだわりにはすごいの一言。',810,543,100,67,39,26,124.15803909302,24.338431097793,'2007-05-10 16:21:48','2007-05-19 23:28:02','2007-05-20 22:08:29',NULL,'2007-05-30 00:12:29'),(754,'フェンスのブーゲンビリア','IMGP4614.jpg','ゆいロードにて。',810,543,100,67,39,26,124.15730953217,24.341368551218,'2007-05-10 16:54:40','2007-05-19 23:29:16','2007-05-20 22:08:38',NULL,'2007-05-30 00:12:46'),(755,'石垣市石垣の空','IMGP4615.jpg','紙でも漉けそうな空。',810,543,100,67,39,26,124.15710568428,24.341637366349,'2007-05-10 16:55:39','2007-05-19 23:28:51','2007-05-20 22:08:49',NULL,'2007-05-30 00:12:52'),(756,'石垣市石垣の空２','IMGP4616.jpg',NULL,810,543,100,67,39,26,124.15706813335,24.341647141434,'2007-05-10 16:55:51','2007-05-19 23:30:12','2007-05-20 22:08:55',NULL,'2007-05-30 00:13:03'),(757,'石垣市石垣の空３','IMGP4617.jpg',NULL,810,543,100,67,39,26,124.15706813335,24.341647141434,'2007-05-10 16:56:00','2007-05-19 23:30:35','2007-05-20 22:09:01',NULL,'2007-05-30 00:13:05'),(758,'桃林寺','IMGP4618.jpg','ゆいロード沿いにあります。',810,543,100,67,39,26,124.15558755398,24.343543493635,'2007-05-10 16:59:18','2007-05-19 23:31:21','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:19'),(759,'桃林寺２','IMGP4619.jpg','石垣も趣きのある寺。',810,543,100,67,39,26,124.15557682514,24.343558156042,'2007-05-10 16:59:30','2007-05-10 16:59:32','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:21'),(760,'給水塔と空','IMGP4620.jpg','石垣島には給水塔と井戸が至る所になる。それだけ上水道の整備が遅かったという事だろう。',810,543,100,67,39,26,124.15538907051,24.343489731464,'2007-05-10 16:59:58','2007-05-19 23:33:48','2007-05-20 22:10:57',NULL,'2007-05-30 00:14:18'),(761,'石垣市石垣の空４','IMGP4621.jpg','縦糸と横糸を織り合わせているような空。',810,543,100,67,39,26,124.15535151958,24.343519056287,'2007-05-10 17:00:03','2007-05-19 23:35:03','2007-05-20 22:11:15',NULL,'2007-05-30 00:14:08'),(762,'桃林寺３','IMGP4624.jpg','あの梁にあるのは何の葉かねぇ？',810,543,100,67,39,26,124.1555339098,24.34361680565,'2007-05-10 17:00:29','2007-05-19 23:36:40','2007-05-20 22:12:26',NULL,'2007-05-30 00:14:27'),(763,'桃林寺の石垣','IMGP4625.jpg','よく見るとサンゴが多いね。さすが八重山。',810,543,100,67,39,26,124.1556251049,24.343533718697,'2007-05-10 17:00:44','2007-05-10 17:00:46','2007-05-20 22:12:34',NULL,'2007-05-30 00:14:37'),(764,'桃林寺の石垣２','IMGP4626.jpg','綺麗に石化したサンゴさね。',810,543,100,67,39,26,124.1556251049,24.343533718697,'2007-05-10 17:01:05','2007-05-19 23:38:57','2007-05-20 22:12:41',NULL,'2007-05-30 00:14:47'),(765,'桃林寺４','IMGP4627.jpg','古い建築みたいだけど、ちゃんと蛍光灯も付いてる。',810,543,100,67,39,26,124.15552854538,24.343626580582,'2007-05-10 17:01:33','2007-05-19 23:40:17','2007-05-20 22:12:57',NULL,'2007-05-30 00:14:54'),(766,'桃林寺５','IMGP4628.jpg','はるばる長野から説教とは、お疲れ様ですm(_ _)m',810,543,100,67,39,26,124.15556073189,24.343607030717,'2007-05-10 17:02:11','2007-05-19 23:40:37','2007-06-01 12:24:09',NULL,'2007-06-01 13:23:53'),(767,'桃林寺向かいの井戸。','IMGP4629.jpg','くみ上げが人力であるあたり、昔の姿のままのようです。',365,543,44,67,17,26,124.15529251099,24.343641242979,'2007-05-10 17:03:09','2007-05-20 07:17:32','2007-05-21 11:50:32',NULL,'2007-05-30 00:15:14'),(768,'桃林寺向かいの庭園跡','IMGP4630.jpg','歩道の一部として部分的に保存されています。',810,543,100,67,39,26,124.15534079075,24.343607030717,'2007-05-10 17:03:32','2007-05-20 07:24:21','2007-05-21 11:50:44',NULL,'2007-05-30 00:15:23'),(769,'桃林寺向かいの庭園２','IMGP4631.jpg','本土のと比べるとやはり南国風。',810,543,100,67,39,26,124.15539979935,24.343548381104,'2007-05-10 17:03:44','2007-05-20 07:24:30','2007-05-21 11:50:54',NULL,'2007-05-30 00:15:36'),(770,'鯉のぼりとブーゲンビリア','IMGP4634.jpg','鯉のぼりって五月中は揚げてるのかな。よくわからない。',810,543,100,67,39,26,124.15545344353,24.344120213674,'2007-05-10 17:06:16','2007-05-20 09:22:54','2007-05-21 11:51:10',NULL,'2007-05-30 00:15:53'),(771,'書いただけの石敢當','IMGP4636.jpg','と思ったら軽く彫ってはあるみたいです。型は刺青型と認定。',810,543,100,67,39,26,124.15608108044,24.344877765665,'2007-05-10 17:08:55','2007-05-10 17:08:56','2007-05-21 11:52:26',NULL,'2007-05-30 00:16:04'),(772,'真乙姥（マイツバ）井戸','IMGP4637.jpg','石垣中学校前にある井戸。井戸の事をカーと言うので、マイツバカーと読む。',810,543,100,67,39,26,124.15433228016,24.346910915058,'2007-05-10 17:19:52','2007-05-10 17:19:54','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:22'),(773,'大丈夫が...何？','IMGP4638.jpg','オキナワの強い日射しで赤文字が全部消えた立て看板。それにしても赤文字が多過ぎやしないか？',810,543,100,67,39,26,124.1546112299,24.347311676231,'2007-05-10 17:21:32','2007-05-10 17:21:34','2007-05-28 09:25:46',NULL,'2007-05-30 00:16:23'),(774,'植込みの黄色い花','IMGP4639.jpg','もう少し花の名前を勉強しなければなと思うこの頃・・・',810,543,100,67,39,26,124.15700376034,24.345747723007,'2007-05-11 13:07:16','2007-05-11 13:07:18','2007-05-21 11:54:04',NULL,'2007-05-30 00:16:44'),(775,'石垣の下のニチニチソウ２','IMGP4641.jpg','ほんのわずかの隙間から生える強い花。ヨーロッパ原産、沖縄で野生化した帰化植物。土もないようなところから生えてくる石垣島最強の花。',810,509,100,62,39,24,NULL,NULL,'2007-05-11 13:12:01','2007-05-20 13:41:06','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:24'),(776,'水を欲するハイビスカス','IMGP4643.jpg','ほんと暑くてしおれそう。てゆーか俺しおれそう。',810,543,100,67,39,26,NULL,NULL,'2007-05-11 13:13:29','2007-05-20 13:42:10','2007-05-21 11:55:00',NULL,'2007-05-29 10:18:09'),(777,'知念商会のポスト','IMGP4644.jpg','何でも売ってる総合商店みたいな感じ。',810,543,100,67,39,26,NULL,NULL,'2007-05-11 14:08:42','2007-05-20 13:42:27','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:25'),(778,'Y字路の石敢當','IMGP4645.jpg','まさに泰山（イメージ）！どっしりした石敢當です。\n横で必死に手作り弁当の売り込みをしているのも気になりますが。のり弁専門店か？',810,543,100,67,39,26,124.16581749916,24.353884955886,'2007-05-11 14:22:42','2007-05-20 13:42:41','2007-05-27 10:10:12',NULL,'2007-05-30 00:21:17'),(779,'観光牧場八重福','IMGP4646.jpg','石垣市街を出て少しのところにある牧場併設焼き肉屋。産地直送を超えた文字通りの地産地消（違う）',810,543,100,67,39,26,124.15880084038,24.357447579695,'2007-05-11 14:39:56','2007-05-20 13:42:53','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:27'),(780,'丘の上より石垣市街を望む。','IMGP4647.jpg','石垣は開発が進んでいますが、市街を一歩出るともう山だったりします。あまり切り崩してまで開発とかしないでほしいなぁ。',810,543,100,67,39,26,124.15815711021,24.357530657517,'2007-05-11 14:40:43','2007-05-27 09:54:52','2007-05-27 10:09:36',NULL,'2007-05-30 00:21:58'),(781,'お墓で休憩？','IMGP4650.jpg','沖縄の代表的な墓である亀甲墓は、お盆の時に集まってご先祖様たちと島酒を飲みかわしたりする場所でもあるらしい。ので正しい使い方、かな？農作業お疲れ様です。',810,543,100,67,39,26,124.15791034698,24.35759418758,'2007-05-11 14:42:24','2007-05-20 13:44:30','2007-05-21 11:57:16',NULL,'2007-05-30 00:22:25'),(782,'石垣上空を飛ぶ飛行機','IMGP4652.jpg','割りと小型機ですね。何の飛行機だろう。',810,543,100,67,39,26,124.1569930315,24.358136635278,'2007-05-11 14:55:11','2007-05-27 09:54:38','2007-06-01 12:18:29',NULL,'2007-06-01 13:23:55'),(783,'裏口のシーサー','IMGP4660.jpg','なんかコミカルな感じで楽しげ。でもコレ、シーサーなのか？あまりの寸胴っぷりにローブを羽織ってるように思えてしまう。',810,543,100,67,39,26,124.15707886219,24.35978351179,'2007-05-11 15:01:51','2007-05-20 13:47:10','2007-05-21 11:59:06',NULL,'2007-05-30 00:23:13'),(784,'テーブルサンゴ３','IMGP1763.jpg','右半分死んでいますが、それにしてもでかい！',810,543,100,67,39,26,125.27143478394,24.920495876392,'2007-04-19 15:45:07','2007-04-19 15:45:10','2007-05-25 21:51:32',NULL,'2007-05-29 21:37:37'),(785,'古見の朝21','IMGP4448.jpg',NULL,810,543,100,67,39,26,123.90818595886,24.318160324008,'2007-05-07 07:45:37','2007-05-07 07:45:40','2007-05-25 21:51:12',NULL,'2007-05-30 23:18:35'),(786,'八重山焼浦崎窯','IMGP4661.jpg','つぼや寸胴シーサーなどを作っているようです。',810,543,100,67,39,26,124.15707886219,24.35978351179,'2007-05-11 15:02:14','2007-05-20 13:50:24','2007-05-21 11:59:41',NULL,'2007-05-30 00:23:25'),(787,'ちょっと休憩〜','IMGP4662.jpg','さすが沖縄。自販機にさんぴん茶、うっちん茶、グァバ茶まであるよ。じゃあさんぴん茶にしようかな〜・・って！350mmと500mmの値段同じかよ！',810,543,100,67,39,26,124.15710568428,24.359729756515,'2007-05-11 15:07:16','2007-05-11 15:07:18','2007-05-21 12:00:36',NULL,'2007-05-30 00:23:40'),(788,'バンナ岳展望台','IMGP4663.jpg','登りたかったけど足がなかったので下から撮っただけ。',810,543,100,67,39,26,124.15714323521,24.364699579467,'2007-05-11 15:11:25','2007-05-20 19:25:11','2007-05-21 12:00:54',NULL,'2007-05-30 00:24:21'),(789,'糸トンボ','IMGP4677.jpg','田んぼの用水路にいた。',810,543,100,67,39,26,124.1539567709,24.365105170954,'2007-05-11 15:18:10','2007-05-11 15:18:12','2007-05-21 12:01:32',NULL,'2007-05-30 00:24:51'),(790,'開発中。','IMGP4678.jpg','何が建つのかな？',810,543,100,67,39,26,124.1539567709,24.365105170954,'2007-05-11 15:18:51','2007-05-21 19:46:11','2007-05-21 12:02:45',NULL,'2007-05-30 00:24:53'),(791,'たばこ〜？','IMGP4680.jpg','タバコの花ってピンクなんだ。へぇ。でも本当にたばこなんだろうか。',810,543,100,67,39,26,124.15362417698,24.365217563546,'2007-05-11 15:20:09','2007-05-21 19:46:23','2007-05-29 08:28:03',NULL,'2007-05-30 00:25:02'),(792,'石垣市郊外の空。','IMGP4681.jpg','市街地をちょっと離れるとこんな感じです。',810,543,100,67,39,26,124.15361344814,24.365105170954,'2007-05-11 15:22:30','2007-05-21 19:46:44','2007-05-29 08:28:35',NULL,'2007-05-30 00:25:10'),(793,'石垣港を望む','IMGP4683.jpg','石垣の街って割とこじんまりしています。めっちゃ都会ですけどね。八重山的には。',810,543,100,67,39,26,124.15274441242,24.365070964493,'2007-05-11 15:24:25','2007-05-21 19:47:37','2007-05-29 08:29:20',NULL,'2007-05-30 00:25:24'),(794,'島藍農園','IMGP4684.jpg','４年ほど前からやってるそうです。いろんな小物があってとてもかわいいです。',810,543,100,67,39,26,124.15153205395,24.365193130382,'2007-05-11 15:26:42','2007-05-29 08:32:16','2007-05-29 08:33:30',NULL,'2007-05-30 00:25:34'),(795,'丘の上から。','IMGP4685.jpg','のどかな農道。',810,543,100,67,39,26,124.1513389349,24.364743559329,'2007-05-11 16:07:07','2007-05-29 08:34:42','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:28'),(796,'石垣市郊外の空２','IMGP4686.jpg',NULL,810,543,100,67,39,26,124.15138721466,24.364465019941,'2007-05-11 16:10:18','2007-05-29 08:35:13','2007-05-29 08:35:34',NULL,'2007-05-30 00:25:50'),(797,'石垣市郊外の牧場','IMGP4687.jpg','とっても広々としています。',810,543,100,67,39,26,124.15104925632,24.363878619224,'2007-05-11 16:12:18','2007-05-29 08:37:08','2007-05-29 08:37:07',NULL,'2007-05-30 00:26:01'),(798,'たばこ畑？と石垣の街並','IMGP4688.jpg',NULL,810,543,100,67,39,26,124.15176272392,24.363849299116,'2007-05-11 16:13:04','2007-05-21 19:48:08','2007-05-29 08:37:41',NULL,'2007-05-30 00:26:11'),(799,'芭蕉と石垣港','IMGP4689.jpg','空と海の境界線が曖昧。',810,543,100,67,39,26,124.15146231651,24.363854185801,'2007-05-11 16:14:22','2007-05-21 19:48:16','2007-05-29 08:38:14',NULL,'2007-05-30 00:26:25'),(800,'・・・サギ？','IMGP4690.jpg','飛び立ったのでとっさに撮ったのですが。',810,543,100,67,39,26,124.15133357048,24.363487683902,'2007-05-11 16:15:37','2007-05-29 08:39:32','2007-05-29 08:39:26',NULL,'2007-05-30 00:26:56'),(801,'隠れる小鳥','IMGP4694.jpg','かなり小さいです。街中にも時々見かけます。',810,510,100,62,39,24,124.1515481472,24.362280663475,'2007-05-11 16:19:14','2007-05-29 08:41:44','2007-05-29 08:41:42',NULL,'2007-05-30 00:27:00'),(802,'隠れる小鳥２','IMGP4698.jpg','こちらの様子を窺っています。',810,510,100,62,39,24,124.1515481472,24.362280663475,'2007-05-11 16:20:42','2007-05-29 08:42:43','2007-05-29 08:42:37',NULL,'2007-05-30 00:27:02'),(803,'飛び立つ鳥','IMGP4702.jpg','バンナ岳ふもとにて。右奥に御嶽も見えます。',810,543,100,67,39,26,124.15161788464,24.362138947771,'2007-05-11 16:21:10','2007-05-27 09:36:32','2007-05-29 08:45:05',NULL,'2007-05-30 00:27:15'),(804,'蝶と墓と工場','IMGP4705.jpg','バンナ岳ふもとにて。',810,543,100,67,39,26,124.15128529072,24.359426771812,'2007-05-11 16:24:08','2007-05-29 08:47:39','2007-05-29 08:47:37',NULL,'2007-05-30 00:27:33'),(805,'二匹の蝶。','IMGP4710.jpg','雌雄で模様が違うのかな。どっちがどっちなんでしょう？',810,543,100,67,39,26,124.15147840977,24.35940233753,'2007-05-11 16:24:17','2007-05-27 09:37:10','2007-05-29 08:48:03',NULL,'2007-05-30 00:27:43'),(806,'二匹の蝶２','IMGP4712.jpg',NULL,810,543,100,67,39,26,124.15147840977,24.35940233753,'2007-05-11 16:24:19','2007-05-27 09:37:17','2007-05-29 08:48:28',NULL,'2007-05-30 00:27:45'),(807,'滑り落ちる夕日','IMGP4716.jpg','４号線にて。',803,543,99,67,38,26,124.15158033371,24.348059434541,'2007-05-11 18:37:58','2007-05-28 09:14:19','2007-05-29 09:00:06',NULL,'2007-05-30 00:28:51'),(808,'請福酒造','IMGP4718.jpg','請福と言えば黄色と水色のよく見る泡盛。しかし電線がほんとうざいです。日本は地震が多いせいで電線を地中に埋設することができないんですね。むしろ電線を日本の景観として推薦したいくらい。',810,543,100,67,39,26,124.15012657642,24.348963580847,'2007-05-11 18:40:29','2007-05-27 09:38:06','2007-05-29 08:55:47',NULL,'2007-05-30 00:29:02'),(809,'赤瓦と夕日','IMGP4721.jpg','石垣市街はどこに行っても電線が邪魔だなぁ。沖縄の話じゃないけど日本人ほど自分が住んでいる街の景観に無関心な国はないらしいです。言葉ばかりの愛国心では困りますよね。',810,543,100,67,39,26,124.14974570274,24.349159071091,'2007-05-11 18:41:34','2007-05-27 09:39:00','2007-05-29 09:05:54',NULL,'2007-05-30 00:29:11'),(810,'路地とベビーカー','IMGP4738.jpg','しばらく放置されています。違法駐車で切符切られるよ！',810,543,100,67,39,26,124.14740145206,24.349574486858,'2007-05-11 18:49:26','2007-05-27 09:41:25','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:30'),(811,'石垣市新川の石敢當','IMGP4739.jpg','表札型亜種（大）。なんとサンゴで書いてあります。',809,543,100,67,38,26,124.14733171463,24.349618471977,'2007-05-11 18:49:59','2007-05-28 09:10:33','2007-05-29 09:02:19',NULL,'2007-05-30 00:32:32'),(812,'石垣漁港付近の中央分離帯','IMGP4747.jpg','道の太さのわりにきっと交通量は少ない道路。',810,543,100,67,39,26,124.14648413658,24.34912486032,'2007-05-11 18:53:12','2007-05-27 09:53:01','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:32'),(813,'石垣島のカラス','IMGP4751.jpg','石垣のカラスはやはり都会っ気の付いた不良カラスが多し。',810,543,100,67,39,26,124.14719223976,24.348792526635,'2007-05-11 18:55:09','2007-05-27 09:56:55','2007-05-29 09:03:22',NULL,'2007-05-30 00:32:55'),(814,'ハイビスカスの植込み','IMGP4752.jpg','近所のおばちゃんが咲き終わった花を摘んで手入れしていました。誰に頼まれるでもなくやってるんだろうなぁ。',810,543,100,67,39,26,124.14773404598,24.348479741194,'2007-05-11 18:56:40','2007-05-27 09:59:25','2007-05-29 09:03:56',NULL,'2007-05-30 00:33:08'),(815,'石垣市新川のハイビスカス','IMGP4754.jpg',NULL,810,543,100,67,39,26,124.14769649506,24.348499290307,'2007-05-11 18:56:47','2007-05-27 10:02:52','2007-05-29 09:03:39',NULL,'2007-05-30 00:33:17'),(816,'石垣市新川の御嶽？空き地？','IMGP4755.jpg','ゴミ捨て禁止の看板は沖縄で一番多いかもね。というくらい沖縄の人はよくゴミを投げ捨てます。東京並みに。自然に恵まれた地域は環境に関する意識が低いというのは悲しい真理ですね。',810,543,100,67,39,26,124.1489893198,24.347849280691,'2007-05-11 18:57:55','2007-05-11 18:57:58','2007-05-29 09:05:28',NULL,'2007-05-30 00:33:47'),(817,'公文と花','IMGP4756.jpg','こんな時間までみんな勉強してるんだね〜',810,543,100,67,39,26,124.15728271008,24.344604069985,'2007-05-11 21:14:19','2007-05-27 10:13:46','2007-05-29 09:06:45',NULL,'2007-05-30 00:34:30'),(818,'カーテンと猫','IMGP4762.jpg','外に出たいけど、暑そうだにゃ〜',810,543,100,67,39,26,124.15512084961,24.348186504141,'2007-05-12 14:08:15','2007-05-28 09:03:35','2007-05-29 09:07:20',NULL,'2007-05-30 00:34:49'),(819,'猫と苦瓜','IMGP4774.jpg','沖縄の猫は当然ゴーヤーが大好物です。チャンプルーもいいけど薄く切ってツナとすりゴマを和えたサラダがお好み。\nあ、もしかして信じた？',810,543,100,67,39,26,124.15512084961,24.348186504141,'2007-05-12 14:10:48','2007-05-12 14:10:50','2007-05-29 09:09:29',NULL,'2007-05-30 00:34:51'),(820,'猫の背中','IMGP4778.jpg','実は先日外の縄張りを奪われてしまった猫。その哀愁漂う背中が語る外に出たい想いとの葛藤。',810,509,100,62,39,24,124.15512084961,24.348186504141,'2007-05-12 14:11:55','2007-05-28 09:09:08','2007-05-29 09:09:39',NULL,'2007-05-30 00:34:54'),(821,'真乙姥井戸２','IMGP4784.jpg','道路の真ん中にあります。なのに撤去されなかったのは、近くの真乙姥御嶽（おん）とセットでとても重要なものだからなのでしょう。',810,543,100,67,39,26,124.15432155132,24.346915802397,'2007-05-13 10:19:09','2007-05-13 10:19:10','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:33'),(822,'真乙姥御嶽','IMGP4785.jpg','目の前が幹線道路、しかも歩道なしという危険な（？）御嶽。真乙姥というのは八重山の英雄オヤケアカハチと戦った長田大主（なーだふーず）の妹（娘という説も）であり、その墓らしい。',810,543,100,67,39,26,124.15397822857,24.34672030869,'2007-05-13 10:22:21','2007-05-28 09:43:11','2007-05-29 09:13:53',NULL,'2007-05-30 00:35:13'),(823,'真乙姥御嶽の巨樹','IMGP4787.jpg','推定樹齢２００〜３００年のオオバアコウだそうな。',810,543,100,67,39,26,124.15392458439,24.346769182145,'2007-05-13 10:23:07','2007-05-13 10:23:08','2007-05-29 09:14:07',NULL,'2007-05-30 00:35:22'),(824,'ブーゲンビリアと真乙姥御嶽','IMGP4790.jpg',NULL,810,509,100,62,39,24,124.15414452553,24.346627449073,'2007-05-13 10:24:52','2007-05-28 09:46:34','2007-05-29 09:14:25',NULL,'2007-05-30 00:35:29'),(825,'石垣市石垣のブーゲンビリア','IMGP4792.jpg','背景に見える４本の線は、電線です。念のため。',810,543,100,67,39,26,124.15419280529,24.346598124969,'2007-05-13 10:25:18','2007-05-28 09:49:04','2007-05-29 09:15:15',NULL,'2007-05-30 00:35:37'),(826,'石垣市石垣のブーゲンビリア２','IMGP4793.jpg',NULL,810,543,100,67,39,26,124.15423572063,24.346573688211,'2007-05-13 10:25:23','2007-05-13 10:25:24','2007-05-29 09:15:13',NULL,'2007-05-30 00:35:42'),(827,'空の交差点。','IMGP4794.jpg','交差点の上にも交差点がありました。',810,543,100,67,39,26,124.15406942368,24.34660301232,'2007-05-13 10:25:29','2007-05-29 09:15:41','2007-05-30 10:14:08',NULL,'2007-05-30 23:05:06'),(828,'桃林寺西通りの小径','IMGP4795.jpg',NULL,810,543,100,67,39,26,124.15620446205,24.34502927552,'2007-05-13 10:29:50','2007-05-29 09:16:39','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:35'),(829,'桃林寺西通りの小径２','IMGP4797.jpg',NULL,810,543,100,67,39,26,124.15623128414,24.34479956696,'2007-05-13 10:30:16','2007-05-29 09:17:22','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:36'),(830,'桃林寺西通りのニチニチソウ','IMGP4798.jpg','石垣とアスファルトのわずかな隙間から生えてくる花。毎日新しい花が生えてくる事から日々草というそうな。',810,543,100,67,39,26,124.15602207184,24.344814229221,'2007-05-13 10:30:34','2007-05-29 09:17:44','2007-05-29 09:18:15',NULL,'2007-05-30 00:36:46'),(831,'果敢なニチニチソウ','IMGP4799.jpg','民家の入り口に堂々と咲く花。もう少し端に寄ってたらここの家の車に轢かれてただろう。',810,543,100,67,39,26,124.15599524975,24.344770242433,'2007-05-13 10:30:50','2007-05-28 10:05:39','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:38'),(832,'桃林寺西通りの小径３','IMGP4800.jpg',NULL,810,543,100,67,39,26,124.15588259697,24.344325486274,'2007-05-13 10:33:10','2007-05-29 08:21:08','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:39'),(833,'桃林寺西通りの石敢當','IMGP4801.jpg','表札型（中）。',810,543,100,67,39,26,124.15571630001,24.344447672187,'2007-05-13 10:34:19','2007-05-29 08:24:02','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:41'),(834,'桃林寺向かいの庭園跡３','IMGP4802.jpg','今では歩道脇の憩いの場。誰も憩ってなかったけどな！',810,543,100,67,39,26,124.15537834167,24.34356304351,'2007-05-13 10:35:36','2007-05-13 10:35:38','2007-05-29 09:23:27',NULL,'2007-05-30 00:37:46'),(835,'桃林寺のニチニチソウ','IMGP4803.jpg','どこにも土なんてないはずなのにすごい生命力。',810,543,100,67,39,26,124.15558218956,24.343548381104,'2007-05-13 10:36:55','2007-05-29 09:22:31','2007-05-30 09:07:18',NULL,'2007-05-31 20:53:08'),(836,'オオゴマダラとシーサー','IMGP4808.jpg','ぼんやりと浮かぶ蝶。',792,543,98,67,38,26,NULL,NULL,'2007-05-13 10:37:49','2007-05-30 09:11:21','2007-05-30 23:19:35',NULL,'2007-05-31 10:52:14'),(837,'ゆいロードの路地','IMGP4812.jpg','\n',810,543,100,67,39,26,124.1571700573,24.341759554856,'2007-05-13 10:38:06','2007-05-30 09:15:04','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:42'),(838,'ESPRIT','IMGP4813.jpg','開店してなかったので何屋さんかはわかりませんでした。',810,543,100,67,39,26,124.15676236153,24.342277632817,'2007-05-13 10:39:07','2007-05-30 09:18:01','2007-05-30 21:52:15',NULL,'2007-05-30 23:20:44'),(839,'むじんくんの石敢當','IMGP4814.jpg','表札型（中）。むじんくんでも魔除けは必要なんだね。おそるべしまじむん（魔物）',810,543,100,67,39,26,124.15719151497,24.341740004703,'2007-05-13 10:41:29','2007-05-30 09:25:26','2007-05-30 21:52:47',NULL,'2007-05-30 23:21:17'),(840,'ゆうくぬみ','IMGP4815.jpg','二間ほどの幅のかわいらしい休み処。八重山そばなどを出しています。',810,543,100,67,39,26,124.15816247463,24.338929638781,'2007-05-13 11:12:49','2007-05-30 09:30:48','2007-05-30 21:53:18',NULL,'2007-05-30 23:21:34'),(841,'石垣市役所のヤシ？','IMGP4816.jpg','しかしこの看板、中国語表記はなくても通じるんじゃないの？',365,543,44,67,17,26,124.15609717369,24.340581652738,'2007-05-13 11:24:27','2007-05-30 09:56:40','2007-05-30 21:53:34',NULL,'2007-05-30 23:21:59'),(842,'FLORIST YOSHINO','IMGP4817.jpg','黒でまとめた沖縄では珍しい洗練されたセンスの店。',810,543,100,67,39,26,124.15561974049,24.341515177724,'2007-05-13 11:26:43','2007-05-30 09:56:20','2007-05-30 21:53:52',NULL,'2007-05-30 23:22:10'),(843,'auショップの石敢當','IMGP4818.jpg','ヴィヴィットオレンジの中に石碑型（中）',810,543,100,67,39,26,124.15515303612,24.341656916518,'2007-05-13 11:29:19','2007-05-30 09:57:13','2007-05-30 21:54:09',NULL,'2007-05-30 23:22:25'),(844,'かみやーき小（ぐゎ）の石敢當','IMGP4819.jpg','かまぼこ屋。歓迎・市町村教育委員会様って。何かの式典でかまぼこが大量に振る舞われたりするんだろうか。',810,543,100,67,39,26,124.15530323982,24.341847530508,'2007-05-13 11:29:49','2007-05-30 09:59:54','2007-05-30 21:54:27',NULL,'2007-05-30 23:22:33'),(845,'石垣市の消防署','IMGP4820.jpg','美崎町二等辺三角形の鋭角に位置する消防署。右が石垣埠頭。左が市役所通りです。',795,543,98,67,38,26,124.15552854538,24.341075297698,'2007-05-13 11:30:06','2007-05-30 10:05:28','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:44'),(846,'街の電器屋さんの花壇','IMGP4821.jpg','配置とか壁の色との組み合わせが、なかなかいい感じです。',810,543,100,67,39,26,NULL,NULL,'2007-05-13 11:31:03','2007-05-30 10:07:55','2007-05-30 21:55:32',NULL,NULL),(847,'石垣市石垣の路地３','IMGP4822.jpg','突き当たりに見えるのは権現堂かと思います。',810,543,100,67,39,26,124.15477216244,24.342370495623,'2007-05-13 11:31:59','2007-05-30 10:12:23','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:45'),(848,'鳥よけ？','IMGP4824.jpg','階段を抜けたところにぶらさがるCD-R。時折反射して涼しげ。風流さはないけど。',810,543,100,66,39,25,124.15491700172,24.342184769942,'2007-05-13 11:36:33','2007-05-30 10:18:50','2007-05-30 21:56:29',NULL,'2007-05-30 23:23:13'),(849,'市役所脇の樹','IMGP4833.jpg','幹に不思議な跡が見えます。',365,543,44,67,17,26,124.15587723255,24.340845581966,'2007-05-13 11:39:17','2007-05-30 10:23:39','2007-05-30 21:56:40',NULL,'2007-05-30 23:23:28'),(850,'自販機とヒルガオ','IMGP4843.jpg',NULL,810,543,100,67,39,26,124.15627419949,24.340674516788,'2007-05-13 11:41:23','2007-05-30 10:26:22','2007-05-30 21:57:00',NULL,'2007-05-30 23:23:47'),(851,'小っちゃなベーカリー・メルヘン','IMGP4844.jpg','日曜日なので休みだった。おいしくて安いおすすめのお店。',810,543,100,67,39,26,124.15729343891,24.340840694392,'2007-05-13 11:43:30','2007-05-30 10:28:58','2007-05-30 21:57:09',NULL,'2007-05-30 23:23:56'),(852,'八重山サンヨーの石敢當','IMGP4845.jpg','つぶれちゃったのかな。表札型（中）',810,543,100,67,39,26,124.15740609169,24.340874907401,'2007-05-13 11:43:56','2007-05-30 10:30:31','2007-05-30 21:57:23',NULL,'2007-05-30 23:24:06'),(853,'石垣島ぜんざい','IMGP4846.jpg','沖縄でぜんざいと言えば氷ぜんざいの事。公設市場上のしまちゃやのぜんざいは数種類の豆とうこんなどの入った三色の白玉付き。',810,543,100,67,39,26,124.15804982185,24.339819187435,'2007-05-13 11:51:15','2007-05-30 12:49:19','2007-05-30 21:57:35',NULL,'2007-05-30 23:24:17'),(854,'みね屋工房大川店','IMGP4847.jpg','みんさーは紺絣の角帯で、男性の求婚の返事として女性が織って送ったもの。織り込まれた模様には五（いつ）の四（よ）までも末永くという想いが込められているそうです。',810,543,100,67,39,26,124.15692865849,24.340694067106,'2007-05-13 12:15:24','2007-05-13 12:15:26','2007-05-30 21:57:48',NULL,'2007-05-30 23:24:28'),(855,'石垣市石垣のウォールアート','IMGP4848.jpg','よく見ると、イカを釣り上げた海んちゅ！　さすが沖縄です。',810,543,100,67,39,26,124.15641367435,24.341436976942,'2007-05-13 12:17:43','2007-05-30 12:59:19','2007-05-30 21:58:00',NULL,'2007-05-30 23:24:37'),(856,'アート逢謡（あよう）','IMGP4849.jpg','民家を改装したギャラリー。',810,543,100,67,39,26,124.1561883688,24.341515177724,'2007-05-13 12:18:34','2007-05-30 13:04:03','2007-05-30 21:58:21',NULL,'2007-05-30 23:24:49'),(857,'サンゴの駐車場','IMGP4850.jpg','別におしゃれでも何でもなく、よそから砂利運んでくるより安いのかもね。',810,543,100,67,39,26,124.1559201479,24.341906180909,'2007-05-13 12:19:28','2007-05-30 13:08:07','2007-05-30 21:58:42',NULL,'2007-05-30 23:25:10'),(858,'街中のパパイヤ','IMGP4851.jpg','石垣市石垣にて。',810,543,100,67,39,26,124.15501356125,24.342781046163,'2007-05-13 12:22:01','2007-05-30 13:13:46','2007-05-30 21:59:14',NULL,'2007-05-30 23:26:40'),(859,'マーミヤ','IMGP4852.jpg','石垣島の有名かまぼこ店。\nきっと「のマーミヤ」の上にもう一枚「かまぼこ」って看板があったんじゃないかなぁ。',810,543,100,67,39,26,124.15456295013,24.343167157957,'2007-05-13 12:22:44','2007-05-30 13:14:00','2007-05-30 21:59:36',NULL,'2007-05-30 23:26:51'),(860,'石垣市新川の路地','IMGP4854.jpg','向こうに見えるのは街外れのNTT電波塔です。',810,543,100,67,39,26,124.15411233902,24.343787866853,'2007-05-13 12:24:43','2007-05-30 13:23:05','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:47'),(861,'茶色い石敢當','IMGP4855.jpg','うーん。やっぱり石敢當は黒で書いてほしい気が・・・',810,543,100,67,39,26,124.15430545807,24.343983365089,'2007-05-13 12:25:17','2007-05-30 13:27:02','2007-05-30 22:00:15',NULL,'2007-05-30 23:27:19'),(862,'青信号と緑','IMGP4856.jpg','石垣市新川の交差点にて。',810,543,100,67,39,26,124.15317893028,24.345576664451,'2007-05-13 12:28:58','2007-05-30 13:26:22','2007-05-30 22:00:23',NULL,'2007-05-30 23:27:37'),(863,'石垣市新川の歩道','IMGP4857.jpg','樹の又にオオタニワタリが着生していますが、人工的に着生させたもののようです。',810,543,100,67,39,26,124.15353298187,24.346094726796,'2007-05-13 12:29:34','2007-05-30 13:30:24','2007-05-30 22:00:38',NULL,'2007-05-30 23:27:46'),(864,'石垣市新川の石敢當２','IMGP4858.jpg','なぜか表面を削られた感のある石敢當。',810,543,100,67,39,26,124.15373146534,24.34629022147,'2007-05-13 12:30:52','2007-05-30 13:31:04','2007-05-30 22:00:58',NULL,'2007-05-30 23:27:59'),(865,'まあさん！さんぴん茶','IMGP4864.jpg','まあさん＝おいしい。風土と食は密接なもので、内地にいる時はあまりおいしいと思わないさんぴん茶もこっちでは飲み物と言えばこれ。宿にてmacで写真にタイトル付けてるとこ。',810,543,100,67,39,26,124.15514230728,24.348196278721,'2007-05-13 14:54:49','2007-05-30 13:40:36','2007-05-30 22:02:01',NULL,'2007-05-30 23:28:11'),(866,'石垣中学校の渡り廊下','IMGP4865.jpg','放課後は運動部のかけ声とブラバンのラッパの音。懐かしいなぁ。',365,543,44,67,17,26,124.15460050106,24.347751534595,'2007-05-13 16:24:33','2007-05-30 13:41:45','2007-05-30 22:02:16',NULL,'2007-05-30 23:28:21'),(867,'石垣市石垣の井戸','IMGP4867.jpg','ふたは閉じていても電動でくみ上げる機械が乗っています。今でも水不足の年は井戸水が頼りなのだそうです。\n',365,543,44,67,17,26,124.15470778942,24.347883491806,'2007-05-13 16:24:44','2007-05-30 13:43:32','2007-05-30 22:02:24',NULL,'2007-05-30 23:28:48'),(868,'シーサーと花','IMGP4868.jpg','石垣市石垣の民家にて。',810,543,100,67,39,26,124.15494918823,24.347736872674,'2007-05-13 16:25:40','2007-05-30 20:28:36','2007-0