P4883.jpg','表札型（中）。それにしても石敢當にスプレーをかけるとは。',810,543,100,67,39,26,124.16096806526,24.343626580582,'2007-05-13 16:40:26','2007-05-30 20:52:24','2007-05-30 22:05:22',NULL,'2007-05-30 23:36:23'),(880,'石垣市大川の路地','IMGP4884.jpg',NULL,810,543,100,67,39,26,124.16090369225,24.343548381104,'2007-05-13 16:40:39','2007-05-30 20:53:10','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:52'),(881,'空き地の井戸（カー）２','IMGP4885.jpg',NULL,810,543,100,67,39,26,124.16092514992,24.343587480849,'2007-05-13 16:40:50','2007-05-13 16:40:52','2007-05-30 22:05:50',NULL,'2007-05-30 23:35:56'),(882,'石垣市大川の石垣','IMGP4886.jpg','この植物は石垣からしか生えないみたい。',810,543,100,67,39,26,124.16109144688,24.343367544626,'2007-05-13 16:41:07','2007-05-30 20:57:06','2007-05-30 22:06:22',NULL,'2007-05-30 23:35:50'),(883,'海星小前の通り','IMGP4887.jpg',NULL,810,543,100,67,39,26,124.16189610958,24.342761496168,'2007-05-13 16:42:19','2007-05-30 20:59:25','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:53'),(884,'石垣市大川の路地２','IMGP4888.jpg','右の家、石垣のオオタニワタリが見事です。',810,543,100,67,39,26,124.16128456593,24.342258082743,'2007-05-13 16:45:30','2007-05-30 21:05:25','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:55'),(885,'石垣市大川の石敢當３','IMGP4890.jpg','表札石碑型（大）。',810,543,100,67,39,26,124.16089296341,24.341417426739,'2007-05-13 16:48:00','2007-05-30 21:06:54','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:56'),(886,'埋め合わせの石敢當','IMGP4891.jpg','セメントで適当に埋め合わせたような・・・',810,543,100,67,39,26,124.16108071804,24.34162270372,'2007-05-13 16:48:13','2007-05-30 21:08:52','2007-05-30 22:07:43',NULL,'2007-05-30 23:40:19'),(887,'石垣市大川の・・・','IMGP4892.jpg','當＝当の旧字なので間違いではないですが、二文字目は？',810,543,100,67,39,26,124.16095197201,24.341627591263,'2007-05-13 16:48:36','2007-05-30 21:11:02','2007-05-30 22:07:53',NULL,'2007-05-30 23:40:23'),(888,'石垣市大川の屋敷','IMGP4893.jpg','ちゃんと門にもシーサーがいる立派なお屋敷です。',810,543,100,67,39,26,124.16096806526,24.34174977978,'2007-05-13 16:48:39','2007-05-30 21:13:18','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:58'),(889,'空き地の井戸（カー）３','IMGP4894.jpg',NULL,810,543,100,67,