39,26,124.155356884,24.337057656098,'2007-05-13 17:30:42','2007-05-30 21:30:48','2007-06-01 12:18:35',NULL,'2007-06-01 13:24:05'),(900,'サザンゲートブリッジ','IMGP4915.jpg','を渡った先の埋め立て地にはまだ何もありません。',810,543,100,67,39,26,124.155356884,24.337057656098,'2007-05-13 17:31:58','2007-05-30 21:33:36','2007-06-01 12:18:35',NULL,'2007-06-01 13:24:06'),(901,'海人工房','IMGP4916.jpg','内地でも流行った（？）海人Tシャツはこちらの商品。離島ターミナルの真っ正面にあります。',810,543,100,67,39,26,124.15597915649,24.338132949793,'2007-05-13 17:33:32','2007-05-30 21:35:43','2007-05-30 22:13:56',NULL,'2007-05-30 23:43:15'),(902,'石垣島離島ターミナルの夕暮れ','IMGP4923.jpg',NULL,810,543,100,67,39,26,124.1554158926,24.337668619545,'2007-05-13 17:38:43','2007-05-30 21:36:22','2007-05-30 22:14:10',NULL,'2007-05-30 23:43:24'),(903,'美崎町公園のポスト','IMGP4929.jpg','向こうにはワシのオブジェが。',810,543,100,67,39,26,124.15523350239,24.337981431689,'2007-05-13 17:41:06','2007-05-30 21:38:34','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:02'),(904,'美崎町公園のガジュマル','IMGP4933.jpg','素っ気ないベンチ（？）に公園としてのやる気が感じられない。',810,543,100,67,39,26,124.15512084961,24.338123174437,'2007-05-13 17:42:49','2007-05-30 21:45:17','2007-05-30 22:14:44',NULL,'2007-05-30 23:43:44'),(905,'石垣市石垣の空５','IMGP4839.jpg','露出をかなりしぼりました。',810,543,100,67,39,26,124.1556251049,24.341500515081,'2007-05-13 11:39:39','2007-05-30 10:25:13','2007-05-30 23:10:00',NULL,'2007-05-30 23:44:04'),(906,'石垣市大川の石敢當４','IMGP4882.jpg','表札石碑型（大）。',810,543,100,67,39,26,124.16154742241,24.343655905374,'2007-05-13 16:39:53','2007-05-30 20:45:36','2007-06-03 11:37:36',NULL,'2007-06-03 18:06:50'),(907,'石垣市竹富町役場（ん？）','IMGP4937.jpg','竹富町には竹富島を始めたくさんの島々が含まれるため。それらの中継点である石垣市に役場があるわけです。ところで入り口脇にエアロバイクが見えないか？',810,543,100,67,39,26,124.15434837341,24.339550368446,'2007-05-13 17:48:19','2007-05-30 21:48:24','2007-05-30 22:15:56',NULL,'2007-05-31 20:56:23'),(908,'石垣市立図書館の石敢當','IMGP4939.jpg','立派な屋根が目立つ日本最南端の図書館。石敢當は石碑型（中）',810,543,100,67,39,26,124.15359735489,24.339433065435,'2007-05-13 17:49:10','2007-05-31 08:23:06','2007-06-04 11:32:45',NULL,'2007-06-04 11:47:22'),(909,'宮良當壮顕彰碑','IMGP4940.jpg','日本方言研究の先駆者。言葉って調べてみると面白いですよ。',810,543,100,67,39,26,124.15385484695,24.339706772291,'2007-05-13 17:49:59','2007-05-13 17:50:02','2007-05-31 16:41:56',NULL,'2007-05-31 20:56:53'),(910,'交通死亡事故０一年達成記念植樹','IMGP4941.jpg','ここに二本しかないという事はここ５、６年は事故が増えてきているという事でしょうか。',810,543,100,67,39,26,124.15376901627,24.339814299822,'2007-05-13 17:50:19','2007-05-13 17:50:22','2007-05-31 16:42:10',NULL,'2007-05-31 20:57:01'),(911,'World Peace Flame','IMGP4942.jpg','ガンジーの遺志に基づいた、世界平和を祈る炎を世界中で合わせ、また分け合おうという祭典。なお、2000年7月15日は沖縄サミット開催の６日前です。沖縄の人々がサミットに込めた願いはいかばかりだったでしょうか。',810,543,100,67,39,26,124.15376901627,24.339814299822,'2007-05-13 17:50:43','2007-05-13 17:50:46','2007-05-31 16:42:28',NULL,'2007-05-31 20:57:12'),(912,'石垣島を中心にした世界。','IMGP4943.jpg','地理的に言えば日本最南端の都市というより東南アジアの中心と言った方がいいような感じです。なお、ここには書いていませんが、那覇とは約350km離れています。',810,543,100,67,39,26,124.15366172791,24.339892501606,'2007-05-13 17:50:53','2007-05-31 08:58:26','2007-05-31 16:42:42',NULL,'2007-05-31 20:57:17'),(913,'緊急集会','IMGP4944.jpg','バナー（横断幕）には集会の日付等は書いてありませんが、国民投票法案が取り沙汰されている時分ですので、ごく最近立てられたのかな。',810,543,100,67,39,26,124.15380120277,24.339882726386,'2007-05-13 17:51:42','2007-05-13 17:51:44','2007-05-31 16:43:34',NULL,'2007-05-31 20:57:26'),(914,'ほほえみの鐘','IMGP4945.jpg','世界平和の鐘に併せて隣に設置された小さな鐘。\n未来の子どもたちの幸せ＝平和への祈りが込められています。',810,543,100,67,39,26,124.1536295414,24.340029354612,'2007-05-13 17:51:59','2007-05-31 09:02:20','2007-05-31 16:43:42',NULL,'2007-05-31 20:57:34'),(915,'ほほえみの鐘２','IMGP4946.jpg','世界平和の鐘に併せて隣に設置された小さな鐘。\n未来の子どもたちの幸せ＝平和への祈りが込められています。左隣にあるのが世界平和の鐘です。',810,543,100,67,39,26,124.1536295414,24.340029354612,'2007-05-13 17:52:57','2007-05-31 09:04:39','2007-05-31 16:43:26',NULL,'2007-05-31 20:57:36'),(916,'Paz a Todos los Hombres','IMGP4948.jpg','世界が平和でありますように（スペイン語）',810,543,100,67,39,26,124.15347397327,24.340185757865,'2007-05-13 17:54:15','2007-05-13 17:54:16','2007-05-31 16:43:48',NULL,'2007-05-31 20:58:01'),(917,'世界平和の鐘','IMGP4950.jpg','国連総会開会に際して国連事務総長が打ち鳴らす世界平和の鐘は、世界65カ国のコインやメダルで鋳造され日本から国連本部に寄贈された。ここにあるのはレプリカですな。',810,543,100,67,39,26,124.15358662605,24.340097781059,'2007-05-13 17:55:28','2007-05-13 17:55:30','2007-05-31 16:44:04',NULL,'2007-05-31 20:58:12'),(918,'新栄公園のグラウンド','IMGP4961.jpg','各国語で世界平和の祈りが込められた碑と、子どもたち。',810,543,100,67,39,26,124.15347397327,24.340185757865,'2007-05-13 17:58:43','2007-05-13 17:58:44','2007-05-31 16:44:24',NULL,'2007-05-31 20:58:03'),(919,'世界平和の鐘２','IMGP4963.jpg','国連総会開会に際して国連事務総長が打ち鳴らす世界平和の鐘は、世界65カ国のコインやメダルで鋳造され日本から国連本部に寄贈された。そのレプリカが新栄公園のこれ。',810,543,100,67,39,26,124.15364027023,24.34015643227,'2007-05-13 17:59:40','2007-05-13 17:59:42','2007-05-31 16:44:57',NULL,'2007-05-31 20:58:20'),(920,'ファイティングポーズをとるシーサー？','IMGP4964.jpg','子どもたちの遊具なんですが、内部は・・・、',810,543,100,67,39,26,124.15319502354,24.341383213876,'2007-05-13 18:03:57','2007-05-13 18:04:00','2007-05-31 16:44:53',NULL,'2007-05-31 20:58:31'),(921,'ファイティングポーズをとるシーサー２？','IMGP4966.jpg','もう一頭と向き合って置かれた遊具。遊具と言っていいのかは不明。',810,543,100,67,39,26,124.15298581123,24.341192599187,'2007-05-13 18:04:26','2007-05-13 18:04:28','2007-05-31 16:45:09',NULL,'2007-05-31 20:58:40'),(922,'ファイティングシーサーの内部','IMGP4967.jpg','内側はいたずら書きの嵐、そしてホームレスの住居。確かに風雨をしのぐには持ってこいですな。恋愛上等、うむ。',810,543,100,67,39,26,124.15319502354,24.341383213876,'2007-05-13 18:05:25','2007-05-13 18:05:26','2007-05-31 16:45:22',NULL,'2007-05-31 20:58:34'),(923,'新栄公園の二本の樹','IMGP4968.jpg','根を地面に張り巡らして陣取り合戦をやっています。',810,543,100,67,39,26,124.15323257446,24.341588490913,'2007-05-13 18:06:18','2007-05-31 09:22:12','2007-05-31 16:45:40',NULL,'2007-05-31 20:59:03'),(924,'女の子と子犬','IMGP4970.jpg','手に持っているのは犬用ジャーキーでしょうか、届きそうで届かないあたりでからかっています。',810,543,100,67,39,26,124.15288925171,24.342028369157,'2007-05-13 18:07:22','2007-06-01 18:05:35','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:04'),(925,'本当に書いただけの石敢當','IMGP4971.jpg','コンクリートに直接筆で書いたのかな。筆が傷んだんじゃ・・・',810,543,100,67,39,26,124.1528570652,24.342082131948,'2007-05-13 18:07:52','2007-05-31 09:25:53','2007-05-31 16:46:12',NULL,'2007-05-31 21:00:01'),(926,'津波避難ビル','IMGP4974.jpg','ちゃんとそういうのが指定されているんですね。耐震構造がしっかりしているんでしょうね。きっと。',810,543,100,67,39,26,124.15145158768,24.342409595732,'2007-05-13 18:11:18','2007-05-31 09:27:04','2007-05-31 16:46:29',NULL,'2007-05-31 21:03:12'),(927,'沖縄のコンビニ','IMGP4975.jpg','地元の人はもちろん、観光客も多用するので、沖縄コーナーは欠かせません。',810,543,100,67,39,26,124.15037870407,24.34114372358,'2007-05-13 18:14:33','2007-05-13 18:14:36','2007-05-31 16:46:56',NULL,'2007-05-31 21:03:18'),(928,'沖縄のコンビニ２','IMGP4976.jpg','内地でも海辺の観光地はそうでしょうが、コンビニでこういうのが普通に売ってる。これ、ペットボトル等のケースの上なんですね。最初気付かなかった。',810,543,100,67,39,26,124.15037870407,24.34114372358,'2007-05-13 18:16:27','2007-05-13 18:16:30','2007-05-31 16:46:59',NULL,'2007-05-31 21:03:19'),(929,'八重山拳法。','IMGP4977.jpg','失礼ながら、ずいぶんふにゃふにゃした拳法とお見受けしますが・・・',810,543,100,67,39,26,124.15070056915,24.342961883479,'2007-05-13 18:18:47','2007-05-13 18:18:48','2007-05-31 16:47:11',NULL,'2007-05-31 21:03:57'),(930,'石垣港の石敢當','IMGP4978.jpg','表札型（やや大）。削りが荒々しい。',810,543,100,66,39,25,124.15054500103,24.34310850814,'2007-05-13 18:19:25','2007-05-31 09:31:25','2007-05-31 16:47:27',NULL,'2007-05-31 21:04:13'),(931,'石垣港の猫','IMGP4980.jpg','まだ子どもかな〜',810,543,100,67,39,26,124.15077030659,24.343431081796,'2007-05-13 18:20:21','2007-05-31 09:34:16','2007-05-31 16:47:42',NULL,'2007-05-31 21:04:22'),(932,'石垣港の猫２','IMGP4981.jpg','「にゃー」と言ったらようやく振り向いた。',810,543,100,67,39,26,124.15077030659,24.343431081796,'2007-05-13 18:20:23','2007-05-31 09:34:08','2007-05-31 16:47:50',NULL,'2007-05-31 21:04:23'),(933,'うみんちゅ自由市場','IMGP4982.jpg','海人たちがオリオン片手にわいわいやっていました。',810,543,100,67,39,26,124.15098488331,24.343709667475,'2007-05-13 18:21:01','2007-05-31 09:34:01','2007-05-31 16:48:20',NULL,'2007-05-31 21:04:28'),(934,'石垣港前のカフェ','IMGP4983.jpg','真っ白い壁に朱色の扉が映えてそこだけヨーロッパの港町のよう。',788,543,97,67,37,26,124.15118873119,24.343763429553,'2007-05-13 18:21:40','2007-05-31 09:38:34','2007-05-31 16:48:36',NULL,'2007-05-31 21:04:35'),(935,'新川小学校の校舎','IMGP4986.jpg','海でのびのびすごす子どもたち。この絵が新川小の理念を何より表しているのかな。',810,543,100,67,39,26,124.14945602417,24.346495490552,'2007-05-13 18:28:23','2007-05-31 09:41:03','2007-05-31 16:48:50',NULL,'2007-05-31 21:04:48'),(936,'仄白いアカバナー','IMGP4987.jpg','めしべは毒々しいほどあざやかな赤。',810,543,100,67,39,26,124.14970815182,24.346793618865,'2007-05-13 18:29:15','2007-05-25 22:08:12','2007-05-31 16:48:58',NULL,'2007-05-31 21:04:54'),(937,'マックスバリュ新川店','IMGP4992.jpg','日本の郊外を支配するイオングループが石垣島にも数店舗進出しています。今や石垣島では沖縄最大手のサンエーよりも勢いがあるようです。',810,543,100,67,39,26,124.14745509624,24.348259813468,'2007-05-13 18:33:17','2007-05-13 18:33:18','2007-05-31 16:49:08',NULL,'2007-05-31 21:05:03'),(938,'石垣市新川の石敢當３','IMGP4993.jpg','風格のある石敢當。',810,543,100,67,39,26,124.14816856384,24.348641021284,'2007-05-13 18:42:02','2007-05-31 09:51:29','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:06'),(939,'石垣市新川の御嶽','IMGP4995.jpg','夕暮れ。',810,543,100,67,39,26,124.14821147919,24.348831624761,'2007-05-13 18:43:26','2007-05-31 09:53:36','2007-05-31 16:49:37',NULL,'2007-05-31 21:05:29'),(940,'御嶽の窓','IMGP4998.jpg',NULL,810,542,100,66,39,25,124.14821147919,24.348831624761,'2007-05-13 18:45:26','2007-05-31 09:58:41','2007-05-31 16:50:02',NULL,'2007-05-31 21:05:31'),(941,'石垣市新川の御嶽２','IMGP4999.jpg',NULL,810,543,100,67,39,26,124.14821147919,24.348831624761,'2007-05-13 18:45:38','2007-05-31 10:00:45','2007-05-31 16:50:15',NULL,'2007-05-31 21:05:33'),(942,'御嶽のカラス','IMGP5000.jpg','御嶽に巣を作ったため、近所の人と敵対関係にあります。',808,543,100,67,38,26,124.14835631847,24.348699668538,'2007-05-13 18:47:19','2007-05-31 10:03:12','2007-05-31 16:50:28',NULL,'2007-05-31 21:05:52'),(943,'新川の御嶽／夕暮れ','IMGP5001.jpg',NULL,810,543,100,67,39,26,124.14828121662,24.348699668538,'2007-05-13 18:48:29','2007-05-31 10:04:34','2007-05-31 16:50:49',NULL,'2007-05-31 21:05:47'),(944,'赤瓦屋根','IMGP5005.jpg','これは立派な屋根です。',810,543,100,67,39,26,124.14849579334,24.348543275799,'2007-05-13 18:50:17','2007-05-31 10:08:13','2007-05-31 16:51:02',NULL,'2007-05-31 21:06:02'),(945,'赤瓦にサンダル','IMGP5006.jpg','遊んでて上げてしまったのかな？',810,543,100,67,39,26,124.14862990379,24.348455304799,'2007-05-13 18:50:28','2007-05-31 10:09:21','2007-05-31 16:51:21',NULL,'2007-05-31 21:06:07'),(946,'我が家へ帰る鳥。','IMGP5013.jpg',NULL,810,543,100,67,39,26,124.14998710155,24.347795520348,'2007-05-13 18:53:22','2007-06-01 18:04:57','2007-05-31 16:51:45',NULL,'2007-06-01 18:43:33'),(947,'夕日とヤシ科','IMGP5017.jpg',NULL,810,543,100,67,39,26,124.15015876293,24.3479812378,'2007-05-13 18:54:02','2007-05-31 10:10:13','2007-05-31 16:51:56',NULL,'2007-05-31 21:07:56'),(948,'石垣市新川の石敢當４','IMGP5019.jpg',NULL,810,543,100,67,39,26,124.15037333965,24.348381995585,'2007-05-13 19:02:37','2007-06-01 18:04:44','2007-05-31 16:52:21',NULL,'2007-06-01 18:43:34'),(949,'石垣市新川の路地３','IMGP5020.jpg','おうちに帰るオバー。',810,543,100,67,39,26,124.15170371532,24.348044772656,'2007-05-13 19:02:42','2007-05-31 10:17:31','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:07'),(950,'石垣市新川の路地４','IMGP5030.jpg',NULL,810,543,100,67,39,26,124.15261566639,24.347707548828,'2007-05-13 19:04:29','2007-06-01 18:04:32','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:09'),(951,'猫と朝','IMGP5031.jpg','朝から人の部屋でくつろぐ猫。',810,543,100,67,39,26,124.15513694286,24.348235377031,'2007-05-14 08:17:57','2007-05-31 10:25:50','2007-05-31 16:53:03',NULL,'2007-05-31 21:09:20'),(952,'猫の思案','IMGP5034.jpg','僕には、彼女の胸の内はわかりません。',810,543,100,67,39,26,124.15513694286,24.348235377031,'2007-05-14 08:18:37','2007-05-31 10:26:17','2007-05-31 16:53:12',NULL,'2007-05-31 21:09:22'),(953,'朝の路地','IMGP5036.jpg','やどかりハウス前の細い道。',810,543,100,67,39,26,124.15519058704,24.34806920913,'2007-05-14 08:19:31','2007-05-31 10:27:09','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:10'),(954,'御嶽の裏側','IMGP5037.jpg','御嶽周辺は樹に覆われている事が多いので鳥居がないと気付かない事も多い。なお、鳥居があるのは日本の神道との融合のようだ。',810,543,100,67,39,26,124.15512084961,24.348059434541,'2007-05-14 08:20:03','2007-05-31 10:29:41','2007-05-31 16:53:39',NULL,'2007-05-31 21:09:39'),(955,'やしがにハウス、玄関。','IMGP5039.jpg','横の姿見には沖縄親戚一同とある。沖縄はやはり血の結びつきの強いところ。',810,543,100,67,39,26,124.15506184101,24.348142518525,'2007-05-14 08:21:17','2007-05-31 10:36:58','2007-05-31 16:53:46',NULL,'2007-05-31 21:10:01'),(956,'素泊まり宿・やしがにハウス','IMGP5040.jpg','鳩間島出身のご夫婦が子どもたちが自立した後の空き部屋を使って始めた宿。本当にアットホーム。',810,543,100,67,39,26,124.15506184101,24.348142518525,'2007-05-14 11:57:44','2007-05-31 10:37:14','2007-05-31 16:53:53',NULL,'2007-05-31 21:10:00'),(957,'周りのはげた石敢當','IMGP5041.jpg','表札型（中）',810,543,100,67,39,26,124.15475606918,24.34843575568,'2007-05-14 12:02:33','2007-05-31 10:41:52','2007-05-31 17:02:49',NULL,'2007-05-31 21:10:10'),(958,'石垣市外れの墓地','IMGP5042.jpg','いろんな形の墓が混在しています。作られた時期や島によってだいぶ違います。',806,543,100,67,38,26,124.1546112299,24.349349673788,'2007-05-14 12:36:48','2007-05-31 10:45:18','2007-05-31 17:03:05',NULL,'2007-05-31 21:10:21'),(959,'石垣中学校の坂上。','IMGP5044.jpg',NULL,810,543,100,67,39,26,124.15467560291,24.34839177015,'2007-05-14 12:39:16','2007-05-31 10:45:38','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:12'),(960,'熟れたオキナワスズメウリ２','IMGP5045.jpg','スイカみたいな実を付ける花。瓜科だから一応仲間。',810,543,100,67,39,26,124.15538907051,24.347971463204,'2007-05-14 17:11:58','2007-05-31 10:45:55','2007-05-31 18:27:42',NULL,'2007-06-01 13:24:14'),(961,'テッポウユリの視線','IMGP5048.jpg','みんな東を向いています。',810,543,100,67,39,26,124.15546953678,24.347942139412,'2007-05-14 17:12:35','2007-05-31 10:47:48','2007-05-31 17:04:25',NULL,'2007-05-31 21:10:45'),(962,'曇り空のオオゴマダラ','IMGP5050.jpg','オオゴマダラは幼虫の時に食物の毒を体内に蓄積し天敵から身を守る。そのおかげで空を悠々と飛んでいられるのだ。',810,543,100,66,39,25,124.15850579739,24.345664637452,'2007-05-14 17:18:57','2007-06-01 18:03:59','2007-05-31 17:05:16',NULL,'2007-06-01 18:43:36'),(963,'オオゴマダラの雌雄','IMGP5051.jpg','繁殖期なのかな。さかんに追いかけていました。',810,543,100,67,39,26,124.15850579739,24.345664637452,'2007-05-14 17:19:29','2007-05-31 11:08:44','2007-05-31 17:05:54',NULL,'2007-05-31 21:11:13'),(964,'石垣小学校裏のオオゴマダラ','IMGP5052.jpg','羽を広げると10cmをこえる大きな蝶です。',810,543,100,67,39,26,124.15850579739,24.345664637452,'2007-05-14 17:19:30','2007-05-31 11:11:56','2007-05-31 17:06:37',NULL,'2007-05-31 21:11:14'),(965,'舞うオオゴマダラ','IMGP5053.jpg','白黒でゆらゆらと舞う様から新聞蝶とも呼ばれるらしい・・・けどそれはちょっと風情がないな。',810,543,100,67,39,26,124.15850579739,24.345664637452,'2007-05-14 17:19:31','2007-05-31 11:13:43','2007-05-31 17:06:33',NULL,'2007-05-31 21:11:15'),(966,'石垣小学校裏のオオゴマダラ２','IMGP5058.jpg',NULL,810,543,100,67,39,26,124.15850579739,24.345664637452,'2007-05-14 17:19:38','2007-05-31 15:24:51','2007-05-31 17:06:50',NULL,'2007-05-31 21:11:19'),(967,'石垣小学校の穴','IMGP5061.jpg','どやってあいた穴なんだろう。',810,543,100,67,39,26,124.1586881876,24.34556688967,'2007-05-14 17:19:50','2007-05-31 11:15:16','2007-05-31 17:07:01',NULL,'2007-05-31 21:11:25'),(968,'石垣市石垣の抜け道','IMGP5065.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-14 17:24:37','2007-05-31 11:17:17','2007-05-31 17:07:14',NULL,NULL),(969,'子どもシーサー','IMGP5069.jpg','最小限の瓦でできたシーサー。ポーズがかわいい。',810,543,100,67,39,26,124.16067302227,24.342727283668,'2007-05-14 17:29:17','2007-05-14 17:29:20','2007-05-31 17:08:23',NULL,'2007-05-31 21:12:19'),(970,'あさひ食堂','IMGP5070.jpg','今石垣島で一番ヴォリューム／値段の良い食堂。昔は他にもいろいろあったけど、この二年の間に量が減ったしまった店もある。',810,543,100,67,39,26,124.16223406792,24.341583603368,'2007-05-14 17:30:39','2007-05-14 17:30:40','2007-05-31 17:08:40',NULL,'2007-05-31 21:12:45'),(971,'さんばし通りの路地','IMGP5071.jpg','曇っているので雲の薄い部分からかすかに夕日が漏れているだけです。',810,543,100,67,39,26,124.16115581989,24.340474125858,'2007-05-14 18:06:10','2007-05-31 15:00:13','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:14'),(972,'石垣島の賃貸事情','IMGP5073.jpg','東京ほどじゃないけど、最近はかなり高騰して、地元の人が困っています。',810,543,100,67,39,26,124.16025459766,24.339677446585,'2007-05-14 18:08:58','2007-05-31 15:08:40','2007-06-01 12:24:09',NULL,'2007-06-01 13:24:17'),(973,'さんばし通りの路地２','IMGP5074.jpg',NULL,810,543,100,67,39,26,124.15985763073,24.339271773618,'2007-05-14 18:10:02','2007-05-31 15:16:16','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:15'),(974,'さんばし通りのレンタサイクル','IMGP5080.jpg','使わないチャリをひさしの上にくくり付けていい目印に。',810,543,100,67,39,26,124.1593426466,24.338983402888,'2007-05-14 18:11:07','2007-05-31 15:17:53','2007-05-31 17:09:41',NULL,'2007-05-31 21:13:34'),(975,'石垣市公設市場の路地','IMGP5081.jpg',NULL,810,543,100,67,39,26,124.15823757648,24.339692109439,'2007-05-14 19:28:36','2007-05-14 19:28:38','2007-06-02 10:57:30',NULL,'2007-06-02 12:17:34'),(976,'ゆいロードの花屋。','IMGP5083.jpg','薄暗がりの中花の明かりが通りにもれています。',810,543,100,67,39,26,124.15774405003,24.340826031671,'2007-05-14 19:31:23','2007-05-31 15:28:44','2007-05-31 17:10:12',NULL,'2007-05-31 21:16:06'),(977,'ターミナルハウスのポスト','IMGP5087.jpg','ちなみにこれトースターですね。間違えて手紙を焼いてしまわないよう・・・',810,543,100,67,39,26,124.157320261,24.338558177055,'2007-05-15 18:13:23','2007-05-31 15:31:45','2007-05-31 17:10:25',NULL,'2007-05-31 21:16:24'),(978,'730交差点の電話ボックス','IMGP5088.jpg','柱にはゲストハウス、安宿のチラシがびっしりと。',810,543,100,67,39,26,124.15752410889,24.33804008388,'2007-05-15 18:15:29','2007-05-31 15:36:28','2007-05-31 17:10:52',NULL,'2007-05-31 21:16:31'),(979,'コンビニシーサー','IMGP5089.jpg','チェーン展開していないコンビニは全国各地にあるでしょうが、ここが多分日本一栄えてるね。たぶん。',810,543,100,67,39,26,124.15795862675,24.338406659459,'2007-05-15 18:17:44','2007-05-31 17:12:23','2007-05-31 17:11:22',NULL,'2007-05-31 21:16:37'),(980,'空の交差点２','IMGP5091.jpg','もう何が何やら。乗り換えとか大変そうだな。',810,543,100,67,39,26,124.16191756725,24.341324563233,'2007-05-15 19:03:02','2007-05-31 15:40:28','2007-05-31 17:13:35',NULL,'2007-05-31 21:17:21'),(981,'さよこのサーターアンダギー','IMGP5092.jpg','かなりの人気店。焼き上がり時間が決まっているので時間を見計らっていけば揚げたてが食べられます。',810,543,100,67,39,26,124.16130065918,24.340439912741,'2007-05-15 19:05:35','2007-05-31 15:42:03','2007-05-31 17:13:59',NULL,'2007-05-31 21:17:40'),(982,'石垣島レンタカー','IMGP5095.jpg','上にいるのはアンガマーですね。',810,543,100,66,39,25,124.15738999844,24.33838222112,'2007-05-15 19:10:54','2007-05-31 15:44:02','2007-05-31 17:14:16',NULL,'2007-05-31 21:17:52'),(983,'730','IMGP5096.jpg','沖縄が日本に返還され、車が右側通行から左側通行に変更された。一歩間違えば大惨事が起きるこの一大事業を安全に行うため変更される7/30をナナサンマルと称して大々的にキャンペーンを行った。',810,543,100,67,39,26,124.15741145611,24.338328456757,'2007-05-15 19:11:05','2007-05-31 15:51:09','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:17'),(984,'まぶやーのシーサー','IMGP5098.jpg','ここコンビニシーサーの姉妹店なので、コンビニシーサーにいるやつの姉か妹かな。あ、シーサーって雌雄あるんだよ。とかげに乗っかられちゃってるけどね。',810,543,100,67,39,26,124.15767967701,24.339765423683,'2007-05-16 11:49:20','2007-05-31 15:56:57','2007-05-31 17:15:34',NULL,'2007-05-31 21:18:16'),(985,'美崎町のアパート？','IMGP5100.jpg','再開発の波、ですか。',810,543,100,67,39,26,124.15480971336,24.338963852306,'2007-05-16 13:00:07','2007-06-01 18:03:24','2007-05-31 17:15:46',NULL,'2007-06-01 18:43:38'),(986,'美崎町の樹（の根）','IMGP5102.jpg','気持ち悪いくらいうねる根。',810,543,100,67,39,26,124.15364027023,24.338988290533,'2007-05-16 13:03:15','2007-05-31 16:00:08','2007-05-31 17:16:05',NULL,'2007-05-31 21:18:44'),(987,'美崎町のガジュマル','IMGP5103.jpg','ここは港が近いのでトラックとかが多いです。',810,543,100,67,39,26,124.15356516838,24.338934526428,'2007-05-16 13:05:56','2007-05-31 16:04:09','2007-06-03 00:02:55',NULL,'2007-06-03 18:07:18'),(988,'ゲンキクール','IMGP5105.jpg','沖縄のメーカーによる沖縄の飲料。乳酸菌ちっくなんだけど、ちょっと薄かった。',810,543,100,67,39,26,124.15733098984,24.33852396342,'2007-05-16 13:24:08','2007-05-16 13:24:10','2007-05-31 17:16:40',NULL,'2007-05-31 21:19:18'),(989,'露店？','IMGP5109.jpg','コンビニシーサー横の空きテナント前にて。',810,543,100,67,39,26,124.15779232979,24.338416434793,'2007-05-16 16:19:48','2007-05-31 16:02:56','2007-05-31 17:17:02',NULL,'2007-05-31 21:19:29'),(990,'離島ターミナルの寸胴シーサー','IMGP5110.jpg','これ、浦崎窯のシーサーかな？　ゴーグルが若干キュートですね。',810,543,100,66,39,25,124.15476679802,24.337453560747,'2007-05-16 16:43:32','2007-05-31 16:05:48','2007-05-31 17:17:18',NULL,'2007-05-31 21:19:52'),(991,'琉球真珠','IMGP5111.jpg','世界で初めて成功って・・・何だろう？養殖かな。夜になると指輪が黒く光りそうな予感。',810,543,100,67,39,26,124.15682137012,24.33821604029,'2007-05-16 16:46:44','2007-05-31 16:07:05','2007-05-31 17:17:35',NULL,'2007-05-31 21:20:00'),(992,'大川の契約駐車場','IMGP5112.jpg','値段が書いてあるのがここしかなかったので相場はわかりません。しかし、タイヤルロックって何だ？',810,543,100,67,39,26,124.15741145611,24.340513226552,'2007-05-16 17:46:57','2007-06-01 18:03:05','2007-05-31 17:17:57',NULL,'2007-06-01 18:43:40'),(993,'フリーマーケット','IMGP5115.jpg','「値段を決めてください／１円以上いくらでもOK」って、フリーマーケットってそういう意味だっけ？\n',364,543,44,67,17,26,124.15706813335,24.339716547525,'2007-05-16 17:57:02','2007-06-01 18:02:54','2007-05-31 17:18:02',NULL,'2007-06-01 18:43:40'),(994,'フリーマーケット２','IMGP5116.jpg','100円でいくつでも持ってっていいらしいけど・・・それでいいのか？',810,543,100,67,39,26,124.15706813335,24.339716547525,'2007-05-16 17:57:30','2007-06-01 18:02:39','2007-05-31 17:18:11',NULL,'2007-06-01 18:43:42'),(995,'REKIO GORES','IMGP5117.jpg','泡盛中毒で有名なTシャツ屋。ちなみにレキオというのは昔の文献に出てくる民族名で、琉球人と言われている。',810,543,100,67,39,26,124.1570520401,24.339359750998,'2007-05-16 17:59:09','2007-05-31 16:17:09','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:20'),(996,'止まれ','IMGP5122.jpg','止まらないと、落ちます。石垣港埠頭の突端。',810,543,100,67,39,26,124.14527714252,24.337873902601,'2007-05-17 04:56:20','2007-05-31 16:18:35','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:21'),(997,'立ち入り禁止','IMGP5127.jpg','出航前の暇な時間にうろうろ。不審者ですな。',810,543,100,67,39,26,124.14527714252,24.337873902601,'2007-05-17 04:58:34','2007-05-31 16:21:43','2007-05-31 17:18:55',NULL,'2007-05-31 21:21:46'),(998,'有村海運のフェリー','IMGP5128.jpg','昨年冬から那覇〜宮古〜石垣の旅客運航をしているの有村海運一社のみになってしまいました。',810,543,100,67,39,26,124.14895713329,24.337551314791,'2007-05-17 06:01:08','2007-05-31 16:25:19','2007-06-01 12:18:35',NULL,'2007-06-01 13:24:18'),(999,'那覇行きターミナルを見下ろす。','IMGP5133.jpg','結構フェリーって高いんですね。や、運賃がじゃなくて。',810,543,100,67,39,26,124.14905369282,24.337815250333,'2007-05-17 06:59:05','2007-06-01 18:02:23','2007-05-31 17:19:33',NULL,'2007-06-01 18:43:43'),(1000,'サザンゲートブリッジを撮る人','IMGP5138.jpg','これから石垣港を出て那覇まで１５時間ほどの航海です。',810,543,100,67,39,26,124.14911806583,24.337218950734,'2007-05-17 07:03:12','2007-06-01 18:02:02','2007-06-01 12:18:35',NULL,'2007-06-01 18:43:45'),(1001,'石垣港の空','IMGP5139.jpg',NULL,810,543,100,67,39,26,124.14941310883,24.337145635016,'2007-05-17 07:03:56','2007-06-01 18:01:28','2007-05-31 17:20:09',NULL,'2007-06-01 18:43:46'),(1002,'平良港停泊中。','IMGP5148.jpg','港を見下ろして談笑するカップル。',810,543,100,67,39,26,125.27764678001,24.809680889797,'2007-05-17 13:48:37','2007-06-01 18:00:47','2007-06-01 12:18:35',NULL,'2007-06-01 18:43:48'),(1003,'平良港停泊中。２','IMGP5149.jpg','船旅には飛行機では味わえない何かがあるよなぁ、と思ったり。',810,543,100,67,39,26,125.27764678001,24.809680889797,'2007-05-17 13:49:00','2007-05-31 16:37:06','2007-06-01 12:18:35',NULL,'2007-06-01 13:24:25'),(1004,'平良港停泊中。３','IMGP5150.jpg','一人街を眺める外人。足長いな。',810,543,100,67,39,26,125.27764678001,24.809680889797,'2007-05-17 13:49:04','2007-05-31 16:33:51','2007-06-01 12:18:35',NULL,'2007-06-01 13:24:26'),(1005,'フェリー航行中','IMGP5151.jpg','右側の黒っぽい帯はフェリーの煙です。',810,543,100,67,39,26,126.40869140625,25.562265014427,'2007-05-17 18:16:13','2007-06-01 18:00:35','2007-06-01 12:18:35',NULL,'2007-06-01 18:43:49'),(1006,'フェリー航行中２','IMGP5153.jpg','夕日が見れたら綺麗だろうなぁと期待してたのに、だめだった。',810,543,100,67,39,26,126.58172607422,25.631621577258,'2007-05-17 18:39:20','2007-06-01 18:00:23','2007-06-01 12:18:35',NULL,'2007-06-01 18:43:50'),(1007,'フェリーの救命ボート','IMGP5154.jpg',NULL,810,543,100,67,39,26,126.61605834961,25.646478462796,'2007-05-17 18:40:45','2007-05-31 16:40:25','2007-06-01 12:18:35',NULL,'2007-06-01 13:24:33'),(1008,'枯れたオキナワスズメウリ２','IMGP5047.jpg','これがみんなスイカだったらなぁ。',810,543,100,66,39,25,NULL,NULL,'2007-05-14 17:12:16','2007-05-31 10:46:41','2007-05-31 18:27:55',NULL,NULL),(1009,'外海の空','IMGP5155.jpg','あいにく曇りで、時折ぽつぽつ降っていました。',810,543,100,67,39,26,126.36611938477,25.549875683501,'2007-05-17 18:59:48','2007-06-01 18:00:02','2007-06-01 12:18:35',NULL,'2007-06-02 15:15:11'),(1010,'外海の空２','IMGP5156.jpg','うーん。かすかに夕焼けのようなものが見えるけど・・・',810,543,100,67,39,26,126.58309936523,25.63533597198,'2007-05-17 19:02:34','2007-06-01 17:59:54','2007-06-01 12:18:35',NULL,'2007-06-02 15:15:18'),(1011,'那覇新港のマカロニ','IMGP5157.jpg','ってどうブレればこんななるんだよ！',810,509,100,62,39,24,127.60465621948,26.190409680013,'2007-05-17 21:55:59','2007-06-01 17:59:42','2007-06-01 11:59:36',NULL,'2007-06-02 15:15:42'),(1012,'翼（？）よ、あれが那覇の灯だ','IMGP5163.jpg','遠くに明かりが見えてくると、やっぱり嬉しい。',810,543,100,67,39,26,127.61547088623,26.201807881787,'2007-05-17 21:57:25','2007-06-01 17:59:32','2007-06-01 12:00:09',NULL,'2007-06-02 15:16:02'),(1013,'那覇新港の明かり','IMGP5167.jpg','この明かりの数。さすが那覇は都会って感じです。',810,532,100,65,39,25,127.61770248413,26.203348093756,'2007-05-17 21:58:01','2007-06-01 17:59:21','2007-06-01 12:00:18