2','2007-06-01 12:02:30',NULL,'2007-06-02 15:17:45'),(1025,'大平三丁目の下り坂','IMGP5220.jpg','宿オアシスの近くの下り坂。',810,543,100,67,39,26,127.71557629108,26.245974994837,'2007-05-18 08:56:57','2007-05-31 19:08:26','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:23'),(1026,'パイプライン大平付近','IMGP5222.jpg','向こうに見えるのは那覇の街並です。',810,543,100,67,39,26,127.71369338036,26.247163396401,'2007-05-18 09:01:14','2007-06-01 17:57:09','2007-06-03 16:25:16',NULL,'2007-06-03 18:07:24'),(1027,'大平インター','IMGP5223.jpg','沖縄は車社会です。といってもこんなに車線があるのは本島の中南部くらいですけどね。',810,543,100,67,39,26,127.71355390549,26.247317358468,'2007-05-18 09:01:52','2007-06-01 17:56:52','2007-06-03 16:25:14',NULL,'2007-06-03 18:07:26'),(1028,'パイプラインの花','IMGP5224.jpg','ギザギザした葉と色がなんだか攻撃的。',810,543,100,67,39,26,127.71091997623,26.244420912914,'2007-05-18 09:06:52','2007-06-01 17:56:29','2007-06-01 12:05:10',NULL,'2007-06-02 15:20:27'),(1029,'パイプライン高架脇の階段','IMGP5225.jpg',NULL,810,543,100,67,39,26,127.71017432213,26.242703219242,'2007-05-18 09:10:41','2007-06-01 17:56:18','2007-06-01 12:05:26',NULL,'2007-06-02 15:20:33'),(1030,'パイプライン脇プリントショップ','IMGP5226.jpg','あの、バスタオレってなんですか？',810,543,100,67,39,26,127.70985245705,26.24192856477,'2007-05-18 09:11:59','2007-05-31 22:42:49','2007-06-01 12:05:53',NULL,'2007-06-02 15:21:10'),(1031,'古島駅の歩道橋','IMGP5229.jpg','看板に子猫を起用する事にどういう意図があるんでしょうか？まさか施工者の飼い猫か?!',810,543,100,67,39,26,127.70406424999,26.232266601965,'2007-05-18 09:27:18','2007-06-01 17:55:09','2007-06-01 12:07:18',NULL,'2007-06-02 15:21:55'),(1032,'古島駅','IMGP5230.jpg','沖縄で駅と言えばゆいレールの事。空港と首里城を結ぶというあたりが観光客狙い見え見えなんですけど・・・',810,543,100,67,39,26,127.702460289,26.22980767748,'2007-05-18 09:29:52','2007-06-01 17:55:22','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:27'),(1033,'新都心公園への橋','IMGP5231.jpg','それにしてもめちゃめちゃ広い歩道です。今もこれからも沖縄にこんなのが必要とは思えませんけど・・・',810,543,100,67,39,26,127.69649505615,26.225625942864,'2007-05-18 10:13:51','2007-05-31 22:50:05','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:29'),(1034,'沖縄県立博物館・美術館','IMGP5232.jpg','建物の形がとても気になる〜入ってみたいけど貧乏旅行者には無理っす！',810,543,100,67,39,26,127.69483745098,26.226992602248,'2007-05-18 11:22:57','2007-05-31 22:50:56','2007-06-01 12:10:07',NULL,'2007-06-02 15:23:08'),(1035,'沖縄県立博物館・美術館２','IMGP5233.jpg','まるでアフリカとかそっちの方の遺跡みたいな色＆形でないか？',810,543,100,67,39,26,127.69491791725,26.227136966738,'2007-05-18 11:23:24','2007-05-31 22:54:15','2007-06-01 12:10:50',NULL,'2007-06-02 15:23:14'),(1036,'アートなアパート？','IMGP5234.jpg','アパートじゃなくて一戸建てか。それにしてもすごいな。',365,543,44,67,17,26,127.69254684448,26.233840093872,'2007-05-18 11:59:44','2007-05-31 22:54:23','2007-06-01 12:11:05',NULL,'2007-06-02 15:25:49'),(1037,'キャンプ・ズケラン','IMGP5235.jpg','手前が米軍施設。向こうには海と北谷・美浜などが見えます。',810,543,100,67,39,26,127.76129186153,26.28718666259,'2007-05-18 14:08:16','2007-05-31 23:00:00','2007-06-04 11:19:31',NULL,'2007-06-04 11:47:25'),(1038,'潜入口？','IMGP5236.jpg','まさかこんなところから米軍基地に入れるのか？これは確かめてみねば・・・',810,543,100,67,39,26,127.76075541973,26.286979847052,'2007-05-18 14:09:13','2007-05-31 23:00:08','2007-06-04 11:19:31',NULL,'2007-06-04 11:47:26'),(1039,'キャンプズケランの裏口','IMGP5238.jpg','空いておらず、フェンスの上は鉄条網。まあ当然の警備体制ですな。',810,543,100,67,39,26,127.75987565517,26.286724934369,'2007-05-18 14:10:42','2007-06-01 17:54:49','2007-06-04 11:19:31',NULL,'2007-06-04 11:47:28'),(1040,'自然の力って・・','IMGP5239.jpg','これには感心するばかりだね。',810,543,100,67,39,26,127.76022434235,26.286811508551,'2007-05-18 14:11:12','2007-06-01 17:54:36','2007-06-01 12:13:14',NULL,'2007-06-02 15:28:18'),(1041,'壁から生えてる樹','IMGP5240.jpg','しかしこれができた過程を考えると、まさか工事で樹を生き埋めにしたんじゃ・・・？',810,543,100,67,39,26,127.76022434235,26.286811508551,'2007-05-18 14:11:37','2007-05-31 23:03:23','2007-06-01 12:13:26',NULL,'2007-06-02 15:28:22'),(1042,'喜友名遺跡群','IMGP5242.jpg','へぇ、３０００〜５００年前の遺跡なんだ。面白そう。・・・と思ったらほとんど米軍キャンプの敷地内じゃん！恐るべしアメリカー。',803,543,99,67,38,26,127.76061058044,26.286893272996,'2007-05-18 14:14:06','2007-06-01 17:54:16','2007-06-04 11:19:31',NULL,'2007-06-04 11:47:29'),(1043,'米軍キャンプ内の鳥。','IMGP5244.jpg','当然鳥なら簡単に基地に入れます。',810,542,100,66,39,25,127.76029407978,26.286989466387,'2007-05-18 14:15:43','2007-06-01 17:45:00','2007-06-04 11:19:31',NULL,'2007-06-04 11:47:30'),(1044,'普天間でいご通り','IMGP5248.jpg','車通りの激しい幹線道路。それもそのはず。宜野湾市にはキャンプズケラン＆フォスターと普天間飛行場という広大な米軍施設があり、この道はその間を縫って走っているんですね。つまり他に通る道がないって事。',810,543,100,67,39,26,127.75925338268,26.286527737382,'2007-05-18 14:18:08','2007-06-01 17:44:49','2007-06-04 11:19:31',NULL,'2007-06-04 11:47:32'),(1045,'キャンプズケランそばの内張所','IMGP5249.jpg','あんなにでかでかと「移転」とか書いちゃって。基地への当てつけか？',810,542,100,66,39,25,127.7572953701,26.285777423828,'2007-05-18 14:18:41','2007-06-01 17:44:37','2007-06-01 12:14:54',NULL,'2007-06-02 15:30:06'),(1046,'米軍施設内の鉄塔','IMGP5250.jpg','軍施設だからか、なんとなくものものしい外観。思い込みかなぁ。',365,543,44,67,17,26,127.75752604008,26.286301681886,'2007-05-18 14:21:08','2007-06-01 17:44:21','2007-06-04 11:19:31',NULL,'2007-06-04 11:47:33'),(1047,'変電所？','IMGP5251.jpg','ところで米軍施設の電気代って誰が払ってるんだろう。ま、きっと日本の「思いやり」だよねぇ？',810,543,100,67,39,26,127.75591135025,26.285863998717,'2007-05-18 14:23:38','2007-06-01 17:44:08','2007-06-04 11:19:31',NULL,'2007-06-04 11:47:34'),(1048,'動物合唱団','IMGP5252.jpg','玄関先に置いて威厳を出すための置物群（売り物）。でもみんな一生懸命口あけて合唱コンクールみたいだよ。',810,543,100,67,39,26,127.75487601757,26.284820286033,'2007-05-18 14:27:26','2007-06-01 17:43:24','2007-06-01 12:16:03',NULL,'2007-06-02 15:30:44'),(1049,'アメ横マーケット伊佐店','IMGP5253.jpg','アメヤ横町？いえいえアメリカ基地横マーケットの略ですよ。',810,543,100,67,39,26,127.75481164455,26.284767378688,'2007-05-18 14:27:55','2007-06-01 17:43:08','2007-06-01 12:16:12',NULL,'2007-06-02 15:30:51'),(1050,'左、アメリカ。右、日本。','IMGP5254.jpg','やっぱアメリカの電化製品は電圧とか周波数とか違うのか？',810,509,100,62,39,24,127.75561630726,26.28582071128,'2007-05-18 14:32:27','2007-05-31 23:24:11','2007-06-01 12:16:24',NULL,'2007-06-02 15:31:08'),(1051,'いとむクリニック','IMGP5256.jpg','しかしね。壁一面に世界一西原高校マーチングバンドって。息子が所属してるのか？娘でもいいけど。てゆーか世界一って自称？・・・親バカ？別にいいけど。',810,509,100,62,39,24,127.75505840778,26.285051154163,'2007-05-18 14:33:55','2007-06-01 17:42:56','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:35'),(1052,'５８宜野湾の空','IMGP5257.jpg','平和な空。爆音が響く事さえなければ。',810,543,100,67,39,26,127.754634618