:33:38','2007-06-02 10:48:21',NULL,'2007-06-02 16:06:35'),(1111,'那覇市牧志の夜明け','IMGP5370.jpg','あと数分で曙が見えるはずです。',810,543,100,67,39,26,127.68961787224,26.215823059685,'2007-05-20 05:39:50','2007-06-01 23:19:24','2007-06-02 10:48:52',NULL,'2007-06-02 16:06:58'),(1112,'てんぶす那覇裏の空','IMGP5373.jpg','東雲の時。一筋の雲が輝いていました。',810,543,100,67,39,26,127.6895481348,26.215981875862,'2007-05-20 05:44:49','2007-06-01 23:22:54','2007-06-02 10:49:06',NULL,'2007-06-02 16:07:03'),(1113,'てんぶす那覇裏の空２','IMGP5375.jpg','今、あのパイロットの目には何が写っているのかな・・・',810,543,100,67,39,26,127.6895481348,26.215981875862,'2007-05-20 05:46:45','2007-06-01 23:27:42','2007-06-02 10:49:24',NULL,'2007-06-02 16:07:05'),(1114,'那覇市牧志の夜明け３','IMGP5379.jpg','まもなく日の出です・・・！！',810,543,100,67,39,26,127.68963396549,26.215813434455,'2007-05-20 05:50:30','2007-05-20 05:50:32','2007-06-02 10:49:33',NULL,'2007-06-02 16:07:11'),(1115,'那覇市牧志の日の出','IMGP5380.jpg',NULL,810,543,100,67,39,26,127.68963396549,26.215813434455,'2007-05-20 05:52:07','2007-05-20 05:52:08','2007-06-02 10:49:46',NULL,'2007-06-02 16:07:12'),(1116,'那覇市牧志の日の出２','IMGP5382.jpg','ちょこっとだけだけど、見える？',810,542,100,66,39,25,127.68963396549,26.215813434455,'2007-05-20 05:52:26','2007-06-01 23:30:04','2007-06-02 10:49:59',NULL,'2007-06-02 16:07:13'),(1117,'希望ヶ丘公園のトイレ','IMGP5384.jpg',NULL,810,543,100,67,39,26,127.68965542316,26.215875998434,'2007-05-20 05:56:10','2007-05-20 05:56:12','2007-06-02 10:50:12',NULL,'2007-06-02 16:07:22'),(1118,'国際通りの朝。','IMGP5385.jpg','左のビルにも空が写っています。',810,543,100,67,39,26,127.68843770027,26.216429447559,'2007-05-20 06:28:16','2007-06-01 23:31:52','2007-06-02 10:50:40',NULL,'2007-06-02 16:07:46'),(1119,'那覇市牧志の石敢當','IMGP5387.jpg','石碑型（中）何気に自販機の色と合ってるね。',365,543,44,67,17,26,127.68893122673,26.216429447559,'2007-05-20 06:33:50','2007-06-02 00:22:10','2007-06-02 10:51:23',NULL,'2007-06-02 16:08:14'),(1120,'平和通り','IMGP5388.jpg','土産物屋も多いけど、地元の商店街という感じの味のあるアーケード。沖縄民謡のBGMが流れ、前をのんびり歩くおじさんがそれに合わせて口ずさんでいたりする平和な通り。',810,543,100,67,39,26,127.6888024807,26.216386134244,'2007-05-20 06:34:14','2007-05-20 06:34:16','2007-06-02 10:51:37',NULL,'2007-06-02 16:08:22'),(1121,'平和通りにて','IMGP5389.jpg','かわいいお店の看板（？）何屋だろ？',810,543,100,67,39,26,127.68885612488,26.216304320161,'2007-05-20 06:34:44','2007-05-20 06:34:46','2007-06-02 10:51:46',NULL,'2007-06-02 16:08:37'),(1122,'平和通りにて２','IMGP5390.jpg','OneMoreMiracle.切り倒されてもまた芽が出るように・・・ですか。',810,542,100,66,39,25,127.68863618374,26.215774933527,'2007-05-20 06:37:24','2007-06-02 10:52:13','2007-06-02 10:51:56',NULL,'2007-06-02 16:08:53'),(1123,'平和通りにて３','IMGP5392.jpg','日清沖縄そばって書いてあるけど・・・俺にはわたがしの入った袋に見える。でも実際には謎。',810,543,100,67,39,26,127.68863618374,26.215404361451,'2007-05-20 06:38:26','2007-05-20 06:38:28','2007-06-02 10:52:29',NULL,'2007-06-02 16:09:03'),(1124,'平和通りにて４','IMGP5393.jpg','メーターも青く塗っておしゃれに♪',810,543,100,67,39,26,127.68871665001,26.21535623512,'2007-05-20 06:38:54','2007-05-20 06:38:56','2007-06-02 10:52:36',NULL,'2007-06-02 16:09:11'),(1125,'平和通りの路地','IMGP5394.jpg','店のひしめき合うアーケードの裏には緑が。',810,543,100,67,39,26,127.68872737885,26.215317734042,'2007-05-20 06:39:27','2007-05-20 06:39:28','2007-06-02 10:59:55',NULL,'2007-06-02 16:09:18'),(1126,'花笠食堂','IMGP5395.jpg','たぶん平和通りで一番目立つお店。定食に付く品数も多くおすすめ。入り口は裏にあります。',810,543,100,67,39,26,127.68879711628,26.214956785811,'2007-05-20 06:40:41','2007-06-02 00:23:52','2007-06-02 10:59:06',NULL,'2007-06-02 16:09:29'),(1127,'那覇商人塾','IMGP5396.jpg','沖縄の人はあまり商売がうまくない（というか商売根性がない）と聞いたことがありますけど、最近はどうなんでしょうね。気になる。シーサーのポーズも気になる。',810,543,100,67,39,26,127.68885076046,26.214547709795,'2007-05-20 06:41:25','2007-06-02 00:26:25','2007-06-02 10:59:24',NULL,'2007-06-02 16:09:41'),(1128,'平和シューズ','IMGP5397.jpg','この靴を履くと一歩歩くごとに一歩ずつ平和に近づく魔法の靴。・・・いや、あったらいいなと思って。',810,543,100,67,39,26,127.6892209053,26.214186759175,'2007-05-20 06:42:20','2007-06-02 00:29:36','2007-06-02 10:59:36',NULL,'2007-06-02 16:10:12'),(1129,'平和通りの路地２','IMGP5398.jpg',NULL,365,543,44,67,17,26,127.68890976906,26.214600649125,'2007-05-20 06:42:36','2007-05-20 07:12:46','2007-06-02 10:59:49',NULL,'2007-06-02 16:10:31'),(1130,'平和通りの石敢當','IMGP5400.jpg','初登場！横型石敢當！なんか見慣れないせいか不思議。一応表札型（小）としておきましょうか。',810,543,100,67,39,26,127.68921017647,26.214157883078,'2007-05-20 06:43:25','2007-06-02 00:32:54','2007-06-02 11:00:07',NULL,'2007-06-02 16:11:24'),(1131,'平和通りにて５','IMGP5405.jpg','写真屋チラシがべたべたに張りまくられた電柱。',365,543,44,67,17,26,127.68935501575,26.214061629366,'2007-05-20 06:44:36','2007-06-02 00:33:09','2007-06-02 11:00:28',NULL,'2007-06-02 16:11:11'),(1132,'平和通りの石敢當２','IMGP5407.jpg','石碑型（中）なんか頭でっかちで愛嬌がある。（と思うのは俺だけかも）',810,543,100,67,39,26,127.68968760967,26.21379211855,'2007-05-20 06:47:12','2007-06-02 00:34:43','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:58'),(1133,'シーサーのいる電話ボックス','IMGP5410.jpg','これで電話中も安心ですね。右に見えているのは浮島通り（後楽園通り）です。',365,543,44,67,17,26,127.68937110901,26.213339723992,'2007-05-20 06:49:00','2007-06-02 00:36:16','2007-06-03 11:37:36',NULL,'2007-06-03 18:07:59'),(1134,'サンライズなは商店街の青猫','IMGP5412.jpg','もしかしてこれ、猫じゃない？のか？',810,543,100,67,39,26,127.68942475319,26.21317127876,'2007-05-20 06:49:55','2007-06-02 00:37:13','2007-06-02 11:01:08',NULL,'2007-06-02 16:11:53'),(1135,'サンライズなは商店街','IMGP5415.jpg','フェミニン（って名前の店なのか？）さん、ひっくり返ってますよ。',810,543,100,67,39,26,127.6893389225,26.212964331427,'2007-05-20 06:50:37','2007-06-02 00:43:16','2007-06-02 11:01:15',NULL,'2007-06-02 16:12:09'),(1136,'サンライズなは商店街の石敢當','IMGP5416.jpg','赤いブロックに張り付けられ、しかも上には植木鉢。ナイスアレンジというべきか。',810,543,100,67,39,26,127.68921017647,26.21296914416,'2007-05-20 06:51:04','2007-06-02 00:44:54','2007-06-02 11:02:08',NULL,'2007-06-02 16:12:14'),(1137,'ドミトリー沖縄の玄関。','IMGP5417.jpg','らせん階段をくだって外に出ます。',810,543,100,67,39,26,127.68959105015,26.212637065126,'2007-05-20 16:26:43','2007-06-02 00:45:40','2007-06-02 11:06:51',NULL,'2007-06-02 16:12:25'),(1138,'トランジットモールにて１','IMGP5418.jpg','国際通りは通行止めになりチョークをもらったこどもたちは思い思いにお絵描き。',810,543,100,67,39,26,127.68881857395,26.216424634969,'2007-05-20 16:37:14','2007-06-02 00:46:02','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:01'),(1139,'トランジットモールにて２','IMGP5419.jpg','座り込んで熱心に何かを描く少女。',810,543,100,67,39,26,127.68857181072,26.216424634969,'2007-05-20 16:37:28','2007-06-02 00:47:44','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:02'),(1140,'トランジットモールにて３','IMGP5420.jpg','なに描いてるの〜？',810,543,100,67,39,26,127.6884752512,26.216386134244,'2007-05-20 16:37:34','2007-06-02 00:48:42','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:03'),(1141,'トランジットモールにて４','IMGP5421.jpg','おかあさんたちもお絵描きに夢中。',810,509,100,62,39,24,127.68830358982,26.216280257185,'2007-05-20 16:37:44','2007-06-02 00:49:43','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:05'),(1142,'トランジットモールにて５','IMGP5422.jpg','地上の星たち。',810,543,100,67,39,26,127.68838942051,26.216371696469,'2007-05-20 16:38:02','2007-06-02 00:56:33','2007-06-02 11:06:51',NULL,'2007-06-02 16:13:12'),(1143,'トランジットモールにて６','IMGP5423.jpg','「何描いてるの？」「・・・おかあさんと、おとうさん」',810,543,100,67,39,26,127.6884752512,26.216386134244,'2007-05-20 16:38:15','2007-06-02 00:56:26','2007-06-02 11:06:51',NULL,'2007-06-02 16:13:01'),(1144,'トランジットモールにて７','IMGP5424.jpg','一日だけタイルの色も変わります。なかなかの配色センスです。',810,543,100,67,39,26,127.68816411495,26.216236943814,'2007-05-20 16:39:31','2007-06-02 00:56:19','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:06'),(1145,'トランジットモールにて８','IMGP5425.jpg','みんなでお絵描き。',810,543,100,67,39,26,127.68816411495,26.216236943814,'2007-05-20 16:42:06','2007-06-02 09:18:10','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:07'),(1146,'にが旨。','IMGP5426.jpg','ゴーヤーDRY。そういえば父親にプレゼントしたら「普通のがいいなぁ」と言われた、ほろ苦い想い出が。',810,543,100,67,39,26,127.68542289734,26.215332171948,'2007-05-20 16:45:01','2007-06-02 00:56:09','2007-06-02 11:06:51',NULL,'2007-06-02 16:14:30'),(1147,'トランジットモールにて９','IMGP5427.jpg','ナスカの地上絵？',810,543,100,67,39,26,127.68816411495,26.216236943814,'2007-05-20 16:45:19','2007-06-02 09:17:57','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:09'),(1148,'KOKUEIKAN PROJECT','IMGP5428.jpg','国映館跡地に建設予定の商業施設がコンペティションによって決定される事になりました。賞をとったいくつかが紹介されてたけど、おもしろそうな案ばかりだった。',810,543,100,67,39,26,127.68551409245,26.215336984583,'2007-05-20 16:47:08','2007-06-02 09:17:49','2007-06-02 11:07:27',NULL,'2007-06-02 16:21:36'),(1149,'路上ライブ','IMGP5429.jpg','本当は６人組だったかな。横浜から来た・・・名前忘れてすみません。ノリがよくて楽しかったです。',810,543,100,67,39,26,127.68551409245,26.215336984583,'2007-05-20 16:54:06','2007-06-02 09:17:41','2007-06-04 00:24:14',NULL,'2007-06-04 00:39:09'),(1150,'国際通りの石敢當１','IMGP5430.jpg','表札型（中）。どんな色と合わせても不思議と違和感のない石敢當。沖縄だからかな。',810,543,100,67,39,26,127.68425881863,26.214903846643,'2007-05-20 17:10:34','2007-06-02 01:07:11','2007-06-02 11:08:11',NULL,'2007-06-02 16:21:16'),(1151,'国際通りの青猫','IMGP5431.jpg','口の端がつり上がってかなり得意げ。いったい何だって言うんだ。',810,543,100,67,39,26,127.68414616585,26.214874970723,'2007-05-20 17:10:51','2007-06-02 01:08:12','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:10'),(1152,'シーサーと石敢當','IMGP5432.jpg','約3000年前のエジプトと約550年前の中国を合体させちゃうなんて・・・さすがチャンプルー文化。',810,543,100,67,39,26,127.68290698528,26.214417767701,'2007-05-20 17:12:07','2007-06-02 01:09:59','2007-06-02 11:08:49',NULL,'2007-06-02 16:20:21'),(1153,'国際通りビバ？','IMGP5433.jpg','ええ、無論ビバです。ビバってどういう意味だっけ？',810,543,100,67,39,26,127.68290698528,26.214417767701,'2007-05-20 17:12:22','2007-06-02 01:10:33','2007-06-02 11:09:03',NULL,'2007-06-02 16:20:19'),(1154,'守礼堂とどらえもん','IMGP5435.jpg','壁に飾られたたくさんの壷。ところで２Fのお店・・・あの青い猫型ロボットと宮古そばとどういう関係なのか説明してもらいたい。',810,543,100,67,39,26,127.6825261116,26.214489957771,'2007-05-20 17:15:23','2007-06-02 01:14:15','2007-06-02 11:09:24',NULL,'2007-06-02 16:20:00'),(1155,'OKINAWA文化屋菓子店','IMGP5436.jpg','国際通りを歩いたら気付かずには通り過ぎられないでかい看板、各種キューピーさん揃ってますよ〜',810,543,100,67,39,26,127.68194139004,26.214278200105,'2007-05-20 17:20:00','2007-05-20 17:20:02','2007-06-02 22:55:15',NULL,'2007-06-02 23:13:06'),(1156,'パインキューピー','IMGP5437.jpg','なんか服が民族衣装っぽく見えるし、モヒカンも相まってかなりぶっ飛んだキューピーさんです。',810,543,100,67,39,26,127.68204331398,26.214302263496,'2007-05-20 17:20:35','2007-06-02 09:22:08','2007-06-02 22:54:57',NULL,'2007-06-02 23:13:08'),(1157,'パレットくもじから','IMGP5439.jpg','これは非常階段からですね。',810,543,100,67,39,26,127.67937719822,26.213541857948,'2007-05-20 17:35:17','2007-06-02 09:23:26','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:12'),(1158,'パレットくもじから２','IMGP5441.jpg','国際通り入り口のスクランブル交差点。',810,543,100,67,39,26,127.67983853817,26.213753616954,'2007-05-20 17:36:26','2007-06-02 09:24:38','2007-06-03 11:37:36',NULL,'2007-06-03 18:08:13'),(1159,'パレットくもじ屋上','IMGP5442.jpg','屋上の植物園から店内をのぞいています。',810,543,100,67,39,26,127.67928063869,26.213715115345,'2007-05-20 17:38:35','2007-06-02 09:26:07','2007-06-02 11:10:45',NULL,'2007-06-02 16:19:02'),(1160,'パレットくもじ屋上２','IMGP5443.jpg','植物園の自販機は当然緑。景観に配慮されています。',810,543,100,67,39,26,127.67902314663,26.213801743947,'2007-05-20 17:38:52','2007-06-02 09:29:22','2007-06-02 11:10:56',NULL,'2007-06-02 16:19:07'),(1161,'パレットくもじ屋上のゴミ箱','IMGP5444.jpg','パステルカラーの配色と穴の形を変えてみるというのは一見楽しげではあるけれど、安直で深みのないセンスですな。ま、ゴミ箱なんてどーでもええやん！',810,543,100,67,39,26,127.67918944359,26.213946124807,'2007-05-20 17:39:39','2007-06-02 09:28:57','2007-06-02 11:11:17',NULL,'2007-06-02 16:19:17'),(1162,'パレットスカイガーデン','IMGP5445.jpg','花とハーブと熱帯樹林の屋上庭園だそうだ。でも多種多様なイベントとか言って高校生とか若者のデートスポットにしかなってないように見えるけど？',810,543,100,67,39,26,127.67926454544,26.213979813649,'2007-05-20 17:39:45','2007-06-02 09:32:21','2007-06-02 11:11:24',NULL,'2007-06-02 16:19:28'),(1163,'ゴーヤーキューピー','IMGP5446.jpg','見れば見るほどゴーヤーなのか自信がなくなってまいりましたが・・・。キューピーさんの手つきってよく見ると怪しいな。何しようとしてるんだ？',810,543,100,67,39,26,127.68194139004,26.214278200105,'2007-05-20 17:56:15','2007-05-20 17:56:18','2007-06-02 22:55:05',NULL,'2007-06-02 23:13:09'),(1164,'レキオタコスのシーサー','IMGP5447.jpg','テーブルにちょこっと置いてあるかわいいシーサー。しかし観光地化に伴ってシーサーもすっかり変わっちゃって。',810,543,100,67,39,26,127.68327176571,26.214547709795,'2007-05-20 18:10:43','2007-06-02 09:35:30','2007-06-02 11:11:46',NULL,'2007-06-02 16:22:12'),(1165,'レキオタコスのシーサー２','IMGP5448.jpg','となりに土産物屋「海人」があります。気に入った人は買ってね♪・・・ということですね。',810,543,100,67,39,26,127.68327176571,26.214547709795,'2007-05-20 18:11:17','2007-06-02 09:38:29','2007-06-02 11:11:49',NULL,'2007-06-02 16:22:14'),(1166,'jef','IMGP5449.jpg','ゴーヤーバーガー、ソーキバーガーなど販売する、まさに沖縄という感じのバーガーショップ。',810,543,100,67,39,26,127.68907606602,26.212675567092,'2007-05-