3352389,'2007-05-30 12:24:46','2007-06-03 16:33:11','2007-06-03 16:33:42',NULL,'2007-06-04 09:42:52'),(1249,'来間大橋より４','IMGP1875.jpg','こうして見ると宮古島ってほんとに平べったい島だな。',805,543,100,67,38,26,125.2606844902,24.723454282387,'2007-04-20 13:23:35','2007-06-04 00:35:07','2007-06-04 00:54:31',NULL,'2007-06-04 09:24:28'),(1250,'美栄橋駅付近の石敢當','IMGP5609.jpg','石碑の色とか、字が丸く盛り上がってるとことか・・・なんか、変。いちおう石敢當ってご神体なんだけどな。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:01:46','2007-06-04 00:57:41','2007-06-04 11:14:50',NULL,NULL),(1251,'ココニチリオステルナ','IMGP5610.jpg','沖縄の呪文・・・ではありません。ここにゴミを捨てるなという事ですな。沖縄ではゴミではなくチリ、と。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:02:08','2007-06-04 00:59:10','2007-06-04 11:15:22',NULL,NULL),(1252,'ゆいレール','IMGP5613.jpg','まるっこくてのどかなフォルムさね。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:08:05','2007-06-04 01:03:12','2007-06-04 11:15:41',NULL,NULL),(1253,'下から見るゆいレール','IMGP5616.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:08:07','2007-06-04 01:03:45','2007-06-04 11:15:51',NULL,NULL),(1254,'ゆいレールの切符','IMGP5618.jpg','偽造防止の模様も沖縄の織物からとっているようです。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:10:33','2007-06-04 01:04:57','2007-06-04 11:16:56',NULL,NULL),(1255,'ゆいレール・美栄橋駅より','IMGP5621.jpg','これに乗って首里方面に向かいます。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:13:57','2007-06-04 01:05:49','2007-06-04 11:17:17',NULL,NULL),(1256,'ゆいレール・美栄橋駅より２','IMGP5625.jpg','何度乗ってもわくわくするね♪',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:14:11','2007-05-30 14:14:14','2007-06-04 11:17:28',NULL,NULL),(1257,'車掌席','IMGP5626.jpg','といってもワンマン運転なので車掌はいませんけど。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:20:50','2007-06-04 01:09:25','2007-06-04 11:17:32',NULL,NULL),(1258,'ゆいレール・おもろまち駅','IMGP5627.jpg','を、出たところ。なお駅横のDFSはDuty Free Shop=免税店です。女の子に人気のブランドショップ♪',810,542,100,66,39,25,NULL,NULL,'2007-05-30 14:20:57','2007-06-04 01:11:09','2007-06-04 11:17:48',NULL,NULL),(1259,'ゆいレール３','IMGP5628.jpg','ゆいレールは２両編成。現状の利用客数ではちょうどいい感じでしょうか。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:21:35','2007-06-04 01:12:16','2007-06-04 11:18:02',NULL,NULL),(1260,'ゆいレール車内','IMGP5630.jpg','窓が大きく、景色を楽しめる設計。また椅子の背もたれが低く切れ込みが入っているので空間が広い印象を受ける。黄色い壁が目を引くが窓が大きいのでうるさくない。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:28:57','2007-05-30 14:28:58','2007-06-04 11:18:06',NULL,NULL),(1261,'ドアの開閉ボタン。','IMGP5632.jpg','上に閉ボタン、下に開ボタン。とっさにどちらも押せるようにできています。当然ホームが左の時用に左側にも同じボタンがあります。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:46:13','2007-05-30 14:46:14','2007-06-04 11:18:21',NULL,NULL),(1262,'ゆいレールのスイッチたち。','IMGP5633.jpg','営業運転中はいじらないようです。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:47:23','2007-06-04 08:55:18','2007-06-04 11:18:26',NULL,NULL),(1263,'ゆいレールのスイッチたち２','IMGP5634.jpg','それにしてもわからないものがいっぱいあるな・・・',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:47:38','2007-06-04 08:55:11','2007-06-04 11:18:29',NULL,NULL),(1264,'ゆいレールから見える海。','IMGP5636.jpg','手前に見えるのは航空自衛隊那覇基地です。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 14:59:04','2007-06-04 09:04:56','2007-06-04 11:19:32',NULL,NULL),(1265,'ゆいレールの電圧計','IMGP5637.jpg','どうやら、100Vと24Vの切り替えが可能らしい。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:01:20','2007-06-04 09:06:01','2007-06-04 11:19:39',NULL,NULL),(1266,'ゆいレールの行き止まり','IMGP5638.jpg','終点那覇空港にて。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:04:23','2007-06-04 09:06:45','2007-06-04 11:19:51',NULL,NULL),(1267,'離陸するJAL機','IMGP5640.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:04:53','2007-06-04 09:09:12','2007-06-04 11:20:10',NULL,NULL),(1268,'旋回するJAL機','IMGP5643.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:04:58','2007-06-04 09:13:52','2007-06-04 11:20:19',NULL,NULL),(1269,'離陸','IMGP5644.jpg',NULL,810,542,100,66,39,25,NULL,NULL,'2007-05-30 15:05:28','2007-06-04 09:13:59','2007-06-04 11:20:29',NULL,NULL),(1270,'自動販売機','IMGP5645.jpg','とわざわざ書かないと気付かないのだろうか？下には二千円札使えますの表示。なかなか珍しい自販機。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:06:44','2007-06-04 09:13:44','2007-06-04 11:21:05',NULL,NULL),(1271,'那覇空港','IMGP5646.jpg','沖縄の玄関口です。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:08:28','2007-06-04 09:26:32','2007-06-04 11:26:22',NULL,NULL),(1272,'ゆいレール・那覇空港駅より','IMGP5647.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:10:15','2007-06-04 09:45:59','2007-06-04 11:21:39',NULL,NULL),(1273,'ゆいレール・那覇空港駅より２','IMGP5650.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:10:30','2007-06-04 09:47:03','2007-06-04 11:21:54',NULL,NULL),(1274,'離陸するANA機','IMGP5651.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:10:41','2007-06-04 09:48:33','2007-06-04 11:26:05',NULL,NULL),(1275,'ゆいレール・那覇空港駅','IMGP5653.jpg','日本最西端の駅。メンソーレと言うのは挨拶ではなくいらっしゃいという意味なので観光客の人は使わないように。なお宮古はンミャーチ、石垣はオーリトーリ、その離島はオーリタボーリ。',810,542,100,66,39,25,NULL,NULL,'2007-05-30 15:12:03','2007-06-04 09:53:41','2007-06-04 11:32:45',NULL,NULL),(1276,'那覇空港のシーサー','IMGP5654.jpg','どこかで見たような気もするシーサー。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:19:14','2007-06-04 09:55:09','2007-06-04 11:26:29',NULL,NULL),(1277,'那覇空港チェックインロビー','IMGP5657.jpg','左側はJALグループ。あのステンドグラスまとまりがなさ過ぎてすごい。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:22:42','2007-06-03 09:32:27','2007-06-04 11:26:34',NULL,NULL),(1278,'那覇空港チェックインロビー２','IMGP5658.jpg','右側はANAグループ。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:23:10','2007-06-03 09:32:33','2007-06-04 11:26:40',NULL,NULL),(1279,'那覇空港ターミナル4F','IMGP5660.jpg','飛行機の発着がよく見えます。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:24:19','2007-06-04 10:02:15','2007-06-04 11:26:40',NULL,NULL),(1280,'ポケモンジェット','IMGP5662.jpg','・・・の中でもピカチュウジャンボというデザインらしい。せっかくなら翼も黄色にすればよかったのに。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:28:28','2007-05-30 15:28:30','2007-06-04 11:24:06',NULL,NULL),(1281,'離陸するJTA機','IMGP5667.jpg','JTAはJapan Trance-ocean Airの略。JALグループの沖縄航路を運航しています。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:30:11','2007-06-04 10:09:01','2007-06-04 11:24:23',NULL,NULL),(1282,'旋回するJTA機','IMGP5668.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:30:18','2007-06-04 10:34:48','2007-06-04 11:24:31',NULL,NULL),(1283,'Air transse機','IMGP5669.jpg','北海道内、沖縄県内で18人乗りのビーチクラフト1900D（日本では唯一）を飛ばす航空会社。地方活性化・観光ビジネスを看板に掲げている。低高度を飛ぶ窓の外は絶景らしい。',810,542,100,66,39,25,NULL,NULL,'2007-05-30 15:30:47','2007-06-04 10:14:25','2007-06-04 11:24:41',NULL,NULL),(1284,'那覇空港吹き抜け','IMGP5671.jpg','２F出発ロビー、３Fチェックインロビー、４F展望＆レストランとなっております。',365,543,44,67,17,26,NULL,NULL,'2007-05-30 15:32:53','2007-06-04 10:25:08','2007-06-04 11:26:44',NULL,NULL),(1285,'ウェルカムホール','IMGP5672.jpg','ヤシの樹が植えてある憩いの場。子どもの遊具やプリクラなどがある。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:33:18','2007-06-04 10:27:07','2007-06-04 11:27:49',NULL,NULL),(1286,'離陸するAir transse機','IMGP5675.jpg','ただでさえ小さい機体なので僕のレンズではこれが限度・・・',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:37:52','2007-06-04 10:34:40','2007-06-04 11:28:00',NULL,NULL),(1287,'着陸したANA機','IMGP5676.jpg','右下の整備士さん（？）を見るとジェット機の巨大さに改めて気付きます。',801,543,99,67,38,26,NULL,NULL,'2007-05-30 15:39:57','2007-06-04 10:31:45','2007-06-04 11:28:22',NULL,NULL),(1288,'着陸したANA機２','IMGP5678.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:40:53','2007-06-04 08:58:12','2007-06-04 11:28:33',NULL,NULL),(1289,'待機するJAL機','IMGP5679.jpg','のしっぽ。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:43:15','2007-06-04 08:58:02','2007-06-04 11:28:49',NULL,NULL),(1290,'離陸するANA機２','IMGP5683.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:46:48','2007-06-04 10:36:44','2007-06-04 11:29:00',NULL,NULL),(1291,'離陸するANA機３','IMGP5685.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:46:56','2007-06-04 10:37:08','2007-06-04 11:29:03',NULL,NULL),(1292,'滑走するポケモン','IMGP5686.jpg','離陸の瞬間・・・！手前にたくさん見えるのは自衛隊機です。',810,542,100,66,39,25,NULL,NULL,'2007-05-30 15:48:36','2007-06-04 10:39:13','2007-06-04 11:29:43',NULL,NULL),(1293,'ポケモン、離陸！','IMGP5691.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:48:46','2007-06-04 10:39:07','2007-06-04 11:30:13',NULL,NULL),(1294,'空飛ぶポケモン','IMGP5695.jpg','綺麗に撮れてなくてすみませんm(_ _)m',810,542,100,66,39,25,NULL,NULL,'2007-05-30 15:48:55','2007-06-04 10:40:57','2007-06-04 11:30:28',NULL,NULL),(1295,'旋回するポケモン','IMGP5696.jpg',NULL,810,542,100,66,39,25,NULL,NULL,'2007-05-30 15:49:01','2007-06-04 10:41:58','2007-06-04 11:30:32',NULL,NULL),(1296,'ウェルカムホール２','IMGP5697.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:50:18','2007-05-30 15:50:20','2007-06-04 11:27:04',NULL,NULL),(1297,'4Fレストラン街','IMGP5699.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:50:47','2007-05-30 15:50:50','2007-06-04 11:30:52',NULL,NULL),(1298,'空の駐車場','IMGP5700.jpg',NULL,810,542,100,66,39,25,NULL,NULL,'2007-05-30 15:52:12','2007-06-04 10:44:53','2007-06-04 11:27:04',NULL,NULL),(1299,'那覇空港模型','IMGP5704.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:52:57','2007-05-30 15:52:58','2007-06-04 11:31:09',NULL,NULL),(1300,'那覇空港の土産物屋','IMGP5705.jpg','さすが観光地だけあってすごいにぎわいです。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:55:03','2007-05-30 15:55:04','2007-06-04 11:27:04',NULL,NULL),(1301,'トロピカルフルーツ','IMGP5706.jpg','沖縄ならではのフルーツ。・・・食べたい。ちなみに沖縄は「亜」熱帯なので「サブ」トロピカルです。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:55:28','2007-05-30 15:55:30','2007-06-04 11:31:45',NULL,NULL),(1302,'手荷物検査口','IMGP5707.jpg','ここにはなるべく早く来てください。出発直前に大混雑して離陸が遅れる事もざらですので。（泣）',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:57:20','2007-06-04 10:57:14','2007-06-04 11:27:04',NULL,NULL),(1303,'国営沖縄記念公園・那覇空港出張所','IMGP5709.jpg','まあ、美ら海水族館一帯の事です。「世界一大きなアクリルパネル越しに見るジンベエザメとオニイトマキエイ（マンタ）。ジンベエ・マンタの複数飼育や生きたサンゴの大規模飼育は世界初の試みです。」との事。',810,542,100,66,39,25,NULL,NULL,'2007-05-30 15:59:28','2007-06-04 10:55:19','2007-06-04 11:33:09',NULL,NULL),(1304,'那覇空港の水槽','IMGP5711.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:59:45','2007-05-30 15:59:48','2007-06-04 11:33:11',NULL,NULL),(1305,'ゆいレール・那覇空港駅２','IMGP5713.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 16:02:51','2007-05-30 16:02:52','2007-06-04 11:33:28',NULL,NULL),(1306,'ゆいレールの車庫','IMGP5717.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 16:11:21','2007-06-04 10:59:18','2007-06-04 11:33:35',NULL,NULL),(1307,'停車するゆいレール','IMGP5719.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 16:19:12','2007-06-04 10:59:43','2007-06-04 11:33:39',NULL,NULL),(1308,'ゆいレールの運転手さん','IMGP5720.jpg',NULL,810,543,100,67,39,26,NULL,NULL,'2007-05-30 16:19:52','2007-06-04 11:00:10','2007-06-04 11:33:49',NULL,NULL),(1309,'ゆいれーる・赤嶺駅','IMGP5721.jpg','日本最南端の駅。最北端駅北海道稚内駅より2500km。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 16:35:23','2007-06-04 11:01:26','2007-06-04 11:33:59',NULL,NULL),(1310,'日本最南端駅の碑','IMGP5722.jpg',NULL,810,543,100,66,39,25,NULL,NULL,'2007-05-30 16:35:49','2007-06-04 11:02:09','2007-06-04 11:34:06',NULL,NULL),(1311,'２千円札推進運動','IMGP5723.jpg','裏面の首里城守礼門の印刷がありますからね。小渕首相は個人的にも沖縄への思い入れがあったようです。',810,542,100,66,39,25,NULL,NULL,'2007-05-30 16:36:13','2007-06-04 11:04:55','2007-06-04 11:34:16',NULL,NULL),(1312,'航空自衛隊那覇基地の飛行機たち','IMGP5728.jpg','もう現役を引退した機体たちでしょうか。',810,542,100,66,39,25,NULL,NULL,'2007-05-30 16:52:50','2007-06-04 11:06:46','2007-06-04 11:34:34',NULL,NULL),(1313,'航空自衛隊那覇基地','IMGP5729.jpg','那覇空港の隣にあります。理由は那覇空港と滑走路を共有しているから。那覇空港は軍空港でもあるわけですね。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 16:53:08','2007-06-04 11:09:28','2007-06-04 11:34:40',NULL,NULL),(1314,'ゆいレール・首里駅より','IMGP5730.jpg','終点。',810,543,100,67,39,26,NULL,NULL,'2007-05-30 17:20:03','2007-06-04 11:11:05','2007-06-04 11:34:56',NULL,NULL),(1315,'ポケモンジェット２','IMGP5665.jpg','まもなく離陸準備に入ります！',810,543,100,67,39,26,NULL,NULL,'2007-05-30 15:29:44','2007-05-30 15:29:46','2007-06-04 11:55:11',NULL,NULL);
