INSERT INTO `tag_mst` VALUES (1,'沖縄本島',NULL,'2007-06-02 19:36:08',NULL,'正式名称は沖縄島（おきなわじま）。面積は1206km²で、沖縄県の陸地面積の半分以上を占める。\r\n四国のおよそ15分の1の広さで、島と言ってもけっこう広い。\r\n沖縄の人口の9割以上にあたる約123万人が本島に住んでいる。\r\nまた、アメリカ軍の施設が広く分布しており、島の面積の約20%を占めている。','Okinawa Island'),(2,'シーサー',NULL,'2007-06-03 21:16:52',NULL,'百獣の王・ライオンをモチーフにした獅子像が１５世紀半ばに中国から伝わったもの。魔除けである。なお、本土の狛犬は同じものが唐時代に朝鮮半島を経由して伝わった兄弟分。現在は八重山では割と狛犬に近いものが多く見られ、沖縄本島では個性的でエキゾチックなものが多い。<br>\r\n1975年の海洋博（現在は美ら海水族館）で取り上げられて以来、沖縄のシンボルとして再認識され、土産向けなどにライトな方向に発展している。','See-Saa'),(3,'オブジェ',NULL,'2007-06-02 20:16:08',NULL,'沖縄で見つけた、気になる物たち。','Objet'),(4,'壁',NULL,'2007-06-02 20:17:10',NULL,'壁ひとつとっても本土とは材質や表情が違ったり、よく見てみると面白かったり。','Wall'),(5,'看板、標識',NULL,'2007-06-02 20:20:32',NULL,'沖縄には標語や看板が多い。本土のように形式張った口先だけのもあるが、本気で訴えかけんとするあまり笑えるものも多い。','Billboard,Sign'),(6,'石敢當',NULL,'2007-06-03 21:17:26',NULL,'15〜16世紀に中国より伝わった魔除け。起源には諸説あり、石氏という無敵（＝敢當）の武人にあやかったものであるとか、かの有名な太公望の諡からとった・・・等々。\r\n<BR>現在街の至る所に見られるが、人々からはあまり意識されていないようだ。','Ishi-Ganto'),(7,'樹木、緑',NULL,'2007-06-02 20:38:40',NULL,'沖縄は緑が多い。それも整備されたものではなく、勝手に繁ったものが。','Green'),(8,'がじゅまる',NULL,'2007-06-03 21:55:57',NULL,'宮古島市、糸満市などの市木に指定されている常緑性高木。亜熱帯に幅広く分布。樹高20ｍにもなり、ヒゲ状の気根を出し、やがて太くなり地面に着くと支持根となり、元の幹と一体化し巨大な幹を形成する。無花果で花はつけない。<BR>沖縄ではキジムナー（やんばるではブナガヤ）という髪の赤い少年の精が棲むと言われている。','Gajumaru,Gajimaru'),(9,'空',NULL,'2007-06-03 17:24:44',NULL,'色彩には人々の感情を動かす力がある。空の色はやがてそこに住む人々の気質を形成する。明るく、強く、そして深い、時として残酷な沖縄の空色。','Sky'),(10,'雲',NULL,'2007-06-02 20:56:41',NULL,'沖縄の雲は夏の雲。生き物のように膨らみ、流れ、雨を降らせる。','Cloud'),(11,'遺跡、グスク',NULL,'2007-06-03 21:18:54',NULL,'沖縄に残る遺跡には琉球王国時代のものが多い。特にグスクは城と書き、豪族らの拠点であり、今帰仁（なきじん）城など各地にその跡がある。<BR>ただ、本土の城とは異なり、殿様を守るものではなく御嶽とご神体を守るためのものであったようだ。','Remain,Gusuku'),(12,'海',NULL,'2007-06-03 21:20:50',NULL,'旅行者の間でしばしばどの島の海が一番綺麗かという議論が起こるが、言うまでもなく客観的な基準はない（透明度で測るというのは少しロマンに欠けるし）。<BR>シュノーケリング、ダイビング、あるいは砂浜から、崖の上からなど、シチュエーションが違えば順位も変わるのでそれぞれの海にそれぞれの魅力があると思っていい。この個性を讃える呼称として島の名前を入れて◯◯ブルーがある。','Ocean'),(13,'花',NULL,'2007-06-02 21:11:12',NULL,'沖縄の人は花好きらしく園芸も盛んだが、野生の花を見るとはっとする。動詞のflowを思わせるように、沖縄の花は生命力が溢れ、巡り、流れているように咲く。','Flower'),(14,'テッポウユリ',NULL,'2007-06-02 21:17:12',NULL,'５つの市町村花に指定されている、真っ白いユリ。花の根元が折れ曲がり、横向きに花を咲かせる。沖縄ではユイ。ユリがなまっただけ？','Easter-Lily'),(15,'飲食店',NULL,'2007-06-03 21:19:55',NULL,'表通りから少し離れると地元の人たちが利用する食堂がたくさんある。オバー食堂と勝手に命名しているが、６０を優に過ぎたおばちゃんが元気に切り盛りしてる味のある店が多い。なお食堂のお約束として安くてボリュームがある。','Restaurant'),(16,'猫',NULL,'2007-06-04 08:35:13',NULL,'生き物に関して寛容なのか、島は自分たち人間のものだという意識がないからか、沖縄は野良猫が（犬も）多い。その分生き残れずに死んでいく命も多いわけだが。<BR>方言名はマヤ。なおこれは八重山では琉球王朝の役人を指す隠語でもある。','Cat'),(17,'斜陽',NULL,'2007-06-03 23:08:04',NULL,'ここでは夕日に染まった景色の写真を指す。','Afternoon Sun'),(18,'お店',NULL,'2007-06-02 21:26:13',NULL,'昔ながらの街には昔ながらの個人商店が味わいを醸し出しながら残っていたりする。','Store,Shop'),(19,'宿、ゲストハウス',NULL,'2007-06-02 21:29:39',NULL,'泊まるのはゲストハウスばかり。ゲストハウスはトイレ、キッチン、リビングなど共用で、素泊まりを基本とする宿。寝室も相部屋のドミトリーと個室とがある。ちなみに沖縄に限らず東京や京都にもある。','Hotel,GuestHouse'),(20,'トイレ',NULL,'2007-06-02 21:30:21',NULL,'時として面白い造形を見せる施設、または設備。','Toilet'),(21,'家、古民家',NULL,'2007-06-02 21:31:33',NULL,'伝統的な赤瓦の家を始め、色々な意味で目を引いた家たち。','House,Old House'),(22,'街並',NULL,'2007-06-03 23:08:24',NULL,'遠くから眺めれば街の持つ秩序、あるいは混沌が感じられる。','Town View,Vista'),(23,'橋',NULL,'2007-06-02 21:41:56',NULL,'小さい島が多く川の少ない沖縄では海を渡る橋が多い。','Bridge'),(90,'泡盛、オリオン',NULL,'2007-06-04 00:18:37',NULL,'泡盛は島酒＝シマザキ（あるいは単に島＝シマー）。ビールと言えばオリオンの事。','Awamori,Orion Beer'),(25,'アート',NULL,'2007-06-02 21:44:13',NULL,'米軍駐留の影響か、ウォールアートがそこかしこにあったりするのだが、それがまたどこか沖縄臭を漂わせている。','Art'),(26,'宮古島、宮古諸島',NULL,'2007-06-03 21:25:19',NULL,'沖縄本島から南西に300km弱離れた三角形の宮古島とのその周囲の池間島、来間島、伊良部島、下地島、多良間島、水納島を指す。総面積225km。人口55547人（07/4/30時点）。人口の９割は宮古島に住む。<BR>\r\n山がないため風を遮るものがなく、よく台風の通り道になるので、俗に台風銀座と呼ばれる。1966年には観測史上最強の瞬間最大風速の台風を経験している。ただし観測機器が吹き飛んで観測史上に含まれない台風もいくつかあったらしい。','Miyako-Island'),(27,'月',NULL,'2007-06-02 22:15:41',NULL,'日射しが強いせいか、沖縄では若干影が薄い気がする。','moon'),(28,'夜明け',NULL,'2007-06-02 22:28:44',NULL,'沖縄は日本の西端にあるので日の出、日没は共に遅い。しかし南端（有人島）でもあるため日照時間が長く、日の出はやや早く、日の入りはさらに遅いという事になる。','Dawn'),(30,'建物',NULL,'2007-06-02 22:30:18',NULL,'公共の施設など。','Building'),(31,'犬',NULL,'2007-06-02 22:36:26',NULL,'先島地方では放し飼いが多く、その場合犬が自分で散歩するため自主性のある犬が多い。方言名はイン（ただなまっただけやね）','Dog'),(32,'虫',NULL,'2007-06-02 22:39:18',NULL,'写真にはないが、沖縄は蚊が速い。ハエ並みに速い。方言名はガジャン。あと、ゴキブリ。デカイ。方言名はトービーラー。本島のは攻撃的で、八重山のはノンビリやだったり、地域性があるようだ。','Insect'),(33,'ポスト',NULL,'2007-06-02 22:41:05',NULL,'全国どこに行っても同じ色。当然沖縄でも同じ色。','Mail-Box'),(35,'ブーゲンビリア',NULL,'2007-06-02 22:46:38',NULL,'那覇市の市花。花に見える赤い部分は包葉であり、中の白いものが実際の花。名前は原種をブラジルで発見したフランス軍人から。','Bougainvillea'),(36,'ビーチ',NULL,'2007-06-02 22:47:40',NULL,'沖縄本島の人は浜とは言わない。ビーチである。','Beach'),(82,'墓地、亀甲墓',NULL,'2007-06-03 23:36:02',NULL,'冠婚葬祭は非常に地域色の濃いものであるが、沖縄の墓のあれこれは本土とはかけ離れている。<br>\r\nまず、沖縄の墓には暗い印象があまりない。門中墓（一族の墓）に集まってご先祖様も交えてみんなで泡盛を飲む祭りもあり、きっと死後の世界のイメージも明るいのかもしれない。そのためか住宅地の真ん中にこつ然と巨大な墓があったりする。<br>\r\nまた沖縄の墓で特徴的な亀甲墓の曲線美はまさに女性を象ったものであり、即ち墓の入口は産道である。その底流には女より産まれて女に還るという思想があり、沖縄の母性の強さを象徴している。','Tomb'),(38,'工事、開発',NULL,'2007-06-02 22:52:09',NULL,'琉球処分があり、米軍統治があり、日本復帰があって、そして今観光開発がある。壊されていくものと新しく作られるものの過程を撮ったもの。','Under-Construction,Development'),(39,'キューピー',NULL,'2007-06-03 21:25:56',NULL,'1909年に米国のローズ・オニールによって雑誌向けのイラストとして、キューピッドを元に創られたキャラクターである。後にそれを元に人形が作られた。当初はドイツ作られたビスク・ドール製だったが、第一次世界大戦後は布製や、おが屑を原料としたコンポジション、セルロイド製になり今では多くのものがソフトビニル製となっている。（wikipediaより）<BR>沖縄とは全く関係がない。','Kewpie'),(91,'ゆいレール',NULL,'2007-06-04 00:21:16',NULL,'沖縄は車社会。そんな中唯一の鉄道（モノレール）は那覇空港から国際通りを通って首里城に向かうという、何とも観光客相手の路線。まあ地元の人も近くに駅がある人は利用するようですが。','Yui-Rail(Monorail)'),(41,'酒造',NULL,'2007-06-02 23:01:08',NULL,'沖縄は地酒嗜好が強く、島ごとに歴史のある酒造所がある。','Distillery'),(42,'旅人、バックパッカー',NULL,'2007-06-02 23:25:00',NULL,'観光、息抜き、自分探し、人生の休暇（退職）等々の理由で２〜３泊、一週間、一ヶ月、一年滞在する様々な人々。','Traveler,Backpacker'),(43,'祭、節',NULL,'2007-06-02 23:26:43',NULL,'沖縄には祭りや節が多い。それも神聖な意味合いの残るもの。観光客は見れないものもある。','Fesrtival,Feast'),(44,'サンゴ',NULL,'2007-06-02 23:27:59',NULL,'一般に言われる珊瑚とはサンゴ虫の集合体であり、それらが集まって珊瑚礁を形作る。形も色も様々。','Coral'),(81,'夕日',NULL,'2007-06-03 23:10:32',NULL,'沖縄は日本の南端かつ西端に位置しているので夕日が日本で一番最後に落ちる。','setting Sun'),(46,'ハイビスカス',NULL,'2007-06-03 21:26:17',NULL,'方言名アカバナー。南国を象徴するような大きく鮮やかな花。アオイ科フヨウ属の低木の総称である。赤を始め様々な色の270もの品種があると言われる。','Hibiscus'),(47,'貝殻',NULL,'2007-06-02 23:59:11',NULL,'貝殻のもやはり鮮やかな暖色系が多いかな〜たぶん。','Shell'),(48,'自転車、バイク、車',NULL,'2007-06-03 00:10:57',NULL,'沖縄は車社会。でも一人でわナンバー（レンタカー）とYナンバー（米軍属）が多い沖縄ですが、一人でのんびり回るなら原付で風を切るのがおすすめです。','Bike,Motor Bike,Car'),(49,'池間島',NULL,'2007-06-03 00:19:04',NULL,'宮古島北部にある外周12kmの小さな島。1992年に完成した1452mの池間大橋によって宮古島に渡れる。','Ikema Island'),(50,'島人',NULL,'2007-06-03 00:23:52',NULL,'全都道府県の中で沖縄人（うちなーんちゅ）は郷土愛の強さでダントツ一位。沖縄に誇りを持っている。','Shima-n-chu'),(51,'魚、亀、海の生物',NULL,'2007-06-03 21:14:12',NULL,'沖縄の海には色とりどりの生き物がいる。透明な海の青がその鮮やかさをよく引き立てる。','Fish,Turtle,Life in the sea'),(52,'イベント',NULL,'2007-06-03 11:18:16',NULL,'出来事。ここでは祭りや行事ではなく名もなきパーティなどの写真を指す。','Event'),(53,'夜、夜景',NULL,'2007-06-03 11:22:28',NULL,'夜は光量が少ないのでシャッターが遅くなり、手ぶれが・・・（泣）','Night,Night Scene'),(54,'雨',NULL,'2007-06-03 11:24:02',NULL,'時として、スコールのように激しく。さすが亜熱帯です。','Rain,Shower'),(55,'石垣島',NULL,'2007-06-03 11:29:21',NULL,'沖縄本島の南西約400kmの位置にある沖縄で三番目に大きい島。八重山各島への航路が集中しており、八重山の玄関口である。\r\n近頃は開発が集中しバブル状態になっているようだ。','Ishigaki Island'),(56,'八重山諸島',NULL,'2007-06-03 11:34:22',NULL,'石垣島（石垣市）を始め、竹富島、小浜島、黒島、西表島、新城島、波照間島（竹富町）、と与那国（与那国町）の一市二町からなる。日本の最南端最西端の地域である','Yaeyama　Islands'),(57,'鳥',NULL,'2007-06-03 17:25:49',NULL,'都市部の鳥は本土とそう変わらないが、やんばるや離島に行くと沖縄独特の鳥がその鳴き声を聞かせてくれる。','Bird'),(59,'西表島',NULL,'2007-06-03 11:42:30',NULL,'沖縄県で２番目に大きい島。八重山諸島に属し島の９割がジャングルという独特な雰囲気の島である。島はマングローブに包まれ独自の生態系を持ち、東洋のガラパゴスと呼ばれる。','Iriomote Island'),(60,'マングローブ',NULL,'2007-06-03 11:44:04',NULL,'汽水域（海水と淡水の混じる水域）に生える樹木の総称。','Mangrove'),(61,'川',NULL,'2007-06-03 12:20:28',NULL,'沖縄は川が少なく、沖縄本島、石垣島、西表島にしか存在しない。ゆえに水不足がしばしば問題になる。','River'),(62,'山',NULL,'2007-06-03 11:54:42',NULL,'沖縄で一番高い山は於茂登岳（石垣島）の525mであり、ちなみに二番目は503mの与那覇岳（本島）である。','Mountain'),(64,'牛、馬、ヤギ',NULL,'2007-06-03 12:17:22',NULL,'牛、馬はそのまま呼ばれるが、ヤギだけはヒージャーという方言名がある。ヤギ汁（ヒージャー汁）は祝い事などがあるとよく振る舞われるが、本土の人には好みが分かれるところ。','Cow,Horse,Goat'),(65,'もくまおう',NULL,'2007-06-03 12:05:38',NULL,'本土の人はよく松と勘違いするが針葉樹ではなく広葉樹。折れてもまた同じところから生えてくるので防風林に使われる。','Mokumaou'),(66,'わらばー、子ども',NULL,'2007-06-03 17:27:59',NULL,'たぶん今は沖縄のわらばーも本土の子どもも大差なくなっているのではないかと。まあどっちにしても子どもはかわいい。','Children'),(67,'オバァ',NULL,'2007-06-03 17:23:12',NULL,'沖縄で一番偉い生物。本土のとは比較にならない生命力を持ち、名実共に沖縄の中心的存在。','Oba'),(68,'ヘビ、ハブ',NULL,'2007-06-03 17:20:45',NULL,'沖縄で一番恐れられている生き物（米軍機、オバァをのぞく）。咬まれたら早急に病院に行く事。','Snake,Habu'),(70,'果物、野菜',NULL,'2007-06-03 21:36:21',NULL,'沖縄の野菜や果物。亜熱帯臭がぷんぷんです。','Fruits,Vegetable'),(71,'路地裏',NULL,'2007-06-03 23:11:46',NULL,'沖縄は空も海も広大なイメージがあるが、那覇の旧市街などに行けばかなり建物はひしめき合っている。狭い路地裏にはその街の真の姿が見える。','Back Street'),(72,'来間島',NULL,'2007-06-03 21:55:14',NULL,'宮古島の南西に位置する小島。人口は200人にも満たない。全長1690mの来間大橋で宮古島と繋がっている。ちなみにこの橋は農道橋であり、農道橋としては日本最長。','Kurima Island'),(73,'伝統工芸品、工房',NULL,'2007-06-03 21:58:45',NULL,'沖縄の工芸品。やはり日射しの強い風土には鮮やかな色彩が映える。','Traditional Art Craft,Atelier'),(75,'アメリカー',NULL,'2007-06-03 22:24:15',NULL,'アメリカーというのは方言名（？）でアメリカ人を指す。が、ここではアメリカっぽいもの、アメリカ臭のする写真。','American'),(76,'雷',NULL,'2007-06-03 22:32:30',NULL,'沖縄に雷が多いか少ないかはちょっとわかりません・・・','Thunderbolt'),(77,'朝日',NULL,'2007-06-03 22:33:57',NULL,'朝日は全国どこで観ても美しいのですが、沖縄の綺麗な景色を染める朝陽もいいものです。','Rising Sun'),(78,'御嶽、寺社',NULL,'2007-06-03 23:01:11',NULL,'御嶽は本島ではウタキ、宮古ではスク、八重山ではオンと発音され、石、泉、樹、山全体や島自体など、自然物がご神体として祭られている。宮古、八重山地方には鳥居のあるものも多いが、これは明治政府の皇民化によるもので、本来は置かない。<br>\r\nなおそれとは別に寺社や教会も存在しており、寺社については琉球王朝の時代から存在していたようだ。それらの間に深い対立はなく、お上の管理する寺社と民間信仰の御嶽が共存していたようだ。','Prayer Place,Shrine,Temple'),(79,'蝶、とんぼ',NULL,'2007-06-03 23:03:27',NULL,'離島など自然の多いところには色々な蝶が舞っている。やはり鮮やかな色模様。','Butterfly,Dragonfly'),(80,'食べ物、飲み物',NULL,'2007-06-03 23:04:00',NULL,'沖縄の食べ物、飲み物。','Food,Drink'),(84,'公園',NULL,'2007-06-03 23:37:52',NULL,'沖縄の公園は緑が豊富。しかも植えられてものではなく、元から生えていたものが残されているので大きい。<br>なお当然公園というものは都市部にしか存在しない。','Park'),(85,'竹富島',NULL,'2007-06-04 00:05:47',NULL,'八重山諸島に属し石垣島から船で10分程度の小さな島。人口は350人程度。<BR>\r\n県内有数の観光地であるにも関わらず全ての家が赤瓦で、集落の道は全て白砂という昔の姿を保っているのは建設物や景観に対する厳しい制限や、島にとけ込まない者に土地を売る事ができないなどの条例や憲章の力が大きい。最近は本土から移住者によって少しずつ変わってはいる。単純に古さに固執する訳ではないという事か。<br>\r\nなお、2006年6月に無防備地区宣言を盛り込んだ竹富町平和条例案が町議会に提出され、賛成少数で否決されている。','Taketomi Island'),(86,'ポスター、メッセージ',NULL,'2007-06-04 00:07:42',NULL,'街灯などに張られる様々な主張。','Poster,Insistence'),(87,'船、フェリー',NULL,'2007-06-04 00:13:30',NULL,'沖縄では空港のある島は多くないので船での移動が多くなる。料金的には最近では飛行機の割引も安くなっているので必ずしも船が安いとは言い切れないが、船旅には船旅の醍醐味があるのも事実。<br>\r\nなお当然物流も同じ事情なので本や雑誌などの発売日は離島に行けば行くほど遅れる。木曜日発売の週刊誌が水曜日に届くのもざら。','Ship,Ferry'),(88,'飛行機、ヘリ',NULL,'2007-06-04 00:15:57',NULL,'米軍のものも自衛隊のものも民間機も不明機もあります。','Airplane,Helicopter'),(94,'通り、道路',NULL,'2007-06-04 00:28:24',NULL,'道路には、不思議な魅力がある。が、まだ僕はそれを語る言葉を持たない。','Street, Road'),(96,'ライヴ、路上パフォーマンス',NULL,'2007-06-04 08:29:03',NULL,'都市部では盛んですが、郊外ではほとんど見かけません。','Live, Street Parformance'),(97,'最◯端、日本一、世界一',NULL,NULL,NULL,NULL,NULL),(99,'空港',NULL,NULL,NULL,NULL,NULL),(98,'米軍基地、自衛隊',NULL,NULL,NULL,NULL,NULL),(95,'ヤモリ、カエル',NULL,'2007-06-04 08:26:00',NULL,'ヤモリは家守。家の周りに住み（中にも入ってくるけど）蚊などの害虫を食べるありがたい存在。カエルは本土のより大きいけど、都市部ではあまり見かけないねぇ。','Lizard,Frog');
